ved',NULL,NULL,'784662874544792',NULL,NULL),(13,656780568400769,'Resident of 20011 Zip Code','Eligibility',NULL,NULL,'1185051455558186',NULL,NULL),(14,656944907385650,'English as Second Language','Eligibility',NULL,NULL,'946406110593174,617081192222015',NULL,NULL),(15,651281137045548,'Family Counseling','Program','Dealing with the problems of parenting. Individual and group sessions. Marital; Parent and Child relationships.( By Appointment Only)','1276678931351667','1120743935334776,1104683959276927,653156323573606',NULL,NULL),(16,670990591619199,'Mothers','Eligibility',NULL,NULL,'1238586489770478',NULL,NULL),(17,670413521970743,'All Ages','Ages Served','Serves children, youth, adults, and the elderly.','795756022910298','942312969809968,674557198522049,1122242214354849,727116699390008',NULL,NULL),(18,664148755918958,'Formerly Incarcerated','Eligibility','People who have been in prison.','1131980011333623','1300980508291929,888015364104840,948442047347066,988930242117816,590895767819582,1215438821283570,814382562390416,953130575650955,733244062080278,699918289813778,1020934285482366','1297547838260579',NULL),(19,618828421943202,'Kensington Clubs','Program','Since 2008, the Kensington Clubs have been offering activities, camaraderie and coping skills for people in the early stages of diagnosed memory loss. Participants enjoy stimulating cognitive and physical programs, morning coffee and lunch in a supportive environment among peers. Caregivers receive respite and support. We have multiple locations for our Kensington Clubs throughout Montgomery County.\n\nKensington Club is specially designed to serve older adults with diagnosed early stage dementia or mild cognitive impairment. Since 2008, we have been serving people who:\n\nCan enjoy the company of others with minimal risk of wandering,\nTake medication independently or with verbal supervision only,\nAre able to eat and use the bathroom without assistance,\nAmbulate independently or with a cane.\nThe Club is an outlet for those with early memory loss who desire opportunities to challenge their mind and try new interests, who want to be pro-active and do something about their memory loss, and who can benefit from being around others in a stimulating and positive environment.\n\nThrough social interaction, mental challenges and physical activity, the Club seeks to maintain an intimacy and friendship that set it apart from other social day programs. Each member is treated as an individual and a sense of belonging to the Club is evident. Members find common ground and make friends. They recognize that Kensington Club caters to their individual interests and personalities in an atmosphere of warmth and acceptance.','855094084464049','657179015884472,1134764669826308','685766591979438,1179174778771993,805806723754090',NULL),(20,684980356183378,'Community Wellness','Program','When we feel our best, we can do and be our best. Our team connects DC residents with the healthy food options, shelter, and support needed on the journey to feeling well and living well!','761153930697275','825451959778479,1187200756463947,1282686227944763,1296433586474206,924655410570415,928788698938707',NULL,NULL),(21,740331137219886,'Youth Services','Program','Success in school sets the path for success in life. Our team educates, motivates, and encourages DC’s youth on their journey inside, outside, and beyond the classroom!\n\nUPO’s Youth Services Division is here to help keep your child fulfilled, focused, and moving forward throughout the day and over the years. Our education and enrichment programs for first-graders to high school seniors are designed to make kids feel better about themselves, improve their academic and social skills, and become productive members of society. We also provide family support services to help create a supportive, nurturing setting for children and their families to develop, grow, and succeed.','761153930697275','1253744104425599,777260696695053,1300660045853572',NULL,NUL