or older adults with physical, cognitive or emotional challenges. Licensed by the State of Maryland, Department of Health and Mental Hygiene, Office of Health Quality, Misler provides assistance and stimulation by an interdisciplinary team of nurses, social workers, activities leaders and aides.\n\nMisler Center services and activitiesAt Misler, staff all work together to provide an encouraging and supportive therapeutic environment for participants.\n\nOur staff to participant ratio goes well beyond the requirements of the State of Maryland, demonstrating our commitment to excellence. Services include but are not limited to:\n\nDoor-to-door, fully accessible transportation provided by JCA’s ElderBus fleet\nA daily choice among a variety of activities designed to meet a range of interests, needs and abilities and provide enriched cognitive and physical stimulation\nHealth services from RNs – monitoring of blood pressure, blood sugar, weight; medication administration\nAssistance with every day activities from certified nursing assistants and geriatric aides\nSocial work services, including support for both participants and their families\nEasy access to physical, occupational and speech therapy\nOn-site regular podiatry services\nNutritious and hot four course Kosher meals and snacks, with attention to special diets','855094084464049','955710918748274,1289508652850921,602724412494897,1106771248483191,893746684671899','694216969315685',NULL),(88,1053289039718908,'Seniors','Program','JSSS\'s program for seniors.','970560028876577','1127640457224641,762171918332918,964012421803449,1201397185768590,785647685413221,833788770520302',NULL,NULL),(89,1079714166824390,'Family Advocacy','Program',NULL,'1164024351359039','927643315007217,902098981922569,1290043633447090',NULL,NULL),(90,1063441922826031,'Adolescents','Eligibility',NULL,NULL,'884244585280076',NULL,NULL),(91,1070669054292991,'Resident of 20002 Zip Code','Eligibility',NULL,NULL,'1185051455558186',NULL,NULL),(92,111