INSERT INTO `organizations` VALUES (1,572890347249315,'St Anthony of Padua Church (VA)',NULL,NULL,NULL,'A local church offering services to community members.',NULL,NULL,NULL,'https://stanthonyofpaduacommunity.com/parish/',NULL,4,NULL,NULL,NULL,NULL,'873611419029370','1346383381421883,1138656191558408','1199654488652628',0,NULL,NULL,NULL),(2,597291118069880,'We Are Family',NULL,NULL,NULL,'Grounded in grassroots senior leadership, We Are Family mobilizes a committed corps of volunteers to reach out to isolated inner-city seniors with free services, advocacy, and companionship, building a network of caring eyes and ears that enables at-risk seniors to age in place. More than simply a social service provider, We Are Family is a bold experiment in building caring, just and inclusive community.','info@wearefamilydc.org',NULL,NULL,'https://www.wearefamilydc.org/',NULL,4,NULL,NULL,NULL,NULL,'1229834582759480','585670788788642','903036719647021',0,NULL,NULL,NULL),(3,548126332764833,'Whitman-Walker Health',NULL,NULL,NULL,'A program of Whitman-Walker Health is offering free individual and group therapy to youth and young adults who have experienced or witnessed a crime. The program is completely voluntary and partners with clients to meet their own individual needs while providing culturally competent, trauma-informed care and treatment. This program aims at reducing barriers for youth/young adults in accessing mental health services. Clinicians will meet clients where they are, both physically within the community and emotionally during treatment. Criteria for enrollment in these services includes the following: Ages 13-24 years old; Witnessed or experiences a crime (no police report required). For more information about this program or to make a referral, please contact Timothy Elliott at (202) 207-2361 or telliott@whitman-walker.org.',NULL,NULL,NULL,'http://whitman-walker.org',NULL,4,NULL,NULL,NULL,NULL,'1129649174532000','1226809070395519','1272844736960116',0,NULL,NULL,NULL),(4,562836772362344,'Association for Clinical and Translational Science (ACTS)',NULL,NULL,NULL,'The purpose of the Association for Clinical and Translational Science (ACTS) can be broken up into four realms. These four areas of focus are research, education, advocacy, and mentoring.\n\nResearch\nACTS supports investigations that continually improve team science, integrating multiple disciplines across the full translational science spectrum: from population based and policy research, through patient oriented and human subject clinical research, to basic discovery. Our goal is to improve the efficiency with which health needs inform research and new therapies reach the public.\n\nEducation\nACTS is the academic home for the disciplines of research education, training, and career development for the full spectrum of translational scientists. Through meetings, publications, and collaborative efforts, ACTS will provide a forum for members to develop, implement, and evaluate the impact of research education programs.\n\nAdvocacy\nACTS provides a strong voice to advocate for translational science, clinical research, patient oriented research, and research education support. We will engage at the local, state, and federal levels and coordinate efforts with other professional organizations.\n\nMentoring\nACTS will promote investigations and dissemination of effective models for mentoring future generations of translational scientists. Through collaborative efforts, ACTS will provide a forum for members to share studies, promote best practices, and optimize professional relationships among trainees and mentors.',NULL,NULL,NULL,'http://www.actscience.org/',NULL,4,NULL,NULL,NULL,NULL,'1123747363862749','877776396812857,1107027116589953','796479538430138',0,NULL,NULL,NULL),(5,574964812525513,'Housing Counseling Services',NULL,NULL,NULL,'Provides housing counseling services, training, and advocacy for low and moderate income homebuyers, homeowners, and tenants in the Washington Metropolitan area. Emergency Rental Assistance, Rental Housing Search, Foreclosure Prevention, Eviction Prevention, Home Purchase, Home Renovations, Tenant Counseling, Homeless Veterans Rehousing, Lead Safe Repairs, Coop/condo training, Credit Counseling, Reverse Mortgage Counseling, Housing Preservation Counseling','info@housingetc.org',NULL,NULL,'http://housingetc.org',NULL,4,NULL,NULL,NULL,NULL,'1140570813901169,627629263527494,1243832082519507,705771849785076,841132371028942,581022793280171','916077019265036,676485134262687,1178055279307047','947853021041099,1189388637168303',0,NULL,NULL,NULL),(6,592260988502497,'DC Department of Aging and Community Living',NULL,NULL,NULL,'Provides Intergenerational Programs services, including Opportunities for older adults to teach and learn from DC\'s youth.','dcoa@dc.gov',NULL,NULL,'https://dcoa.dc.gov/',NULL,4,NULL,NULL,NULL,NULL,'920928473432747','1273926928135629,1266100703604119','790873813272838',0,NULL,NULL,NULL),(7,605134586578120,'Elaine Ellis Center of Health',NULL,NULL,NULL,'Health center in DC and Maryland providing comprehensive medical services.\n\nOur History\nThe Elaine Ellis Center of Health was founded in 2010 by the relatives of the late Elaine Ellis, who lost her battle with cancer in 1993.\nShe was the matriarch of her family and a vibrant presence in her community. Her kindness and passion to serve others who were less fortunate extended beyond her family and friends to anyone who was in need of food, shelter, advice, and good conversation. Though she is unable to see the fruit which her character produced, her legacy continues, and is the driving force behind the Center&rsquo;s mission to serve others.\n\nMission Stament\nElaine Ellis Center of Health (EECH) is a Not-For-Profit Organization dedicated to providing affordable comprehensive, preventive, and primary healthcare services to individuals residing in public housing and the surrounding areas, regardless of their ability to pay. In so doing, we are committed to offering said services in a clean, safe environment, appropriate in meeting the healthcare needs of our target population. EECH also demonstrates social responsibility through the just use of resources. The commitment of our staff, physicians, volunteers, community partners and friends to our mission permits us to maintain a quality of presence and tradition of caring, which is a hallmark of EECH.',NULL,NULL,NULL,'http://eechealth.com/',NULL,4,NULL,NULL,NULL,NULL,'956817646477291,822106893088278,609582364629457,1060160690284572,800106312438349,743182672086208,995363917586083','1198488947117166,695928846468418,877271835912480,899126386042540','770635363010046,1002753920993717',0,NULL,NULL,NULL),(8,608021838760746,'Paramount Baptist Church',NULL,NULL,NULL,'A local church offering services to the community.',NULL,NULL,NULL,'https://www.paramountbaptistchurch.org/',NULL,4,NULL,NULL,NULL,NULL,NULL,'1087810688598243,1172790209445624','656132195479560',0,NULL,NULL,NULL),(9,612828763371641,'Mazique Parent Child Resource Center','Edward C Mazique Parent Child Resource Center',NULL,NULL,'Mazique is a child development center that assists parents in developing skills, obtaining knowledge and becoming responsible advocates in ways that empower them to successfully promote their children&rsquo;s growth and development, while simultaneously receiving valuable tools that promote and lead families to complete self-sufficiency.',NULL,NULL,NULL,'https://www.mazique.org/',NULL,4,NULL,NULL,NULL,NULL,'1209187247938710,607074649518713,792954474348824','1200602057472122','836904778271068,621638073150979,1120989994777643,1261460579474983',0,'1256281229501064',NULL,NULL),(10,559154929442125,'D.C. OFFICE OF VETERANS\' AFFAIRS',NULL,NULL,NULL,'Provides Veterans Resources services',NULL,NULL,NULL,'http://www.ova.dc.gov',NULL,4,NULL,NULL,NULL,NULL,'899838401230788','813086141383291','1274640117388299',0,NULL,NULL,NULL),(11,559497771463092,'DC Greens',NULL,NULL,NULL,'An organization using food access, food education, and food policy to advance food justice in the district. ','info@dcgreens.org ',NULL,NULL,'https://www.dcgreens.org/',NULL,4,NULL,NULL,NULL,NULL,'1098065208904471,1320331128300695,1210217918383230,1100964352786904,1178649951131958,1089778010404757,1321120943941065,904797303274454','1265751663333703','579629710592839',0,NULL,NULL,NULL),(12,606016520179422,'The United Church',NULL,NULL,NULL,'A local church offering services to the community.','info@theunitedchurch.org',NULL,NULL,'http://www.theunitedchurch.org/',NULL,4,NULL,NULL,NULL,NULL,'647808349539409','1303072516221458','791197553917784',0,NULL,NULL,NULL),(13,577764298046742,'Casa Ruby',NULL,NULL,NULL,'Support center for women of transgender experience. \n\nThe idea behind the formation of a organization run and led by transgender women of color came almost 30 years ago, when Ruby Corado first arrived to Washington, D.C. There, she found that there were no services to support her needs as a young transgender Latina immigrant. Today, Casa Ruby is the only LGBTQ bilingual and multicultural organization in the metropolitan Washington, D.C. area providing social services and programs catering to the most vulnerable in the city and surrounding areas. We offer a wide variety of programs and services, ranging from emergency housing to non-medical case management.','info@casaruby.com',NULL,NULL,'https://casaruby.org/',NULL,4,NULL,NULL,NULL,NULL,'783798317190015,757050460311671,1285397708822108,771378282180941,647361700663696,1336511977669058,656905764489449,1332741706053106','937785373035309','572381295862246',9223372036854775807,NULL,NULL,NULL),(14,593530875968066,'D.C. DEPARTMENT OF BEHAVIORAL HEALTH (DBH): COMPREHENSIVE PSYCHIATRIC EMERGENCY PROGRAM/HOMELESS OUTREACH PROGRAM',NULL,NULL,NULL,'The Homeless Outreach Program (HOP) provides a variety of services and supports adults and families who are homeless. Its primary purpose is to provide outreach to homeless individuals and families with needed mental health services. HOP also provides consultation and training to the provider network most closely involved with the homeless population.',NULL,NULL,NULL,'http://dbh.dc.gov',NULL,4,NULL,NULL,NULL,NULL,'961738059568521','883515995625764','1109839475209474',0,NULL,NULL,NULL),(15,601937487816671,'FLOC','For Love of Children',NULL,NULL,'For Love of Children (FLOC) provides educational services beyond the classroom to help students succeed from first grade through college and career. FLOC brings together students, volunteers, families, and community partners in proven programs that teach, empower, and transform.\n\nFLOC&rsquo;s services are provided for free to students from low-income families in the District of Columbia and West Virginia. Our experience shows that when students are encouraged and prepared, they can overcome any challenges and complete their educations.',NULL,NULL,NULL,'https://floc.org/',NULL,4,NULL,NULL,NULL,NULL,'1244747959773878,1171417382872545','796654497660631,907838847178020','1140386841515505',0,NULL,NULL,NULL),(16,605622028340987,'Byte Back',NULL,NULL,NULL,'Byte Back provides a pathway of inclusive tech training that leads to living-wage careers.\n\nSince 1997, Byte Back has served thousands of adults, helping graduates gain valuable tech skills, launch successful careers, and become part of the growing digital economy.','learn@byteback.org',NULL,NULL,'https://byteback.org/',NULL,4,NULL,NULL,NULL,NULL,'943023691666873,822081621672598','591752588532619','865063089655254',0,NULL,NULL,NULL),(17,606159111308029,'KENNEDY INSTITUTE',NULL,NULL,NULL,'Provides the following services: RW Behavior Support BSP Development & Follow-Up , RW Behavior Support Diagnostic Assessment, RW Behavior Support Non-Professional (Behavior), RW Behavior Support Non-Professional (Medical), RW Day Hab w/Meals, RW Day Habilitation, RW Day Habilitation One-to-One (Behavior), RW Day Habilitation One-to-One (Medical), RW Employment Readiness, RW Family Training, RW Family Training Assessment, RW Host Home, RW In-Home Supports, RW Residential Habilitation, RW Speech Hearing and Language Therapy, RW Speech Hearing and Language Therapy Assessment, RW Speech Hearing and Language Therapy Assessment, RW Supported Employment GROUP Job Training & Supports , RW Supported Employment GROUP Long Term Follow Along , RW Supported Living, RW Supported Living Periodic, RW Supportive Employment Individually (Long-Term Follow-Along), RW Supportive Employment Individually (Intake and Assessment), RW Supportive Employment Individually (Job Placement), RW Supportive Employment Individually (Job Training & Support), RW Supportive Employment Individually (Long-Term Follow-Along), RW Supportive Employment Individually (Intake and Assessment), RW Supportive Employment Individually (Job Placement), RW Supportive Employment Individually (Long-Term Follow-Along), RW Wellness Nutrition Assessment, RW Wellness Nutrition Ongoing Support',NULL,NULL,NULL,'http://dds.dc.gov/service/how-apply-services',NULL,4,NULL,NULL,NULL,NULL,'1124328528578512','1083606216852497','1188102183681608',0,NULL,NULL,NULL),(18,633605990771272,'DC Fiscal Policy Institute',NULL,NULL,NULL,'The DC Fiscal Policy Institute conducts research and public education on budget and tax issues in the District of Columbia, with a particular emphasis on issues that affect low- and moderate-income residents.',NULL,NULL,NULL,'http://www.dcfpi.org/',NULL,4,NULL,NULL,NULL,NULL,'809544210408082',NULL,'888768073760272',0,NULL,NULL,NULL),(19,580772169029651,'Barbara Chambers Children\'s Center',NULL,NULL,NULL,'','info@barbarachambers.org',NULL,NULL,'https://barbarachambers.org/',NULL,4,NULL,NULL,NULL,NULL,'1182157958552306,670644496333952,814817282883148,813051911788426','986167438798239,1090445511708047,574820988537178','813926334906214,1191165945054651,816301601038577',0,NULL,NULL,NULL),(20,584105465886479,'Shabach Ministries',NULL,NULL,NULL,'A religious community organization providing numerous services including:\n\n- The SHABACH! Emergency Empowerment Center\n- Community resources and employment\n- Career services\n- Youth programs\n- Religious programs','info@shabachministries.org',NULL,NULL,'https://smionline.org/',NULL,4,NULL,NULL,NULL,NULL,'805800258888513,837954913596387,911320628244521,1252702593988888,942923225062781,867793861079810,860988302609734,801481287749333,931637209705712,955750891211425','1253724292834687,1153249159400548','1328933813930427,1175342324463616',0,'1287462571928756',NULL,NULL),(21,636426656659289,'Wanda Alston House',NULL,NULL,NULL,'The Wanda Alston Foundation opened its doors in 2008 as the only housing program in Washington, D.C,. solely dedicated to offering pre-independent transitional living and support services to homeless or at-risk LGBTQ youth ages 18 to 24 in all eight wards. ','info@wandaalstonfoundation.org',NULL,NULL,'http://www.wandaalstonfoundation.org',NULL,4,NULL,NULL,NULL,NULL,'957722583611343,760997112833771','625109799377934,960390601927225','959373006921454',0,'1186681173947755,1222973168897685',NULL,NULL),(22,610643317850454,'GRACE AND MERCY HEALTH SERVICES, INC',NULL,NULL,NULL,'Provides the following services: RW Behavior Support BSP Development & Follow-Up , RW Behavior Support Diagnostic Assessment, RW In-Home Supports, RW Respite Daily (out of the home), RW Respite Hourly (in the home)',NULL,NULL,NULL,'http://dds.dc.gov/service/how-apply-services',NULL,4,NULL,NULL,NULL,NULL,'862025517520940','1181058698920161','876205598154141',0,NULL,NULL,NULL),(23,618997848324116,'Bread for the City',NULL,NULL,NULL,'Provides services around food, clothing, healthcare (and dental care), social services, legal services, and representative payee agreements.','info@breadforthecity.org',NULL,NULL,'http://breadforthecity.org/',NULL,4,NULL,NULL,NULL,NULL,'834460550368169,1298050850536077,1080060911179544,775927218674309,1223965805414362,888900193677833','592888047524221,606695908675970','858837023472383,10585602