cross the United States. Visit their website to find a local affiliate.',NULL,NULL,NULL,'https://rebuildingtogether.org/',NULL,4,NULL,NULL,NULL,NULL,'1313580838903453,920302771339848,1293112150353032,939239658768708','1184206268036011','834887345290440',0,NULL,NULL,NULL),(36,624726610902590,'SPANISH CATHOLIC CENTER: DENTAL CLINIC',NULL,NULL,NULL,'Provides dental care for children and adults including restorative and preventative treatments. Referrals for surgery and emergency treatments are given if needed.',NULL,NULL,NULL,'http://www.catholiccharitiesdc.org/',NULL,4,NULL,NULL,NULL,NULL,'620920746047249','1186214099895257','1297060122320888',0,NULL,NULL,NULL),(37,641527619630164,'St. Philip the Evangelist Episcopal Church',NULL,NULL,NULL,'A local church offering serves to community members in need.',NULL,NULL,NULL,'https://episcopalchurch.org/parish/st-philips-episcopal-church-washington-dc',NULL,4,NULL,NULL,NULL,NULL,NULL,'966776474605843',NULL,0,NULL,NULL,NULL),(38,644694600510926,'NEIGHBORS\' CONSEJO: EMERGENCY ASSISTANCE',NULL,NULL,NULL,'Provides emergency rent, mortgage, and utility assistance to residents of Ward 1.',NULL,NULL,NULL,'http://neighborsc.org',NULL,4,NULL,NULL,NULL,NULL,'1199983060673417','1114638904926849','788509441386056',0,NULL,NULL,NULL),(39,643565902574203,'Helping Hands Food Distribution Ministry (First Rising Zion Baptist)',NULL,NULL,NULL,'An emergency food pantry once every other Tuesday from 10:00AM to 12:00PM.',NULL,NULL,NULL,'http://www.firstrising.org/community-outreach/helping-hands.html',NULL,4,NULL,NULL,NULL,NULL,'960051770169079','1249359518761001','579382634687033',0,NULL,NULL,NULL),(40,647476689662846,'UPO: FATHERHOOD INITIATIVE: ALWAYS ON SATURDAY',NULL,NULL,NULL,'Provides parenting classes, life skills, budget management, employment assistance, and education referrals to fathers and expecting fathers.',NULL,NULL,NULL,'http://upo.org',NULL,4,NULL,NULL,NULL,NULL,'1081790752848877','1253513730301645',NULL,0,NULL,NULL,NULL),(41,682552065545256,'Northern Virginia Family Services',NULL,NULL,NULL,'A community organization providing numerous services to meet the needs of the community. These services range from shelter/housing, to food, to education, and health.','info@nvfs.org',NULL,NULL,'https://www.nvfs.org/',NULL,4,NULL,NULL,NULL,NULL,'633702102837581,1136637606616454,759287871630149,1273431636145481','1326191823188479,964860483808020,837377238916897,791975728727740,736909404940832,745602667780735','764854375292129',9223372036854775807,NULL,NULL,NULL),(42,692112692154000,'A Wider Circle',NULL,NULL,NULL,'A Wider Circle&rsquo;s efforts focus on the provision of basic need items, workforce development, wraparound support, and neighborhood revitalization. These four components work in concert to create lasting change in the lives of those we serve. A Wider Circle says no to nobody! Anyone in need of help can find it here. In addition to all of the individuals and families that call us, more than 500 government, social service, and nonprofit agencies regularly contact us for help in serving their clients.',NULL,NULL,NULL,'https://awidercircle.org/',NULL,4,NULL,NULL,NULL,NULL,'1071110285565782,595461104582359,1244526695505882','877523491860439,780596419575738','610894518918920,1069725146672559',0,NULL,NULL,NULL),(43,706476638607137,'Brighter Day Ministries','Formerly: A.P. Shaw~Congress Heights United M',NULL,NULL,'A local church offering a food pantry and clothing closet to the community.','churchoffice@BrighterDayDC.org',NULL,NULL,'https://www.brighterdaydc.org/',NULL,4,NULL,NULL,NULL,NULL,'1192518431630550,794527613963060','919075870505440','692842183271323,867077559081285',0,NULL,NULL,NULL),(44,726173106231202,'Central Union Mission',NULL,NULL,NULL,'Central Union Mission is a faith-based 501(c)(3) nonprofit organization and the oldest private social service agency in Washington, DC.  In addition to its emergency shelter, which provides over 62,000 bed-nights each year, the Mission operates a holistic, Christ-centered transformation and workforce development program for men, provides benefits for veterans, helps people overcome addictions, operates a food and clothing distribution center, which provides food for over 4000 people each month, runs a camp for underprivileged children, and offers a ministry to families and senior citizens.\n\nThe Mission is continually developing its programs to meet the changing needs of the community. Its programs serve homeless men, underprivileged women, children, seniors, families and veterans.\n\nOne life at a time, the Mission works to help transform the area&rsquo;s toughest rehabilitation cases&mdash;including drug addicts, gang members, criminal offenders and the chronically homeless&mdash;into productive members of society. The Mission&rsquo;s programs have an extremely high success rate at helping individuals overcome addiction and homelessness and achieving independent living.',NULL,NULL,NULL,'https://www.missiondc.org',NULL,4,NULL,NULL,NULL,NULL,'1291599466171764,978182683421582,759682631849783,754621632893339,902951823980164,945841786673442,740916631620812,1154397851156755,886267440482873,1252264089140599,1187463498588025,1228495289369706,1265325284377461,1248912869636667,961458582690801,660868979951197,1321094180433140,908926837435227,580719808472057','842965887033119,569071299085270,1190357120409678','1287723230809141,1154195373907801,838780960881380,867745425991207,1135122975308953,835677959674778',1043054479944359,'1319255723578292,800545996069324',NULL,NULL),(45,745762970824360,'SAMARITAN INNS: INTENSIVE RECOVERY PROGRAM',NULL,NULL,NULL,'Offers 3 phases of treatment for homelessness and addiction.',NULL,NULL,NULL,'http://samaritaninns.org/',NULL,4,NULL,NULL,NULL,NULL,'802536341225895','866416565083229','984550353973330',0,NULL,NULL,NULL),(46,727757843857751,'Far Southeast Family Strengthening Collaborative',NULL,NULL,NULL,'The Far Southeast Family Strengthening Collaborative works to tackle some of our community\'s toughest issues, while building the capacity of residents and organizations to do the same. The mission of the Far Southeast Family Strengthening Collaborative is to act as a catalyst to develop, nurture and sustain partnerships of residents, agencies, and institutions in the Southeast community and to create a healthy socioeconomic environment through which every child and family has an opportunity to achieve their maximum potential and to lead a productive life.',NULL,NULL,NULL,'http://www.fsfsc.org/',NULL,4,NULL,NULL,NULL,NULL,'789456565791843,910059099567277,859629175967195,1178096298000358,979536491529478,813064675400914,1299121197634961,818563649469922','932602737976044,1191551618847760','1286648129611472',0,'900766491176234',NULL,NULL),(47,743525753773182,'D.C. OFFICE OF LGBTQ AFFAIRS',NULL,NULL,NULL,'The Mayor&sbquo;&Auml;&ocirc;s Office of Lesbian, Gay, Bisexual, Transgender and Questioning Affairs (LGBTQ) is a permanent, cabinet-level office within the Office of Community Affairs in the Executive Office of the Mayor, established by statute in 2006 to address the important concerns of the District\'s gay, lesbian, bisexual and transgender residents. The District of Columbia has one of the highest concentrations of LGBTQ residents in the country with an estimated 7 to 10% of the population being LGBTQ.',NULL,NULL,NULL,'http://www.glbt.dc.gov',NULL,4,NULL,NULL,NULL,NULL,'605774245554167',NULL,'1161706256775181',0,NULL,NULL,NULL),(48,744812603775568,'Quality Trust',NULL,NULL,NULL,'Quality Trust is an independent, non-profit advocacy organization focused on improving the lives of children and adults with disabilities and their families in the District of Columbia and beyond.  We work with individuals and family members to solve problems, identify opportunities for learning and contribution and find creative ways to minimize &ldquo;differences&rdquo; and make the most of each person&rsquo;s abilities.','info@dcqualitytrust.org',NULL,NULL,'http://www.dcqualitytrust.org/',NULL,4,NULL,NULL,NULL,NULL,'865253695035282,1210697117152571,1194701188927394,998912206496705,775356580769657,872625169605396,573931060003252','549594406351830','1185969381076176',9223372036854775807,NULL,NULL,NULL),(49,775874603891849,'So Others Might Eat (SOME) - Medical Clinic',NULL,NULL,NULL,'SOME (So Others Might Eat) is an interfaith, community-based organization that exists to help the poor and homeless of our nation\'s capital. SOME will meet the immediate daily needs of the people we serve with food, clothing, and health care. SOME also helps break the cycle of homelessness by offering services, such as affordable housing, job training, addiction treatment, and counseling, to the poor, the elderly and individuals with mental illness. Each day, SOME is restoring hope and dignity one person at a time.\nSOME offers a comprehensive network of healthcare. The clinic is located at 60 \'O\' Street, NW, and is open Monday - Friday, 8:00 am - 4:00 pm. Patients are accepted on a walk-in and appointment basis. SOME\'s Health Services includes a comprehensive Medical Clinic, an Eye Clinic and a Dental Clinic.\n\nMEDICAL CLINIC The Medical Clinic offers a full range of services including primary care, podiatry services, lab work and treatment for diabetics. The Medical Clinic treats an average of 26 patients each day.\nThe Eye Clinic is one of the only free eye clinics in the city and treats approximately 30 patients each month. SOME\'s part-time ophthalmologist treats those suffering from diabetes, glaucoma, AIDS, and eye injuries, and conducts general eye exams.\n\nDENTAL CLINIC The Dental Clinic provides both emergency and comprehensive oral care to patients, including prevention, basic care, restorations, root canals, extractions and removable prostheses (dentures). We are open five days per week.\nTo be eligible for dental care in the SOME Dental Clinic, a patient must be homeless in the District and/or low-income and living in the immediate neighborhood of our clinic. In addition to scheduled appointments, the Dental Clinic provides emergency care to the first four walk-in clients Monday - Friday.',NULL,NULL,NULL,'http://www.some.org',NULL,4,NULL,NULL,NULL,NULL,'998823719958227','1328301158468902','903707682119815',0,NULL,NULL,NULL),(50,778852197302716,'Mom\'s Meals',NULL,NULL,NULL,'Offers meal delivery to a variety of qualifying clients including self-paying clients. ',NULL,NULL,NULL,'https://www.momsmeals.com/',NULL,4,NULL,NULL,NULL,NULL,'938870799038889','1217938662012922','1204227139966741',0,NULL,NULL,NULL),(51,782406976349276,'Dupont Park SDA',NULL,NULL,NULL,'Offers a food pantry and clothing closet.','dpc@dupontpark.org',NULL,NULL,'http://dupontpark.org/',NULL,4,NULL,NULL,NULL,NULL,'1145399925529779,1075486612088837','777587688446935','1197279412047011',0,NULL,NULL,NULL),(52,791950857737387,'COMMUNITY COUNCIL FOR THE HOMELESS AT FRIENDSHIP PLACE',NULL,NULL,NULL,'Provides street outreach, addiction counseling, referrals, a medical clinic, psychiatric care and case management services all aimed at giving the homeless men and women in Northwest Washington assistance in rebuilding their lives by addressing their basic needs.',NULL,NULL,NULL,'http://cchfp.org/',NULL,4,NULL,NULL,NULL,NULL,'621104147916374','1235107925689722','931886810745529',0,NULL,NULL,NULL),(53,727847273433183,'SOME: DINING ROOM',NULL,NULL,NULL,'Provides meals, clothes, and showering facilities for the needy. Meals are served in a main dining room, as well as a separate one for women and children.',NULL,NULL,NULL,'http://some.org',NULL,4,NULL,NULL,NULL,NULL,'925880419304547','626402478477773','816964939097565',0,NULL,NULL,NULL),(54,756344334747450,'CONNECT.DC - DIGITAL INCLUSION INITIATIVE: ALL HANDS ON TECH',NULL,NULL,NULL,'Connect.DC created The All Hands on Tech initiative, in partnership with OCTOHelps, to provide FREE technical support to District of Columbia residents. One of the most important things a person needs to fully access technology is a functioning computer. Unfortunately, the cost of computer repair is often too high for many people. Whether you have a laptop with a virus or you don\'t understand how to use your smartphone, we are here to help!&not;&dagger;Visit website for current schedule of events.',NULL,NULL,NULL,'http://connect.dc.gov/free-tech-support',NULL,4,NULL,NULL,NULL,NULL,'994280834710332','817066446192440','847472462897373',0,NULL,NULL,NULL),(55,782302579547834,'The Arc District of Columbia',NULL,NULL,NULL,'ARC DC helps improve the quality of life for individuals with intellectual and developmental disabilities and their families through support and advocacy. They offer counseling, family support, supportive employment opportunities, and day programs.',NULL,NULL,NULL,'http://arcdc.net',NULL,4,NULL,NULL,NULL,NULL,'977586749835410,879847524852951,1090262984895790','1228363334230136','814793229124367',0,NULL,NULL,NULL),(56,789345230945555,'Ambassador Baptist Church',NULL,NULL,NULL,'A local church offering services to the community.',NULL,NULL,NULL,'http://theambassadorbaptistchurch.org/home.html',NULL,4,NULL,NULL,NULL,NULL,NULL,'1267100819054999','995652098008403',0,NULL,NULL,NULL),(57,756001362836549,'Salvation Army NW - National Capital Area Command',NULL,NULL,NULL,'Harbor Light Transitional Housing Program:\nExtended transitional housing (6-18 months) for 33 men & women experiencing homelessness and in recovery from substance abuse. To enroll, call the Harbor Light center at (202) 269-6333 and ask for the Intake department.',NULL,NULL,NULL,'www.salvationarmy.org',NULL,4,NULL,NULL,NULL,NULL,'1098208700839960','1096946727548641','831454623275466',0,NULL,NULL,NULL),(58,777796010868947,'D.C. DEPARTMENT OF BEHAVIORAL HEALTH (DBH): CHILDREN, YOUTH AND FAMILY SERVICES',NULL,NULL,NULL,'The Department of Behavioral Health is building a system of care for children, youth and their families that supports prevention and early identification of behavioral health needs, and provides community based treatment and supports that are able to meet multiple and changing needs. We are guided by the principles that services must be easy to access, culturally and linguistically competent, and family-driven and youth-guided. A range of treatment and support services for children, youth and their families are available, including specialized evidence-based practices for youth and families recovering from trauma, emergency care and ongoing treatment primarily through certified, community based mental health providers. Ongoing treatment includes individual, group, and family counseling, diagnostic assessment, medication management, and family support. In addition, community based providers are certified to provide substance use disorder treatment. The Department also operates a children\'s clinic, provides services in public and public charter schools, and manages an alcohol, tobacco and drug prevention and awareness campaign called DrugFreeYouthDC. To select a community based mental health provider that best meets your needs, please review the available community based providers or call the ACCESS Helpline at 1-888-793-4357 and talk with a mental health professional who will guide you through the process.',NULL,NULL,NULL,'http://dbh.dc.gov',NULL,4,NULL,NULL,NULL,NULL,'999007044535768','1130087923383067','1220839720071176',0,NULL,NULL,NULL),(59,801265724461963,'D.C. DEPARTMENT OF BEHAVIORAL HEALTH (DBH): SUBSTANCE USE DISORDER SERVICES: WARDS THREE AND FOUR PREVENTION CENTER',NULL,NULL,NULL,'The Department Of Behavioral Health (DBH): Substance Use Disorder Services provides four Prevention Centers to provide substance use disorder services including detoxification, residential and outpatient services based on the level of need. It also provides a range of prevention and recovery services.',NULL,NULL,NULL,'http://dbh.dc.gov',NULL,4,NULL,NULL,NULL,NULL,'1048055694684936','1003126161348750','1089405934692969',0,NULL,NULL,NULL),(60,799687063010061,'Capital 