aining and support and crisis services. They are also able to assist with applying for Section 8 Vouchers and accessing affordable housing. They accept DC Medicaid, AmeriHealth, Trusted Health and Medstar Family Choice.',NULL,NULL,NULL,'http://communityconnectionsdc.org',NULL,4,NULL,NULL,NULL,NULL,'599402007780126,907595418658961,822492274972082,845758882609427,1216556310653957,1180091016211141,984528775573917,586827752329383,789715981823462,793847249153498,915711679952561,1296730701251441,956342437760431','1125537818767812,1186529718830668','1044869288351593,1130006642102532,692231605294536',0,NULL,NULL,NULL),(65,809193297555798,'DC Rape Crisis Center',NULL,NULL,NULL,'DCRCC is the designated State Sexual Assault Coalition for the District of Columbia providing survivor-centered advocacy through therapeutic services, training and technical assistance, community education, public policy initiatives as well as volunteer opportunities. More specifically:\n\nIndividual & group counseling (English and Spanish)\nA 24-hour crisis hotline (202-333-RAPE)\nCommunity education & outreach\nTraining & technical assistance\nPublic policy & legislative Initiatives\nVolunteer opportunities\nUndergraduate and graduate internship opportunities\n\n\nDCRCC is the oldest and the first rape crisis center in the country, and the federally designated State Sexual Assault Coalition for the District of Columbia providing survivor-centered, and community led advocacy through therapeutic services, training and technical assistance, community education, public policy initiatives as well as volunteer opportunities.','dcrcc@dcrcc.org',NULL,NULL,'www.dcrcc.org',NULL,4,NULL,NULL,NULL,NULL,'671724061345975,681767171553959,695948265970000,600624054710125,613307132570587,1160149147134890,1298139501002270','1058012807425886,782968788385719,819440187923797,1248802193472840','728145736382163',0,NULL,NULL,NULL),(66,761153930697275,'United Planning Organization','UPO',NULL,NULL,'Since 1962, the United Planning Organization (UPO) has focused on changing lives &mdash; supporting and inspiring Washington, DC&rsquo;s low-income residents on their journey to self-sufficiency and success.\nWe currently offer more than 30 programs and services in such areas as early childhood education, youth development, job training and placement, health and wellness, housing, and volunteering.\nUPO is a family, and we understand the importance of supporting both individuals and the loved ones who surround them. Working in and with the community, we will continue helping people get where they want and need to be.','info@upo.org',NULL,NULL,'https://www.upo.org',NULL,4,NULL,NULL,NULL,NULL,'1213230585541920,1219686317955585,1133165843084453,1052254032756894,1253744104425599,916436632015801,777260696695053,1300660045853572,807525744099302,874199505765345,825451959778479,1187200756463947,1282686227944763,1296433586474206,924655410570415,928788698938707,943779508068444,794796274007587,602650991439185','665905423802380,615824389715095,849573890085736,851233609504150,757819596231988,1152713868211992,1259667859611659,1066322983572364,620350277070213,725558204724863,853687095165430,645117414301336','1186823261288379,594960886051316,999755198000719,897673459565497',9223372036854775807,'1177145976454922,740331137219886,684980356183378,905876656375498',NULL,NULL),(67,795756022910298,'Ayuda',NULL,NULL,NULL,'Ayuda provides legal, social, and language services to help vulnerable immigrants in our neighborhoods access justice and transform their lives. Since 1973, we have served more than 100,000 low-income immigrants throughout Washington DC, Maryland and Virginia. Ayuda&rsquo;s expert and dedicated professionals help immigrants from anywhere in the world navigate the immigration and justice systems and access the social safety net. This comprehensive and welcoming approach breaks down barriers, helps those in need, and makes our communities stronger.',NULL,NULL,NULL,'http://ayuda.com',NULL,4,NULL,NULL,NULL,NULL,'1120365239019390,1098998360726289,940105141272489','910170559958808,1097812419353578,602586439838395','817854864378068,1161498401444320,833655491101686,1183432963433388,767274390634346',0,'1186681173947755,1340162113833071,1212718840001878,670413521970743,1173706987543564',NULL,NULL),(68,804221482345419,'D.C. DEPARTMENT OF BEHAVIORAL HEALTH (DBH): APRA: ASSESSMENT AND REFERRAL CENTER (ARC)',NULL,NULL,NULL,'Once an individual is medically and psychiatric cleared they can report to ARC for a comprehensive assessment. Based upon the assessment it will determine the level of care the individual is eligible for in Substance Use Disorder (SUD) treatment. The individual must be stable to participate in SUD treatment/rehab that is that the client should not be exhibiting psychiatric crisis such as violent behavior, hearing voices, inability to respond to voice commands. Also, the individual should be medically stable such as not exhibiting any respiratory , cardiovascular or injuries etc. that would prevent them from participating in SUD treatment. In addition, the individual should report to ARC with a 30 day medication supply, if applicable, in the event they are assessed for residential services the individual could be sent directly from ARC to residential treatment. If the individual is eligible for Detoxification (an average of 3 day stay), or if eligible for Outpatient (length of stay depends on progression in program) or Residential (an average of 28 day stay) treatment services. If residing in a shelter or supportive living, bring a letterhead supporting the residence at that facility.',NULL,NULL,NULL,'http://dbh.dc.gov',NULL,4,NULL,NULL,NULL,NULL,'942882797339036','1118135668686826','638793416229400',0,NULL,NULL,NULL),(69,769347676481702,'CHINATOWN SERVICE CENTER: SUMMER ENRICHMENT PROGRAM',NULL,NULL,NULL,'Aids elementary students for 6 weeks during the summer months by enhancing English and mathematics skills, teaching students songs and allowing students to participate in arts and crafts.',NULL,NULL,NULL,'http://cccdc.com/chinatown-service-center/',NULL,4,NULL,NULL,NULL,NULL,'1133092295870518','778368103757668','1195857100779606',0,NULL,NULL,NULL),(70,787727417537507,'Open Arms Housing',NULL,NULL,NULL,'Open Arms Housing operates three programs through which we serve chronically homeless women. We run our two project-based single-site apartment buildings, the Dunbar, in the Truxton Circle neighborhood of Northwest, and Owen House, in the Trinidad neighborhood of Northeast, as well the newer initiative, a scattered-site PSHP. Open Arms Housing offers individual and group on-site services tailored to the unique needs of our clients.','info@openarmshousing.org',NULL,NULL,'https://openarmshousing.org/',NULL,4,NULL,NULL,NULL,NULL,'634028809032783,1024397676156151,1279217562065520','1130020356495609','920572231138004',0,NULL,NULL,NULL),(71,820488001755900,'Neighborhood Legal Services Program (NLSP)','NLSP',NULL,NULL,'',NULL,NULL,NULL,'http://nlsp.org/',NULL,4,NULL,NULL,NULL,NULL,'940202748401268,813553671875388,806428640646955,1109436994306012,718050681265809,1224083578603659,1214476217655096',NULL,'931728525653879,1053529725692782,647497712481280',0,NULL,NULL,NULL),(72,833556938177872,'D.C. DEPARTMENT OF BEHAVIORAL HEALTH (DBH): APRA: ADOLESCENT SUBSTANCE ABUSE TREATMENT: ASTEP',NULL,NULL,NULL,'The District of Columbia offers four locations where young people can go to seek help for a drug or alcohol issue. If a young person, under the age of 21, lives in DC and needs help or just wants to talk to someone about his/her drug or alcohol use, he/she can contact one of the treatment providers which are available through a network of providers.',NULL,NULL,NULL,'http://dbh.dc.gov',NULL,4,NULL,NULL,NULL,NULL,'1108638663383567','1097440010596926','861447627614096',0,NULL,NULL,NULL),(73,806677477926389,'DC Care Consortium',NULL,NULL,NULL,'The mission of DC Care is to provide support to PLWHA (People Living with HIV/AIDS) and their families and collaborate with service providers to enhance the delivery and quality of HIV/AIDS services in Washington, DC. ',NULL,NULL,NULL,'https://lgbtq.dc.gov/page/dc-care-consortium',NULL,4,NULL,NULL,NULL,NULL,'932258895912915','641538961244083','867684167756788',0,NULL,NULL,NULL),(74,807867907645287,'PIDARC','Partners in Drug Abuse Rehabilitation and Cou',NULL,NULL,'PIDARC provides pharmacological intervention through methadone maintenance along with a variety of other therapeutic modalities.',NULL,NULL,NULL,'https://pidarcdc.org/',NULL,4,NULL,NULL,NULL,NULL,'1077603109327544','612423782652894','945081690439180',0,NULL,NULL,NULL),(75,810479025131545,'HIPS','Helping Individual Prostitutes Survive',NULL,NULL,'HIPS provides a variety of services, online resources, and referrals to sex workers in the DC area.',NULL,NULL,NULL,'https://www.hips.org/',NULL,4,NULL,NULL,NULL,NULL,'775111969675006,836738857450646,937486843530248,911181735974447,642284944498747,1230658202367837,639467846851619,1277116846663193,714211448512130','1174880928735577,878348692886905','994012462825446',0,NULL,NULL,NULL),(76,837178101758888,'WASHINGTON METROPOLITAN AREA TRANSIT AUTHORITY: METRO SENIOR/DISABLED ID CARD SERVICES',NULL,NULL,NULL,'Offers reduced fares to seniors and people with disabilities who have a valid Metro Senior ID card, Metro Disabled ID card or a valid Medicare card with photo identification.',NULL,NULL,NULL,'http://wmata.com',NULL,4,NULL,NULL,NULL,NULL,'1225714083985470','927713584191406','638978574424697',0,NULL,NULL,NULL),(77,845885697863453,'JOINT BASE ANACOSTIA-BOLLING: AIR FORCE CAREER FOCUS',NULL,NULL,NULL,'Provides assistance to military family members, active duty and retirees in securing employment. Home visits: Downtown',NULL,NULL,NULL,'http://cnic.navy.mil/ffr/family_readiness/fleet_and_family_support_program.html',NULL,4,NULL,NULL,NULL,NULL,'1148230459385861','951901541718626','988704048030141',0,NULL,NULL,NULL),(78,801110030219864,'Thrive DC',NULL,NULL,NULL,'Thrive DC works to prevent and end homelessness in Washington, DC by providing vulnerable people with a wide range of services to help stabilize their lives.\n\nFounded in 1979 to serve dinner to homeless women, Thrive DC has grown to be a comprehensive, professionally staffed, bilingual organization serving more than 2,000 men, women, and children each year.\n\nWe are a safety net for people experiencing homelessness, unemployment, housing instability, and food insecurity. With our help, our clients take the first steps toward independence and self-sufficiency.\n\nThrive DC serves 200 &ndash; 250 homeless and vulnerable individuals every day who turn to us for critical support. Services range from twice daily meals and weekly emergency groceries, to assistance finding housing and support finding employment, to connections to legal aid and opportunities for health screenings, to intensive job training and access to computers, laundry and showers.','info@thrivedc.org',NULL,NULL,'http://www.thrivedc.org/',NULL,4,NULL,NULL,NULL,NULL,'916268094765428,651504031814159,1166512271577678,963890389048330,1183218830562978,965489694318451,1229484402696374,1267195102722768,988930242117816,1207414557990697,1179313324156762','665113076769939,885184809366687,1128108657108836,833465858171168,1299532893666576,616629263137129,1096494296237143','1220597047470925',9223372036854775807,NULL,NULL,NULL),(79,803996484769013,'Rita Bright Family and Youth Center',NULL,NULL,NULL,'',NULL,NULL,NULL,'https://dpr.dc.gov/page/rita-bright-community-center-01',NULL,4,NULL,NULL,NULL,NULL,NULL,'927493620278205','1291451614834077',0,NULL,NULL,NULL),(80,805167768269068,'FAMILY MATTERS OF GREATER WASHINGTON (WARD 8): FOSTER CARE AND ADOPTION SERVICES',NULL,NULL,NULL,'Our foster parents provide a safe, nurturing home for children who have been removed from their parents care because of abuse or neglect. The Child Welfare Unit strives to ensure all children have a permanent placement within 15 months.',NU