tagesdc.org',NULL,NULL,'http://www.eslearningcenters.com/',NULL,4,NULL,NULL,NULL,NULL,'585908349000516','861067587432539','1279218262197811',0,NULL,NULL,NULL),(86,865229863994763,'ST. STEPHEN AND THE INCARNATION CHURCH: LOAVES AND FISHES',NULL,NULL,NULL,'Provides a free, hot, mid-day meal to anyone who is hungry on Saturday, Sunday and federal holidays. Additionally, guests can receive assistance in signing up for Food Stamps, and referrals for job counseling and medical care.',NULL,NULL,NULL,'http://saintstephensdc.org',NULL,4,NULL,NULL,NULL,NULL,'964209508718168','913062642189740','1045140628063947',0,NULL,NULL,NULL),(87,877366768823409,'Community Outreach and Development ','Community Development Corporation Community O',NULL,NULL,'Community Outreach and Development (Community Development Corporation Community Outreach) is a nonprofit organization established in the year 2000 whose mission is developing and implementing programs to better the quality of life for families and individuals. Our vision is to provide quality\n\nservices that enable  persons to become self-sufficient and\n\nproductive members of the community. Our main service\n\nareas are outlined in this brochure: Community Services\n\nand Economic Development.\n\n\n\nThe programs implemented are focused on nurturing\n\nself-empowerment, which we believe creates a better\n\nquality of life for those persons who contact us.  Each year,\n\nwe serve more than 6,500 individuals, with  everything\n\nfrom food and clothing to financial assistance and\n\nworkforce development resources.\n\n\n\nWe recognize that alone we are unable to address the many needs of our community; because of this, we have initiated many partnerships with law enforcement, educators, the   business community, the faith  community, and the agencies and organizations that share our  mission.. It is through these partnerships that we have been able to accomplish many of our  successes.',NULL,NULL,NULL,'https://www.communityoutreachcdc.o