generally limited to three months or less, with a small stipend provided to defray the intern/volunteer\'s travel and other workplace expenses. \n\nThe Older Workers Employment and Training Program is funded with a grant from Department of Employment Services. The program provides employment and training opportunities for District residents 55 years of age and older. Services are provided under Title I of the Act, and emphasize the development of employment and training opportunities through job search assistance workshops, on-the-job training, job development, and placement and classroom skills training. The Office is an active one-stop partner in the District of Columbia Workforce initiative. \n\nThe McMasters program sponsored in partnership with McDonalds\' Corporation helps older workers adjust to the work-a-day world. Its goals are to build an individual\'s confidence, self-esteem, and provide a job opportunity that fits into his/her life style and personal schedule.',NULL,NULL,NULL,'www.dcoa.dc.gov',NULL,4,NULL,NULL,NULL,NULL,'615914620488320','1266100703604119','1223680649678241',0,NULL,NULL,NULL),(90,887095601228098,'SOME: THEA BOWMAN HOUSE',NULL,NULL,NULL,'Provides two-years of savings and financial literacy training, as well as a life-skills program that helps to secure long-term housing. Families are also connected to SOME\'s other services, such as job training programs, group, and individual counseling.',NULL,NULL,NULL,'http://some.org',NULL,4,NULL,NULL,NULL,NULL,'977628518433061','1319579849820109','1268338961312460',0,NULL,NULL,NULL),(91,886723337790722,'D.C. DEPARTMENT ON DISABILITY SERVICES (DDS): TRANSPORTATION SERVICES',NULL,NULL,NULL,'Provides transportation services for any customer registered with MRDDA.',NULL,NULL,NULL,'http://dds.dc.gov',NULL,4,NULL,NULL,NULL,NULL,'1287637880598333','1251133036677676','665576595246792',0,NULL,NULL,NULL),(92,887305127088830,'Metro Teen Aids',NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,NULL,NULL,NUL