 where pamphlets, brochures, and other educational materials will be disseminated.',' info@andromedadc.org',NULL,NULL,'http://www.andromedadc.org/',NULL,4,NULL,NULL,NULL,NULL,'1198504077729641,796710603642968,598601043584489,1281816879491049,1068357766582058,954908524616299,1243674394135496','860598871725625','841307455613093',0,NULL,NULL,NULL),(100,866237660806724,'Allen Chapel AME',NULL,NULL,NULL,'A local church offering a food pantry and clothing closet to the community.','greed@acamec.org',NULL,NULL,'http://acamec.org/',NULL,4,NULL,NULL,NULL,NULL,'852851666991889,680052874958118','654485576131912','640375823525191,794797236312168',0,NULL,NULL,NULL),(101,876151548923517,'National Center for Children and Families',NULL,NULL,NULL,'Family Ties Program (FTP) is a community partnership aimed at developing and delivering comprehensive services for children in the District\'s Ward 7 and 8 who are affected by parental incarceration. It is the mission of FTP to help children between the ages of 6-12 and their siblings master appropriate developmental tasks and transitions so they can become stable and self assured, with a strong, positive sense of self. The goal of FTP is to reduce childhood trauma, stigmatization and the stress of separation caused by parental incarceration and to enhance opportunities for positive life experiences and outcomes for these children and youth. For more information, contact Temeka Parker (x43) or Katedra Sullivan (x19).',NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,NULL,NULL,'1094949344500644','1139575083738151','716790716916689',0,NULL,NULL,NULL),(102,906742630902911,'Woodley House',NULL,NULL,NULL,'Woodley House offers safe, affordable housing and clinical life skills training for men and women with mental illness, empowering them to work at their own pace toward recovery and greater independence. Residents receive 24/7 care and supervision they need as they progress through the recovery process. Our continuum of care allows someone in crisis to enter our program, become stable, transfer to a group living situation and hopefully progress to a supported independent living apartment.\n\nExact addresses for various programs are not listed.',NULL,NULL,NULL,'http://woodleyhouse.org',NULL,4,NULL,NULL,NULL,NULL,'574661829122399,590149106022184,1229115016596631,626861523724993','753558713598997','1318861728823017',9223372036854775807,NULL,NULL,NULL),(103,919690199169575,'United Community','Previously: United Community Ministries',NULL,NULL,'Community support center offering numerous services to children, youth, and families.\n\nSince 1969, United Community Ministries has served our community by empowering adults, children, and families to transform their lives. Founded by several faith-based groups and a handful of dedicated volunteers, the organization evolved from a small grassroots effort to now the only comprehensive human services nonprofit agency in southeastern Fairfax County serving more than 9,000 disadvantaged individuals annually.\n\nWe take lessons from the past to strategically amplify how we deliver our mission. In addition to providing human services, United Community Ministries is making purposeful steps toward addressing multigenerational poverty &ndash; inextricably linked to racial equity &ndash; and at the root of the concentration of poverty in our region. We seek and are positioned to serve as the lead change agent for racial equity, both through our community-based programs and on a broader level, creating a collective impact for systemic change within Fairfax County.','info@unitedcommunity.org',NULL,NULL,'http://www.ucmagency.org/',NULL,4,NULL,NULL,NULL,NULL,'1311595168931297,950454120432775,1048291243097604,1298911741733382,824288922961198,1180623233814950,1270127715145648,946406110593174,1273613208251491,1056286703581712,786302163414865','1165101578457972,640397518394513,927006793998791,1114612056687370,1107310655120205,676690284227155,746366368083217,837933369101067','987030255962297,1251056114217612,806538913069520,1246140596600748,928012146500435,902696829688820,1256916637146639,1270128697077218',659108624341793,'891092215548488',NULL,NULL),(104,874969319589202,'D.C. HOUSING AUTHORITY: CLIENT SERVICES CENTER',NULL,NULL,NULL,'Responsible for application intake, waiting list management, and eligibility determination for Public Housing, the Housing Choice Voucher Tenant Based Program - HCVP (formerly known as the Section 8 program)',NULL,NULL,NULL,'http://dchousing.org',NULL,4,NULL,NULL,NULL,NULL,'862747362682708','963793524928249','932196643976542',0,NULL,NULL,NULL),(105,883186000200856,'Hillcrest Children & Family Center',NULL,NULL,NULL,'Hillcrest Children and Family Center (Hillcrest Center) is a behavioral health care and social services agency that provides behavioral health treatment and prevention as well as community and family support services. We are a private non-profit organization founded in 1815 by First Lady Dolley Madison and chartered by an Act of Congress. Throughout its history, Hillcrest Center has offered primary prevention and mental health services to children and families. With a commitment to provide each client with the highest quality, cost effective, and timely service to meet their needs, we promote wellness and the well-being of our service population, staff, and the general community.','info@hillcrest-dc.org',NULL,NULL,'http://hillcrest-dc.org/',NULL,4,NULL,NULL,NULL,NULL,'1281204672852064,673534610271949,953777853543160,899463533628469,874272763703793,1332300140733520,771396624281852,1123263717880462,1222426882848143,846445553337660,784403343985076,1070582664052295,615186024715740,1105865058729494,946643663102938,651208869509343,1149122872651888,666406976354887,741770132344686,638393936667053,1157294466052185,968013894798831,633712201049185,1250906881501241','1097440010596926','920364967013405,1054369210651155',0,NULL,NULL,NULL),(106,888574254962004,'JOINT BASE MYER-HENDERSON HALL: ARMY COMMUNITY SERVICE (ACS)',NULL,NULL,NULL,'Provides assistance in accessing social services for service members, DoD Employees and their families.',NULL,NULL,NULL,'http://jbmhh.armymwr.com/programs/army-community-service-acs',NULL,4,NULL,NULL,NULL,NULL,'668963134824856','626788602103326','1154204314985719',0,NULL,NULL,NULL),(107,891609880372190,'Food for Others',NULL,NULL,NULL,'Food for Others is a nonprofit 501(c)(3) food bank and food rescue organization, working to help those in Northern Virginia who are food insecure.\n\nWe are a part of Northern Virginia&rsquo;s safety net for those who need food when an emergency strikes, and for the growing number of working poor who are unable to make ends meet and need to supplement their inadequate food supplies.',NULL,NULL,NULL,'https://www.foodforothers.org/',NULL,4,NULL,NULL,NULL,NULL,'813497895890135','1111158785593728,1126152989477652','1207006040801026,1162558264395905',0,NULL,NULL,NULL),(108,915322254234555,'Lutheran Church of the Reformation`',NULL,NULL,NULL,'A local church providing a food pantry and AA meetings. Community',NULL,NULL,NULL,'https://www.reformationdc.org/',NULL,4,NULL,NULL,NULL,NULL,'640103169037193,852882436125716','852143936371728','671468679071199',0,NULL,NULL,NULL),(109,872299181857178,'OIC/DC',NULL,NULL,NULL,'Helps people maximize their economic opportunities by combining traditional training approaches and technology to prepare them for the workforce.',NULL,NULL,NULL,'http://oicdc.org/',NULL,4,NULL,NULL,NULL,NULL,'1337570408700851','893306523408119','644198517647426',0,NULL,NULL,NULL),(110,908300362827413,'Jubilee Jobs',NULL,NULL,NULL,'Jubilee Jobs is a non-profit workforce development provider in the Greater Washington Region. At Jubilee Jobs, we pride ourselves on encouraging every applicant throughout the entire job process, which begins with initial meetings with job counselors, moves to workshops (interviewing skills, conflict resolution, goal-setting) and ends with the individual obtaining a job. The vision of the Next Step program helps currently employed clients move towards stabilization and greater economic self-sufficiency.\n\nJubilee Jobs programs are available for every willing, ready and able to work resident. We have developed an amazing relationship with hiring managers, which enables us to help clients find jobs.','info@jubileejobs.org',NULL,NULL,'http://jubileejobs.org/',NULL,4,NULL,NULL,NULL,NULL,'881403344964972,1162907800070547','1313473502046025,639225425188186','1150129069386124,1286395778585315',0,NULL,NULL,NULL),(111,904943826975100,'Third Street',NULL,NULL,NULL,'',NULL,NULL,NULL,'http://www.thirdstreet.org',NULL,4,NULL,NULL,NULL,NULL,'623011864568715',NULL,'1307285743296604',0,NULL,NULL,NULL),(112,889845893875767,'Academy of Hope',NULL,NULL,NULL,'Academy of Hope is an adult public charter school in Washington D.C., offering excellence in adult education since 1985. Our mission is to provide high quality adult education and services that change lives and improve our communities. At Academy of Hope, students become part of a learning community where everyone is valued, adds value and is both a teacher and a learner. Our curriculum is experiential and focuses on life skills, which means that students can immediately begin applying what they&rsquo;re learning to their own lives&mdash;and reap the benefits.','recruitment@aohdc.org',NULL,NULL,'https://aohdc.org/',NULL,4,NULL,NULL,NULL,NULL,'596474071852609','1022412281964551,972949389893061,790733365231464','873273529728080,909942619088980',0,NULL,NULL,NULL),(113,906711221632989,'Allen Community Outreach Center',NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL),(114,909401719398962,'New Endeavors by Women','NEW',NULL,NULL,'NEW is guided by a mission to partner with homeless women to create new futures. We provide a nurturing environment so that women can recognize their worth. NEW transforms lives, by providing housing, fostering the development of life skills, and promoting education and employment, to end the cycle of homelessness.','info@nebw.org',NULL,NULL,'http://nebw.org/',NULL,4,NULL,NULL,NULL,NULL,'1272430859437969,817086926506130','815707427459010','1215517692128370',0,'836091364973509,877243931325915',NULL,NULL),(115,941815502594091,'CENTER FOR SOCIAL JUSTICE: D.C. READS',NULL,NULL,NULL,'Employs the services of students from 7 universities to tutor D.C. public school students at 40 learning sites. The program\'s main focus is reading.',NULL,NULL,NULL,'http://socialjustice.georgetown.edu/students/service/dcreads/about/15129.html',NULL,4,NULL,NULL,NULL,NULL,'1195471396130558','799887146160951','877958047132310',0,NULL,NULL,NULL),(116,908756987447173,'SOME: BEHAVIORAL HEALTH SERVICES',NULL,NULL,NULL,'Encourages individuals with substance abuse issues to seek help. Assesses the need of the client during the initial intake stage, where clients work with an addiction counselor to determine the program best suited to their needs.',NULL,NULL,NULL,'http://some.org',NULL,4,NULL,NULL,NULL,NULL,'577558646630251','626402478477773','923653351035648',0,NULL,NULL,NULL),(117,925360037107607,'Women\'s Collective',NULL,NULL,NULL,'Our case management services are a part of a comprehensive family-centered program that provides peer support, creates connections between careseekers and caregivers, and promotes the participation and empowerment of women, their families, and members of their support network in developing care plans based on their self-defined needs. We accept, as well as provide, referrals for women, women and their children, to/from other programs that provide local primary medical care, support and mental health services for women with HIV/AIDS either currently not in a system of care or who need support to remain in a system of care. We provide services for women and their families that assists them in accessing respite care, childcare, housing, food, transportation services, etc., providing women with opportunities to take care of not only their own primary medical and psychosocial needs but also the needs of their children and other family members.',NULL,NULL,NULL,'https://washingtonpeacecenter.org/node/4822',NULL,4,NULL,NULL,NULL,NULL,'1301959132503150','640736255097589','946396771118356',0,NULL,NULL,NULL),(118,900455754248217,'Asbury United Methodist Church','Formerly: Asbury Chapel',NULL,NULL,'A local church offering services to the community.','asburymail@asburyumcdc.org',NULL,NULL,'https://www.asburyumcdc.org/',NULL,4,NULL,NULL,NULL,NULL,'592511260613384,1239703812521018,849919523533582','1224416978291385,931894948994087','984058750613797',0,NULL,NULL,NULL),(119,906930104707530,'Doctor\'s Community Hospital',NULL,NULL,NULL,'',NULL,NULL,NULL,'https://www.dchweb.org/',NULL,4,NULL,NULL,NULL,NULL,NULL,NULL,'753725216657831',0,NULL,NULL,NULL),(120,925199151398185,'Edgewood/Brookland Family Support Collaborative',NULL,NULL,NULL,'E/BFSC is one of five neighborhood-based Collaboratives in the District of Columbia, which make up the city-wide Healthy Families, Thriving Communities Collaborative network. E/BFSC has been in existence since 1996 when a partnership consisting of residents and neighborhood-based organizations received a planning grant from the D.C. Child and Family Services Agency (CFSA). The planning grant facilitated the development of a community-based collaborative effort to design and implement a neighborhood-based family support system. After a year of planning, E/BFSC opened its first Family Support Center in Brookland Manor in 1997 and began formally serving families. In 2011, E/BFSC expanded its geographic target area and now provides services to all communities in Ward 5 and Ward 6.\n',NULL,NULL,NULL,'http://ebfsc.org/',NULL,4,NULL,NULL,NULL,NULL,'853798812414411,1108884623053766,895467915545937,1277069302008536',NULL,'778459456343468,885824420758755,835499994326344,877263478223136,680609348421278',0,NULL,NULL,NULL),(121,930909694635560,'Lorton Community Action Center',NULL,NULL,NULL,'The Lorton Community Action Center (LCAC) provides numerous services to low-income individuals and\nfamilies in southeast Fairfax County.\n\nLCAC provides the following services:\n&bull; Food (distribution of food items)\n&bull; Clothing and furniture\n&bull; Emergency financial assistance for rent and utilities\n&bull; Access to pro bono legal assistance (civil cases only)\n&bull; Youth services (tutoring, summer and after-school programming)\n&bull; English-as-a-Second Language (ESL) classes\n&bull; Computer classes and resume workshops\n&bull; Nutrition classes for adults and children\n&bull; Budgeting classes\n&bull; Seasonal programs: Back to School, Thanksgiving, Christmas and Warm Coat','info@lortonaction.org',NULL,NULL,'https://lortonaction.org/',NULL,4,NULL,NULL,NULL,NULL,'1287738688707705,993984406526461,1153962275208345,807848846460860,611590713528319','906987068756792,1172806498907172','906651913636867,813250237828389',0,NULL,NULL,NULL),(122,970560028876577,'Jewish Social Services Agency','JSSA',NULL,NULL,'JSSA is a nonsectarian, nonprofit client-focused health, and social service agency that helps individuals and families across the Greater Washington metropolitan area through a wide range of services including: counseling, educational, special needs services, in-home support, hospice and nursing care, and social services.',NULL,NULL,NULL,'https://www.jssa.org/',NULL,4,NULL,NULL,NULL,NULL,'884244585280076,767255821745825,641610186670486,989819878149890,658231090559812,947357493854904,1173963793862866,970377297500925,1107634998787398,1127640457224641,762171918332918,899139018547334,1052463055100883,678882337307747,964012421803449,1201397185768590,785647685413221,833788770520302,869725690004657,748177592722248','630919511118386,908138764728730,1289392147201269,951898798534745,815545569707089,1047807433568619','1321118518935089,946508354826345,1104646684650585,977589590864235',0,'1211730899647476,586981821517675,646178708377781,1053289039718908',NULL,NULL),(123,929124125579243,'ETHIOPIAN COMMUNITY CENTER: COMPUTER TRAINING',NULL,NULL,NULL,'Offers computer training at minimal charge.',NULL,NULL,NULL,'http://ethiopiancommunitydc.org',NULL,4,NULL,NULL,NULL,NULL,'1076521704505640','1117030301987604','561801011049427',0,NULL,NULL,NULL),(124,931366816861797,'Perry School Community Services Center',NULL,NULL,NULL,'The Perry Center, Inc. uses a collaborative, comprehensive and integrated approach to social services, economic empowerment, and youth development.\n\nOur human development model follows two tracks: Remedial and Preventative - created to help our clients break the cycle of generational poverty and achieving living wage incomes to support themselves and their family.',NULL,NULL,NULL,'http://perryschool.org',NULL,4,NULL,NULL,NULL,NULL,'1125350403679270,576262745925884,1211369825885952,580120354830667,1150307807148693,1208786629108154,825628435745785','763139241210372','1098817401970888',0,NULL,NULL,NULL),(125,932228398355792,'D.C. DEPARTMENT OF BEHAVIORAL HEALTH (DBH): SUBSTANCE USE DISORDER SERVICES: WARDS SEVEN AND EIGHT PREVENTION CENTER',NULL,NULL,NULL,'The Department Of Behavioral Health (DBH): Substance Use Disorder Services provides four Prevention Centers to provide substance use disorder services including detoxification, residential and outpatient services based on the level of need. It also provides a range of prevention and recovery services.',NULL,NULL,NULL,'http://dbh.dc.gov',NULL,4,NULL,NULL,NULL,NULL,'652574554780668','766720094891664','799908624348129',0,NULL,NULL,NULL),(126,948113581207578,'Collaborative Solutions for Communities (CSC)','Columbia Heights/Shaw Collaborative',NULL,NULL,'A community organization in DC providing numerous services to help families ranging from parenting skills, to housing services, to youth sports.','​​info@wearecsc.org',NULL,NULL,'https://www.wearecsc.org/',NULL,4,NULL,NULL,NULL,NULL,'1210007334289332,832898052878964,645815813705213,1178673163145313,1119572087741816,994497447759686,1070895654294162,1182990804618783,1244196225355763,590895767819582,1096928318806733','615096380531905','911858349594317',0,NULL,NULL,NULL),(127,973679790071307,'PEPCO - SOUTHEAST SERVICE CENTER',NULL,NULL,NULL,'Provides Pepco services.',NULL,NULL,NULL,'http://www.ddoe.dc.gov',NULL,4,NULL,NULL,NULL,NULL,'986036993747047','779718783706461','692231605294536',0,NULL,NULL,NULL),(128,973693914944031,'D.C. DEPARTMENT OF BEHAVIORAL HEALTH (DBH): CHILD PSYCHIATRIC PRACTICE GROUP',NULL,NULL,NULL,'Child Psychiatric Practice Group (PPG) includes 3 child psychiatrists that provide psychotropic medication assessment and management. Same day urgent care is available under certain circumstances for youth already prescribed psychotropic medication, but is not intended for psychiatric emergencies (e.g., suicidal).',NULL,NULL,NULL,'http://dbh.dc.gov/',NULL,4,NULL,NULL,NULL,NULL,'1035914598171821',NULL,'616773646539267',0,NULL,NULL,NULL),(129,922709314921881,'DC Health','DC Department of Health',NULL,NULL,'DC Health promotes health, wellness and equity, across the District, and protects the safety of residents, visitors and those doing business in our nation&rsquo;s Capital.\n\nOur responsibilities include identifying health risks; educating the public; preventing and controlling diseases, injuries and exposure to environmental hazards; promoting effective community collaborations; and optimizing equitable access to community resources.','doh@dc.gov',NULL,NULL,'https://dchealth.dc.gov/page/about-dc-health',NULL,4,NULL,NULL,NULL,NULL,'777481511640778','948338018712218,976818868031171','659628565110513',0,NULL,NULL,NULL),(130,935708179993271,'Damien Ministries',NULL,NULL,NULL,'DamienMinistries\' programs are designed to build upon each other and the services offered by other providers in order to increase life expectancy and quality of life for People Living with HIV/AIDS (PLWHA).','info@damienministries.org',NULL,NULL,'http://www.damienministries.org/',NULL,4,NULL,NULL,NULL,NULL,'926396312659010,906107564923489,1282973947484780,935467815186616','1174596952831378','1295311939008541',0,NULL,NULL,NULL),(131,964008795352849,'Regional Addiction Prevention (RAP) Inc.','RAP Inc.',NULL,NULL,'Founded in 1970, RAP (Regional Addiction Prevention), Inc. is a not-for-profit health care and human welfare agency specializing in residential substance abuse treatment; HIV/AIDS care; emergency and transitional housing; nutritional counseling; and out-patient primary medical care. Residents and clients are adult male and female District of Columbia residents.\n\nRAP\'s overarching mission is to promote and enhance human health - physically, spiritually, emotionally and socially. Individualized intensive and comprehensive assessment and case management guarantee an all-inclusive care plan.\n\nLicensed Professional Counselors and Certified Addictions Counselors &ndash; supported by the operations and administrative teams &ndash; provide individual and group counseling that includes encounter groups, relapse prevention, drug education, anger management, conflict resolution, spirituality, and life skills education. A full complement of aftercare and recovery support services is made available to program graduates and community-based participants.\n\nThe Medical Staff &ndash; Physicians, Physician&rsquo;s Assistants, Registered Nurses, Medical Assistants and a Registered Dietician &ndash; provide outpatient ambulatory medical care; HIV/AIDS testing and counseling; nutritional counseling and various screenings including hepatitis, TB, prostate cancer, hypertension, kidney disease, glucose and cholesterol.','info@rapinc.org',NULL,NULL,'http://www.rapinc.org/',NULL,4,NULL,NULL,NULL,NULL,'733244062080278,953130575650955,814382562390416,1215438821283570,1146357672886284','747827439705313','803526594539754,789258912445477',0,NULL,NULL,NULL),(132,964889233755760,'D.C. Center for Independent Living',NULL,NULL,NULL,'We are a private non-profit organization that assists DC residents with significant disabilities to live independently in their homes and in their communities.',NULL,NULL,NULL,'http://dccil.org',NULL,4,NULL,NULL,NULL,NULL,'1172793580060024,569770427910971,1229131972445514,1311031611561841,1086482131081597,688871630742360,1166105214343141','1154182835844763,624495395805685,857576973728938,810669867487614,1009972720361462,1282196160289513','608497828316445,1282997809596504,875107767611380',0,NULL,NULL,NULL),(133,1004391421304549,'Adventist Community Services of Greater Washington','ACSGW',NULL,NULL,'Adventist Community Services of Greater Washington (ACSGW) was established in 1983 as the collective health and social welfare arm of several local church congregations. Today, ACSGW is a faith-based, nonprofit organization whose mission is to help those less fortunate in our community. We empower those in need through compassionate emergency care, life education, and community development. ACSGW currently provides case management, food, clothing, emergency financial assistance, health and fitness programs, technology education, and job-training.\n\nOur education/job-training programs include: English as a Second Language (ESOL), General Educational Development (GED), computer basics, advanced computer certification programs, and Job Quest workshops. ACSGW currently serves over 6000 low-income families each year. We take a holistic approach to serving this population by providing and growing programs that encourage participants to attain long-term solutions to their general and economic health and well-being.\n\nACSGW is a safe and understanding environment that works with families and individuals in the Washington Metropolitan Area who are in need of assistance, regardless of their race, ethnicity, gender, religion, age, or sexual orientation.',NULL,NULL,NULL,'https://www.acsgw.org/',NULL,4,NULL,NULL,NULL,NULL,'990258942674234,804988563046565,668729683192909,822297863188980,1108768153867457,784134299150571,607885233270947,1080087105483732','937322777502476','950009053464384,1115728022119882',1325427508018418,NULL,NULL,NULL),(134,1007623446966696,'First Baptist Church of Deanwood',NULL,NULL,NULL,'A church offering a food pantry, clothing closet, and lunch.','churchbiz@thefbcd.org',NULL,NULL,'http://thefirstbaptistchurchofdeanwood.org',NULL,4,NULL,NULL,NULL,NULL,'831904738773639,967263158004203,1110554525256285,1098750358504732,1175089962860672,854338133373761,1224357598807692','755149488867036,1179786506429029','756139435965093',0,NULL,NULL,NULL),(135,976379482380679,'Pathways to Housing',NULL,NULL,NULL,'Pathways to Housing DC is a unique agency that provides permanent housing and a range of specialty support services to single adults experiencing chronic homelessness in the District.\n\nWe do not accept direct referrals for our Housing First programs. Instead, we participate in the community&rsquo;s Coordinated Assessment and Housing Placement (CAHP) system for prioritizing housing and services.  Most shelters, case management, and outreach providers are conducting housing assessments as part of CAHP. For a listing of participating agencies or to schedule an assessment, please click here.\n\nIf you are currently experiencing homelessness and are looking for help, please click here for a list of resources in Washington, DC and Montgomery County, MD.\n\nIf you would like to be connected to mental health services, please call the Access HelpLine at 1 (888) 7WE-HELP or 1 (888) 793-4357 provided by the DC Department of Behavioral Health. This 24-hour, seven-day-a-week telephone line is staffed by behavioral health professionals who can refer a caller to immediate help or ongoing care.\n\nTo refer someone for outreach who is homeless and in need of assistance in the DowntownDC Business Improvement District, you may contact the DowntownDC BID Dispatch at dispatch@downtowndc.org or 202-624-1550.\n\nTo refer someone for outreach who is homeless and need of assistance in the Golden Triangle Business Improvement District, you may contact the Golden Triangle BID Dispatch at BBB1650Dispatch@blockbyblock.com or 202-293-9580.\n\nIf you have any others questions about our programs and services, please contact us at info@pathwaysdc.org. ','info@pathwaysdc.org',NULL,NULL,'https://pathwaystohousingdc.org',NULL,4,NULL,NULL,NULL,NULL,'1314823770834798,881012847859169,820685180498221,772580143837637,1123886368027680,862476176486863','972386234094039','743353111808252',9223372036854775807,NULL,NULL,NULL),(136,983721114373124,'DASH (District Alliance for Safe Housing)',NULL,NULL,NULL,'DASH is an innovator in providing access to safe housing and services for survivors of domestic and sexual violence and their families as they rebuild their lives on their own terms.\n\nWe seek to strengthen and expand the local safety net for survivors by providing high quality, voluntary services that are responsive to their individual needs and by engaging lawmakers, community members, service providers, and survivors in the movement to make safe housing more accessible in the short-term and less necessary in the long-term.',NULL,NULL,NULL,'https://www.dashdc.org/',NULL,4,NULL,NULL,NULL,NULL,'797834103829212,854051618591377,616081055315775,1140920920771303,1195066035930824,765385785732538,577584068562238,1067731380928038,903665589155441,549681153080082','871700855571478','828792720206018',0,'777455803391753,1256136937607288',NULL,NULL),(137,1010694996525430,'Loaves & Fishes',NULL,NULL,NULL,'Provides free meals on the weekends to supplement the lack of meal programs provided by the city over the weekend.\n\nYou are welcome at Loaves and Fishes for lunch at noon every Saturday and Sunday at 1525 Newton St NW (lower level of St. Stephen & the Incarnation Episcopal Church). We also provide lunch on Federal Holidays.',NULL,NULL,NULL,'http://loavesandfishesdc.org/',NULL,4,NULL,NULL,NULL,NULL,'896288673327409',NULL,'1045140628063947',0,NULL,NULL,NULL),(138,996759849305541,'WHITMAN-WALKER CLINIC: HIV COUNSELING AND TESTING PROGRAM',NULL,NULL,NULL,'Whitman-Walker Health offers free and confidential HIV testing and counseling to the general public. They use a rapid HIV test that delivers results in 20 minutes. Testing is available without an appointment. WWH also sponsors an HIV Mobile Testing Unit that goes into communities at risk and provides HIV testing and prevention Peer support program: 2 groups are available for individuals newly diagnosed with HIV. 1 group is for long term HIV survivors. 1 on 1 support services are also available.',NULL,NULL,NULL,'http://whitman-walker.org',NULL,4,NULL,NULL,NULL,NULL,'1194108716776364','1130306195397865','1234289739881760',0,NULL,NULL,NULL),(139,999334342940796,'Nourish Now',NULL,NULL,NULL,'Nourish Now is a 501c3 nonprofit food bank, specializing in food recovery and providing donations from grocers, caterers, restaurants, bakeries, and other food donors for the benefit of children, families, and the elderly, as well as shelters, food pantries, and other organizations working to end hunger. Through our programs, viable food partners are identified, and donations of food are recovered and redistributed through our network.','info@nourishnow.org',NULL,NULL,'https://nourishnow.org/',NULL,4,NULL,NULL,NULL,NULL,'1287178898963916','780586392014879','1266225890742478',0,NULL,NULL,NULL),(140,1006551858895588,'Goodwill of Greater Washington',NULL,NULL,NULL,'Provides education, training, and employment services for people with disadvantages and disabilities. Also offers life skills training, computer classes, and a job placement services program. \n\nRetail thrift store for clothing and home goods. Accepts donations of goods, money, and vehicles. ',NULL,NULL,NULL,'http://www.dcgoodwill.org/',NULL,4,NULL,NULL,NULL,NULL,'796887413251668,993349225663598','1097481648548755,853501578147425','556992607571593',0,NULL,NULL,NULL),(141,1013543362848937,'Hughes Memorial UMC',NULL,NULL,NULL,'A church offering various community services.','adminasst@hughesmemorial.org',NULL,NULL,'http://www.hughesmemorial.org',NULL,4,NULL,NULL,NULL,NULL,'565227181581504,647232963972591,801873048546872,1114943570667214,1125749101520857,1185457585183638,974562561948426','905425032669080,1273725796552539','628637355176202',0,NULL,NULL,NULL),(142,1034824444966763,'NEWCOMER COMMUNITY SERVICE CENTER: ENGLISH SECOND LANGUAGE',NULL,NULL,NULL,'Provide free evening English classes in both the D.C. and Virginia offices.',NULL,NULL,NULL,'http://newcomerservice.org',NULL,4,NULL,NULL,NULL,NULL,'874569788026655','568191996005988','848140138973075',0,NULL,NULL,NULL),(143,1043772486617212,'Unity Health',NULL,NULL,NULL,'',NULL,NULL,NULL,'http://unityhealthcare.org',NULL,4,NULL,NULL,NULL,NULL,'642373200193088',NULL,'932319171762566',0,NULL,NULL,NULL),(144,1061460575455807,'Virginia Williams Family Resource Center',NULL,NULL,NULL,'The Virginia Williams Family Resource Center (VWFRC) is the central intake office for families requesting emergency housing and assistance in DC. Families in need complete a needs assessment with a VWFRC Intake Specialist and if deemed homeless are referred to available shelter locations or alternative shelter placements when available. Families are also assisted with other services including employment services and job training, substance abuse and mental health referrals, and legal support services. Wait times at the Center can sometimes be long, and the intake process is expected to take at least 2 hours, so families are encouraged to come when they can dedicate a full day to this process.',NULL,NULL,NULL,'https://dhs.dc.gov/page/virginia-williams-family-resource-center',NULL,4,NULL,NULL,NULL,NULL,'1164661927797269,1106419147216738','1066322983572364','1282660521731521',0,NULL,NULL,NULL),(145,1061724977026001,'Children\'s National Hospital','Children\'s National Health System',NULL,NULL,'Children\'s hospital providing comprehensive medical and specialty services.\n\nWith a health care experience designed around kids\' unique needs, Children\'s National Hospital is the premier provider of pediatric services in the Washington, D.C., metro area and its only health system specializing in kids. \n\nOur pediatric specialists are internationally recognized for providing the best possible care. In fact, Children&rsquo;s National is ranked #6 nationally in the U.S. News & World Report Best Children&rsquo;s Hospitals annual rankings. Additionally, Children\'s is ranked #1 in neonatology and is Magnet&reg;-designated for excellence in nursing.\n\nChildren\'s National is one of only twelve children&rsquo;s hospitals in the country to attain Level 1 Surgery Verification from the American College of Surgeons. This distinction recognizes surgery centers who have improved surgical quality, prevented complications, reduced costs and saved lives.\n\nWe&rsquo;ve also earned a global reputation for pioneering new therapies and treatments, including heart, cancer, neurology, and general surgery innovations. Home to the Children&rsquo;s Research Institute and the Sheikh Zayed Institute for Pediatric Surgical Innovation, Children&rsquo;s National is ranked seventh in NIH research funding for pediatric institutions. \n\nWe&rsquo;re also recognized as committed advocates for children on local, state, and federal health policy. In fact, we&rsquo;re often the first at the table when pediatric healthcare legislation is being developed. ',NULL,NULL,NULL,'https://childrensnational.org',NULL,4,NULL,NULL,NULL,NULL,'1262392779353939,936643241913847,667209917494721,1176014704120176,936510517377927,1095230986476849,1195217931217458,775820607481251,870219187741961,951768857764331,1291991254111763,1106825602268001','1148967777928261,978304346911390','1282604214927911,856126341619748,979447652621070,1262539583552576,1123014911424110,847752209986828,1283315251842747,812651859569539',0,NULL,NULL,NULL),(146,1085960322097234,'Coalition for the Homeless',NULL,NULL,NULL,'Provides coalition for the Homeless and Headquarters services.',NULL,NULL,NULL,'http://www.dccfh.org/',NULL,4,NULL,NULL,NULL,NULL,'1191507987013016','1202903945491491','847934048599676',0,NULL,NULL,NULL),(147,1085490883099798,'National Baptist Memorial Church',NULL,NULL,NULL,'A local church providing a few services to the community including food, clothing, and a children\'s ministry.','NBMChurch@msn.com',NULL,NULL,'http://www.nbmchurchdc.org/',NULL,4,NULL,NULL,NULL,NULL,'937906584225930,961164325265072,816660270769024','731593628942678','1146981306227913',0,NULL,NULL,NULL),(148,1043249662316489,'MIRIAM\'S KITCHEN',NULL,NULL,NULL,'Every Wednesday, 12noon-2pm nearly 100 guests join Miriam\'s Cafe for a healthy lunch, the opportunity to access case management services, and the chance to participate in life skills classes.',NULL,NULL,NULL,'http://miriamskitchen.org',NULL,4,NULL,NULL,NULL,NULL,'636128659634571','582664674810922','1220017101351760',0,NULL,NULL,NULL),(149,1093127605400642,'AARP Legal Counsel for the Elderly',NULL,NULL,NULL,'Delivers essential services to Washington, D.C. seniors, 60 and older, providing free legal and social work services to those in need, empowering, defending and protecting. Attorneys represent seniors facing foreclosures, evictions, and consumer fraud. LCE handles Medicaid and Social Security cases, provides benefits checkups to assure that seniors and Veterans are receiving the benefits they are due, prepares Wills and Powers of Attorney, and educates elders in ways to avoid Medicare and Medicaid fraud. LCE also accommodates homebound seniors by providing legal services in their homes',NULL,NULL,NULL,'http://www.aarp.org/lce',NULL,4,NULL,NULL,NULL,NULL,'928612911758060,1195448583131416,944036937200998,845999906983085,803655377623585,929396265497963,956658240049666,1292756176570822,662348348100050,762888373958688,1135875611263139,819327215791900','1154003895918016,1262951146146675,1287736008934844','1287901333269561',0,NULL,NULL,NULL),(150,1088589897673997,'Mamatoto Village',NULL,NULL,NULL,'Mamatoto Village is a 501 (c)(3) non-profit organization devoted to creating career pathways for Women of Color in the field of public health and human services; and providing accessible perinatal support services designed to empower women with the necessary tools to make the most informed decisions in their maternity care, their parenting, and their lives.','info@mamatotovillage.org',NULL,NULL,'https://www.mamatotovillage.org/',NULL,4,NULL,NULL,NULL,NULL,'1220271139140877,1092577874332799,1017815111476074,1135169686375345','644056895061746,867238429645312','1191890430739322',0,NULL,NULL,NULL),(151,1131980011333623,'Efforts from Ex-Convicts, Inc.',NULL,NULL,NULL,'Efforts From Ex-Convicts, Inc (EFEC) was founded in 1966 by a group of ex-convicts committed to lending each other support in the face of society&rsquo;s rejection.  Led by two ex-offenders, Rev. Griffin S. Smith and Ralph &lsquo;Petey&rsquo; Greene, the organization attracted ex-offenders who were desperately seeking a welcoming community upon their release from incarceration.  Recognizing the need to provide tools with which its members could rebuild their lives, EFEC creates Self-Help, Employment Training and Housing programs to equip and enable ex-offenders with the opportunity to begin his or her journey back to a productive life.\n\nWhile EFEC steadily and faithfully interacts with individuals ex-offenders, the organization feels an abiding obligation to be advocates, to enlighten biased viewpoints regarding the problems which ex-offenders face upon release, and to change society&rsquo;s negative and punishing attitude towards ex-offenders.  EFEC&rsquo;s daily mission is to help ex-offenders receive a second chance to succeed, to be employed at a living wage, and to lead dignified and meaningful lives.',NULL,NULL,NULL,'http://www.efecachieves.org/',NULL,4,NULL,NULL,NULL,NULL,'888015364104840,1300980508291929,948442047347066','958138225979794','1297547838260579',0,'664148755918958',NULL,NULL),(152,1091757696945828,'Legal Aid Society of the District of Columbia',NULL,NULL,NULL,'The Legal Aid Society of DC was formed in 1932 to provide civil legal aid to individuals, families and communities in the District who could not otherwise afford to hire a lawyer. Legal Aid staff and volunteers provide a continuum of services from client education to full representation before a court or an administrative tribunal. Preferences are given to the following cases: preserving affordable housing, preserving home ownership, ensuring a safe and decent place to live, securing access to health care, nutrition and public benefits, protecting families against domestic violence, promoting family stability through child support and custody arrangements and automobile ownership.',NULL,NULL,NULL,'http://legalaiddc.org',NULL,4,NULL,NULL,NULL,NULL,'1088296624271784,950151604773646,871063337645437,1098665459896297,757455042685009','1289374770713295,1234325977097951','768639914164498,1052799655566995,956369396938800,956135951962872',0,NULL,NULL,NULL),(153,1091687465844379,'Manna Food Center',NULL,NULL,NULL,'Manna Food Center&rsquo;s singular mission is to eliminate hunger in Montgomery County, Maryland. Through food distribution, education and advocacy, we are making strides on behalf of more than 63,000 county residents who experience hunger and food insecurity.',NULL,NULL,NULL,'https://www.mannafood.org/',NULL,4,NULL,NULL,NULL,NULL,'1295568882348530,1098880366371154','1181713169181704','1348564381004436',0,NULL,NULL,NULL),(154,1110735130668467,'PROVIDENCE HOSPITAL',NULL,NULL,NULL,'Provides Psychiatric services',NULL,NULL,NULL,'http://www.provhosp.org',NULL,4,NULL,NULL,NULL,NULL,'1230192545630197','857944483379087','1045557663297574',0,NULL,NULL,NULL),(155,1120305351510755,'D.C. DEPARTMENT OF BEHAVIORAL HEALTH (DBH): CONSUMER FOCUSED ACTIVITY CENTER: OUR DOOR',NULL,NULL,NULL,'The purpose of the community peer operated activity center is to: 1) assist people with psychiatric illness who may also have co-occurring substance use disorder and medical conditions, regain control over their lives and their own recovery process; 2) achieve this goal in an environment that is conducive to support for self-directed recovery, advocacy, education, and information and referral services based on consumer experience, knowledge and input; and 3) provide activities that include: recreational and social, educational, Peer Support and Peer Advocacy groups, health education and linkages to medical care including participating in health fairs, community resource identification, assistance with benefits and entitlement applications; improvement of social interpersonal skills and life skills validation (e.g., Wellness Recovery Action Plan (WRAP) classes); and education on consumer rights.',NULL,NULL,NULL,'http://dbh.dc.gov',NULL,4,NULL,NULL,NULL,NULL,'577138792955216','1001002757285869','1140332291662029',0,NULL,NULL,NULL),(156,1141864402494387,'Asian Pacific American Legal Resource Center','APALRC',NULL,NULL,'The mission of the APALRC is the advance the civil and legal rights of Asian Americans by focusing on providing linguistically accessible and culturally appropriate legal services to low-income Asian immigrants in Metro-DC who have limited English proficiency. The goal is to ensure that Asian Americans can access government services and the legal system to protect and enforce their right, and to seek full participation in American society. The APALRC seeks to accomplish this mission through a three-prong strategy that combines community legal education, individual representation, and systemic advocacy.','helpline@apalrc.org',NULL,NULL,'http://www.apalrc.org/',NULL,4,NULL,NULL,NULL,NULL,'830080281630476,644620777168393,1137250454182986,822696272964380,1111524873166786,856596013009881,1348541466880314','1148564700806737','1264011549910449',0,NULL,NULL,NULL),(157,1150695227682882,'Assumption Catholic Church','Assumption Church of the 