 day, we are helping hundreds of children solve problems that no child should face. No child should have to wonder who to live with when his parents can no longer safely care for him. No child should have to fight for the special education services she needs so she can learn.  No child should have to go to court to ensure his landlord fixes the heat and water in his basement apartment during the frigid winter months.',NULL,NULL,NULL,'https://www.childrenslawcenter.org',NULL,4,NULL,NULL,NULL,NULL,'1102556254964153','1337254835856329,1230762582745771','916631371752727',0,NULL,NULL,NULL),(163,1099027550013558,'FAMILY PLACE: EMERGENCY ASSISTANCE PROGRAM',NULL,NULL,NULL,'Provides hospitality, resources, and support services to expectant parents and families with young children (through the age of five). Helps meet emergency needs, provides information and education and enhances long-term family stability',NULL,NULL,NULL,'http://thefamilyplacedc.org',NULL,4,NULL,NULL,NULL,NULL,'936572307607654','736432051457759','826027653390612',0,NULL,NULL,NULL),(164,1119446546918981,'UNITY HEALTH CARE: UPPER CARDOZO HEALTH CENTER',NULL,NULL,NULL,'This site provides medical, dental, and specialty services. Primary Medical Care at this site includes adult medicine, family medicine, internal medicine and pediatrics. Dental care services include restorative dentistry, extractions, dentures and hygiene. Specialty care includes behavioral medicine, cardiology, HIV care, OB/GYN, podiatry, pulmonary medicine and rheumatology. Health education is also provided. Clinic hours: Mon-Fri 8am-10pm; Saturday and Sunday, 8am-2pm. WIC hours: Mon-Fri 8:30am-5pm, and Saturday 8am-12pm. UHC provides people in Washington, D.C. with quality health care regardless of ability to pay. For those who can pay, a sliding scale based on family size and income is used to determine the appropriate amount. Unity Health Care accepts Medicaid, Medicare, Managed Care Organizations, DC Healthcare Alliance (AmeriHealth, MedStar Family Choice, Trusted Health Plan), and other private insurance plans. LOCATED IN WARD 1.',NULL,NULL,NULL,'http://unityhealthcare.org',NULL,4,NULL,NULL,NULL,NULL,'939026297030865','1186694314218565','1128869310018968',0,NULL,NULL,NULL),(165,1114103792920259,'La Casa',NULL,NULL,NULL,'A transitional housing rehab program for homeless men.',NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,NULL,NULL,'646395612481753','1213542765723083','595592759444028',0,NULL,NULL,NULL),(166,1116810105858975,'Central American Resource Center','CARECEN',NULL,NULL,'CARECEN&rsquo;s mission is to foster the comprehensive development of the Latino population in the Washington metropolitan region by providing direct services, while promoting grassroots empowerment, civic engagement, and human rights advocacy.','info@carecendc.org',NULL,NULL,'http://carecendc.org/',NULL,4,NULL,NULL,NULL,NULL,'657511678545226,688139575815288,810344496794884,821980999983631,1115196970236426,738209311024775,1100791575997951,1225863118799944,1251743719079225,1083719705858867,607894816484467,882877789489952,615976785591225,900680386991276,1273385977104878,1094845253700469,626403044236059','1158694379718344','547920365968268',0,'1295679372454826',NULL,NULL),(167,1118282953085799,'KUEHNER PLACE, SHELTER FOR ABUSE ELDERLY AND NEGLECTED',NULL,NULL,NULL,'Provides coalition for the Homeless, Headquarters services',NULL,NULL,NULL,'http://some.org/services/senior-services/',NULL,4,NULL,NULL,NULL,NULL,'902085800158226','1162193804880983','616405328742379',0,NULL,NULL,NULL),(168,1145770015988205,'SALVATION ARMY: ANGEL TREE PROGRAM',NULL,NULL,NULL,'Distributes eligible toys and gifts to children for Christmas registered with the Angel Tree Christmas Program.',NULL,NULL,NULL,'http://salvationarmynca.org/',NULL,4,NULL,NULL,NULL,NULL,'852375326314892','1096946727548641','1274749149318878',0,NULL,NULL,NULL),(169,1169351687674186,'Advocates for Justice and Education',NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL),(170,1168436736852155,'Vida Senior Centers',NULL,NULL,NULL,'Vida Senior Centers is a second home for the Hispanic older people of DC. Every day Vida opens its doors at 9:00am to provide a big variety of services to our seniors: breakfast and lunch, health screening, social services, nutritional counseling, mental health workshops as well as education and recreational activities. We have served over these 5 decades more than 20,000 Hispanic seniors in DC, being most of them below the poverty line. At least 120 seniors come daily to our two centers. They are primarily Spanish speaking and are originally from 26 countries of Central and South American and Mexico.\n\nVida Senior Centers has worked with this population for more than 40 years and has developed culturally appropriate, multilingual systems of support and socialization that make aging independently easier for Hispanic and other foreign-born elderly. What distinguishes Vida Senior Centers is the small group attention lavished on our clients. Services to over 700 individuals a year are delivered personally, bilingually and culturally appropriate, making it possible for the organization to cater to the many cultures represented by the Latino and other seniors who are Vida clients.','info@vidaseniorcenter.org',NULL,NULL,'http://www.vidaseniorcenter.org/',NULL,4,NULL,NULL,NULL,NULL,'853468345123345,1106083468244471,780286718217610,785698484366760,810358604812792','868134146707193,1147869714969920','646558365152210,632725434790464',0,NULL,NULL,NULL),(171,1187372282686349,'Father McKenna Center',NULL,NULL,NULL,'The Father McKenna Center is an independent 501(c)3 in the Ignatian Catholic tradition, steps from the US Capitol in Washington, DC. We serve men struggling with homelessness and families in Ward 6 dealing with food insecurity. We provide a structured program supporting our mission of Meetings Needs&hellip; Reclaiming Lives. We depend on community support. If you are able to help you can pray for us, volunteer with us, or donate to support our work.',NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,NULL,NULL,'1224104445658687,612611049847328,1249294483746869,972989260139901,576988108950338','1123859846194392','1209121324412172',0,NULL,NULL,NULL),(172,1164024351359039,'Safe Shores','Safe Shores—The DC Children’s Advocacy Center',NULL,NULL,'Safe Shores&mdash;The DC Children&rsquo;s Advocacy Center is a direct service nonprofit organization dedicated to supporting and working directly with child victims of sexual and physical abuse in the District of Columbia.',NULL,NULL,NULL,'https://www.safeshores.org/',NULL,4,NULL,NULL,NULL,NULL,'927643315007217,902098981922569,1290043633447090,1138943294791040,1181830707554784,1153502278841700','1171658960657370','1101386810121427',0,'1079714166824390',NULL,NULL),(173,1183850219079477,'Yachad',NULL,NULL,NULL,'Yachad\'s mission is to bring communities together by preserving affordable homes and revitalizing neighborhoods throughout the District of Columbia and the greater metropolitan area. Yachad means &ldquo;together&rdquo; in Hebrew, and that is how we do our work through partnerships with homeowners, houses of worship, nonprofits, and other community stakeholders. We mobilize skilled and unskilled volunteers, invest financial resources, and, through our work together, transform people and properties. Our mission is rooted in the Jewish commitment to seek justice by engaging in acts of loving kindness. We welcome people of all faiths to share in our work to keep our communities diverse and vital.\n\nYachad continues to have a big impact twenty years later&mdash;by staying true to our original mission to preserve housing in DC and engage the Jewish and greater community in social justice work. We do this through partnerships with homeowners in our Single Family Home Repair Program. This program brings skilled workers and volunteer groups into area homes. Over the course of many months, a home\'s plumbing, electrical, drywall, and other infrastructure repairs are made. Yachad requires homeowners to participate in our Homeowner Education Workshops to learn home maintenance and financial planning skills. Many of Yachad\'s volunteers participate in Sukkot in Spring, a program in which synagogues and other Jewish community groups make repairs in a home alongside the homeowners.\n\nOther volunteers throughout the year include semi-skilled volunteers through the Handymensch Program and skilled workers who donate money and/or services through Yachad\'s Neighbor to Neighbor Initiative. Families or groups of friends may also celebrate a special occasion by hosting a Mitzvah Party, in which they sponsor and participate in a home repair project. Over the summer, high school students participate in Yachad\'s Ramp it Up! program in which campers build an accessibility ramp for an individual with disabilities.\n\nAdditionally, Yachad\'s Faith to Faith Community Development Program brings together real estate professionals to provide expertise to community development projects by working in partnership with houses of worship and other nonprofits to renovate their community facilities to better serve the congregants and neighborhood residents.','info@yachad-dc.org',NULL,NULL,'http://yachad-dc.org/',NULL,4,NULL,NULL,NULL,NULL,'1258855549014937,1124787894447866','896191474881929','888398891117437',0,NULL,NULL,NULL),(174,1189531744334079,'WASHINGTON LEGAL CLINIC FOR THE HOMELESS',NULL,NULL,NULL,'The core of the Legal Clinic\'s work, through the Legal Assistance Project, is the representation of individual low- and no-income clients through a network of over 200 volunteer attorneys and legal assistants. Volunteers obtain clients on a referral basis or at one of 7 intake sites run by the Legal Clinic at meal programs, health clinics, and day programs throughout DC. Volunteer attorneys participating in the project represent people on issues including: public benefits (e.g., SSD, SSI, medical assistance, food stamps and TANF); shelter and housing (e.g. shelter placement, conditions and expulsions, public housing, Housing Choice Voucher Program eligibility and terminations, and housing condition disputes); street rights; and consumer debt/credit. Please contact the Legal Clinic\'s main line at (202) 328-5500 for the most up-to-date scheduling information.',NULL,NULL,NULL,'http://legalclinic.org',NULL,4,NULL,NULL,NULL,NULL,'1123977616675533','760540407770358','786926809235258',0,NULL,NULL,NULL),(175,1195870505334629,'Community of Hope',NULL,NULL,NULL,'Community of Hope&rsquo;s mission is to create opportunities for low-income families in Washington, DC, including those experiencing homelessness, to achieve good health, a stable home, family-sustaining income, and hope. Main areas of services are health and housing.',NULL,NULL,NULL,'https://www.communityofhopedc.org/',NULL,4,NULL,NULL,NULL,NULL,'859897161557047,1267727721478414,850523592271025,1255893170172420,784304581015971,617097787641398,735696343430795,747822750998769,1022185739742814,1121979483597520,573528188325499,1238532588650595,757654002604408,860779231100127,1128285304774272,1163310698125750','665495770462606,763524779006557,846201766185688,1279880844015186,785030046200943,1009882132687958,1138712052293951,1329462654055472,620660527885902,1227307482511597,830522845866182','1146632771763115,1090162375763715,1000709017081839,803276717045236,984945374868800,912957411649595,794801403576891,1323076878369772,867188743739885',0,NULL,NULL,NULL),(176,1138775501034023,'DC Action for Children',NULL,NULL,NULL,'DC Action provides data-based analysis and policy leadership on critical issues facing DC children and youth, to promote policies and actions that optimize child and family well-being.',NULL,NULL,NULL,'http://dcactionforchildren.org',NULL,4,NULL,NULL,NULL,NULL,'1018775936818943',NULL,'1147823510376197',0,NULL,NULL,NULL),(177,1140996665222837,'CASA de Maryland',NULL,NULL,NULL,'We are a group of passionate, community-conscious people working to organize, advocate for, and expand opportunities for Latino and immigrant people in the state of Maryland, Pennsylvania, and Virginia. We do this by providing employment placement; workforce development and training; health education; citizenship and legal services; and financial, language, and literacy training to Latino and immigrant communities throughout the state. Since our humble beginnings in 1985 assisting Central American refugees fleeing wars and civil strife at home, we have worked tirelessly to bring immigrant communities in Maryland, Virginia, and Pennsylvania out of the shadows and into greater power, dignity, and legitimacy.',NULL,NULL,NULL,'https://wearecasa.org',NULL,4,NULL,NULL,NULL,NULL,'617081192222015,1090898575973829,1241641820248132,1216690927743518,881475888864647,834347484127358,914537946909052,627323919512057,886788508609002','1089348867989022,832248572481016,856919957289680,1279959054833190,1184988992731200,789425002305998,1195584083587905,799225207997440,1111869997679664,644907115727601,1064747875068781,1146297245374974,1165189569084809,849783929453542,1008096048941764,598769248157949,1230683467022899,953481840997521,1090592201973063,914445625577149,1218289339018813,958973665695309,809123225614933,689569738972286,611448477360093','1091435530922324,1273044419277442,818820237164190,1091888223201074,1240567562394258,1283411988337750,979563581148756,939050372857166,1318390042587758',9223372036854775807,NULL,NULL,NULL),(178,1178149503221687,'Housing Up',NULL,NULL,NULL,'Affordable housing and comprehensive support services to homeless and low-income families. ','info@housingup.org',NULL,NULL,'https://housingup.org/',NULL,4,NULL,NULL,NULL,NULL,'1125198539592081,818489779377722,857532124289295,1141643347330568,979887684937950,770458474126572','686982567624206','1258883277954568',0,NULL,NULL,NULL),(179,1198455162499731,'Medstar Georgetown University Hospital',NULL,NULL,NULL,'',NULL,NULL,NULL,'www.medstargeorgetown.org',NULL,4,NULL,NULL,NULL,NULL,'603778865328891',NULL,'1299466022640885',0,NULL,NULL,NULL),(180,1205641770221060,'CFLS: TRANSITIONAL HOUSING PROGRAM AT TRINITY ARMS',NULL,NULL,NULL,'Offers a two year transitional housing program for homeless families. Families receive 2 years of temporary housing in an apartment unit and social services designed to help them move toward self-sufficiency. Families pay 30% of their net monthly income.',NULL,NULL,NULL,'http://cflsdc.org',NULL,4,NULL,NULL,NULL,NULL,'1225292713865575','604159793210932','776793732904241',0,NULL,NULL,NULL),(181,1154572477664352,'DC Public Library',NULL,NULL,NULL,'The DC Public Library offers adult literacy services through the Adult Literacy Resource Center (ALRC). The ALRC provides literacy services to young adults (16 years +) and adults and is staffed with adult literacy education specialists.\n\nWe have instructional, informational and leisure reading materials for adult developing readers and speakers of other languages.We also provide resource materials for teachers and tutors of literacy, ABE, GED and English as a Second Language (ESL).',NULL,NULL,NULL,'https://www.dclibrary.org/services/adult',NULL,4,NULL,NULL,NULL,NULL,'887937499803617','632652143042998','1242363315641650,935220481179962',0,NULL,NULL,NULL),(182,1172521016075482,'DC Department of Behavioral Health Mental Health Access Helpline',NULL,NULL,NULL,'The Access HelpLine at 1(888)7WE-HELP or 1-888-793-4357 is the easiest way to get connected to services provided by the Department of Behavioral Health and its certified behavioral health care providers. This 24-hour, seven-day-a-week telephone line is staffed by behavioral health professionals who can refer a caller to immediate help or ongoing care. The Access Helpline can activate mobile crisis teams to respond to adults and children who are experiencing a psychiatric or emotional crisis and are unable or unwilling to travel to receive behavioral health services. ',NULL,NULL,NULL,'https