All people transitioning out of homelessness need resources beyond decent, affordable housing to thrive. They need access to nutritious foods, education, employment, parenting supports, children&rsquo;s services, transportation, physical and behavioral health care services. So, we approach our services as we approach caring for our own families, with a whole person, whole family, and whole community mindset. We exist to provide a range of housing solutions and supportive services to ensure that individuals and families in our community have what they most need to thrive.',NULL,NULL,NULL,'https://everyonehomedc.org/',NULL,4,NULL,NULL,NULL,NULL,'753253159497862,597642797256208,1087270111823708,857913961326886,1174727442443930,895973468150097','735608882009072,976521643212097,591848459801218','843095304494507,936934819762396',0,NULL,NULL,NULL),(208,1257820660406303,'Sixth Presbyterian Church',NULL,NULL,NULL,'A local church offering a food pantry.','office@sixthpresbyterian.org',NULL,NULL,'http://www.sixthpresbyterian.org/',NULL,4,NULL,NULL,NULL,NULL,'958476585509237','588843626629723','890450452640466',0,NULL,NULL,NULL),(209,1274524554725599,'Mc Kendree United Methodist Church',NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,NULL,NULL,'1166106416739636,1220865966040605,856023638190230','821254553857567','861906967611938',0,NULL,NULL,NULL),(210,1275972111076677,'Northwest Center',NULL,NULL,NULL,'With both our maternity home and the pregnancy center programs, our mission is to support pregnant or parenting women in need, to act on our belief in the intrinsic value and dignity of all human life, and to provide for new beginnings for pregnant or parenting women. The Northwest Center believes that it is essential for every pregnant woman to have access to safe housing, food, clothing, medical care, and educational and/or job opportunities so that she can adequately provide for herself and her children. Our programs are designed to be more than a &ldquo;band-aid solution,&rdquo; rather we strive to effectuate real change in the lives of the women and children we serve. The ultimate goal of both programs is to enable our clients to achieve self-sufficiency, which we define as having sustainable employment, adequate health care and viable housing for themselves and their child(ren).',NULL,NULL,NULL,'http://www.pregnancyhelpdc.org/',NULL,4,NULL,NULL,NULL,NULL,'1048327823635547,895703387545823','776656918535876','688746232722666',0,NULL,NULL,NULL),(211,1276788103667282,'D.C. DEPARTMENT OF BEHAVIORAL HEALTH (DBH): SUBSTANCE USE DISORDER SERVICES: WARDS FIVE AND SIX PREVENTION CENTER',NULL,NULL,NULL,'The Department Of Behavioral Health (DBH): Substance Use Disorder Services provides four Prevention Centers to provide substance use disorder services including detoxification, residential and outpatient services based on the level of need. It also provides a range of prevention and recovery services.',NULL,NULL,NULL,'http://dbh.dc.gov',NULL,4,NULL,NULL,NULL,NULL,'780601488413554','742520224803831','1185866432124387',0,NULL,NULL,NULL),(212,1280475814917857,'WHITMAN-WALKER CLINIC: LEGAL SERVICES PROGRAM',NULL,NULL,NULL,'Offers a variety of pro bono legal services to persons living with HIV/AIDS. Provides legal counseling and representation in the areas of confidentiality, insurance, discrimination, immigration, future planning documents, and access to public benefits.',NULL,NULL,NULL,'http://wwc.org',NULL,4,NULL,NULL,NULL,NULL,'684439431487008','912916861756268','948165240614648',0,NULL,NULL,NULL),(213,1286410465547920,'Department of Human Services',NULL,NULL,NULL,'IMA Change Center Phone: 727-6600\nFax: 535-1665\nFort Davis Service Center, 3851 Alabama Ave, SE. 645-4500\nAnacostia Service Center, 2100 MLK Jr Ave, SE. 645-4614\nCongress Heights Service Center, 4001 S. Capitol St, SW. 645-4525\nTaylor St Service Center, 1207 Taylor St, NW. 576-8000',NULL,NULL,NULL,'DHS 4 In 1 App',NULL,4,NULL,NULL,NULL,NULL,'1159527228339119','1102555479175