s and services offered to young people help them to get back on track in achieving housing, career, and economic stability. \n\nWe create tailored solutions for each young person that goes beyond short-term housing and support. Our approach equips youth with the resources they need to overcome common obstacles and barriers. Aside from housing, youth receive workforce readiness, job/career placement, post-secondary support, case management, mental health support, drop-in services, child development center (for youth with children), and more.',NULL,NULL,NULL,'http://covenanthousedc.org',NULL,4,NULL,NULL,NULL,NULL,'953668428109766,1147909066828937,978169761735866,885835927138322,875542904723327,963779263900815,1105456695695453,1212544141593855,682308202362189','613066881487958','1106602330344467',0,NULL,NULL,NULL),(226,1287130751059247,'Calvary Women\'s Services',NULL,NULL,NULL,'Our programs are designed for women who are survivors of violence and trauma, are living with mental illness, or are in recovery from substance abuse. Through personalized services and with peer support, each woman identifies and builds on her own strengths in order to meet her goals for safe housing, good health, and financial independence.','info@calvaryservices.org',NULL,NULL,'https://www.calvaryservices.org/',NULL,4,NULL,NULL,NULL,NULL,'750465787434275,862423770633741,1234340144717096,765387458092097','1285405208459287,660946577762729','1315826372203677',0,NULL,NULL,NULL),(227,1300690778936362,'VETERANS AFFAIRS (VA) OUTPATIENT CLINIC: SOUTHEAST WASHINGTON D.C.',NULL,NULL,NULL,'The Community Based Outpatient Clinic (CBOC) Southeast provides basic medical and preventative care, health education, mental health services, addiction counseling, comprehensive women\'s health care and nutritional counseling to eligible veterans. Referral services are provided for those who require specialized care.',NULL,NULL,NULL,'http://www.washingtondc.va.gov/locations/',NULL,4,NULL,NULL,NULL,NULL,'1288975729182572','960149581422207','953406517143083',0,NULL,NULL,NULL),(228,1319047892616905,'SOME: SHALOM HOUSE',NULL,NULL,NULL,'Offers affordable, housing for adults transitioning from homelessness to independent living. Residents pay 30% of their income as rent, participate in regular house meetings and maintain their health and sobriety.',NULL,NULL,NULL,'http://some.org',NULL,4,NULL,NULL,NULL,NULL,'777108871381104','606210161081529','1261924735850333',0,NULL,NULL,NULL),(229,1318451956583107,'Clean and Sober Streets',NULL,NULL,NULL,'Clean and Sober Streets offers long term residential and outpatient drug and alcohol treatment and rehabilitation services for men and women who are willing to recover in Washington, DC.',NULL,NULL,NULL,'http://cleanandsoberstreets.org/Welcome.html',NULL,4,NULL,NULL,NULL,NULL,'936863331676390,968057316664450,1178562151177693,636134392103308','1146453286231773,1094848634511675,883461165895110','1147455525775238',0,NULL,NULL,NULL),(230,1326157862705937,'MBI Health Services',NULL,NULL,NULL,'A comprehensive health agency offering the following services:\nFree Standing Mental Health Clinic & CORE\nHome Health Care Services\nDay Treatment Program\nRSA & Supported Employment Services\nDepartment on Disability Services Division\nTransitional Age Youth Division (TAY)\nPartnerships\nNurse Staffing Services\nReturning Citizens Program\nHealth Home Services\nAssertive Community Treatment (ACT)\nAdult Day Health Program (ADHP)\nSubstance Use Disorder (SUD)\nHousing Programs\nChildren\'s Program','info@mbihs.com',NULL,NULL,'http://www.mbihs.com/',NULL,4,NULL,NULL,NULL,NULL,'1105568722092716,894009414185445,721115353360225,1135621422748851,1215651158311524,784662874544792,699918289813778,1055385917949527,1109924174096172,597026276891169,1020934285482366,585407675930864,800132260226272,794816074234794,1206891395647206,985012947614539','1211781059829341,1309068726775336,929037191615824,902963958186519,613925188728049,1169367921365761,827283242603751,8784481977365