INSERT INTO `services` VALUES (1,543629082697964,'Psychoeducational Group Intervention',NULL,887352348953420,'La Clínica operates a counseling program called Mi Familia, which works to reduce the negative impact of traumatic stress and to improve overall stability within the family unit. In this 14 week-long program, families receive individual and family counseling treatment while attending weekly psycho-educational group interventions. Program participants learn about effective communication and stress management strategies while emphasizing abuse and trauma prevention. In 2010, the program was awarded the National Council of La Raza’s Strengthening Families Award.','1170113060894673','https://lcdp.org/_en/programs-mental-health.html',NULL,NULL,'Verified','941516382466411','Call or walk in to begin patient registration.',NULL,NULL,NULL,NULL,'660265936787847,1143026726991574,853098088747359','1202170493625306,686273477676422',NULL,'1295679372454826','1080723808883365',NULL,NULL,NULL),(2,571969699128717,'Center for the Blind & Visually Impaired',NULL,1180598613249590,'Losing your vision can be not only challenging but also isolating and depressing. The Center for the Blind supports older adults in Washington, D.C. with making the physical and emotional adjustments to living with blindness.\n\nServices at the Center are free to all D.C. residents and include independent living skills training, music therapy, nutritional meals, braille, and other communication skills. ','765115819494380','https://www.seaburyresources.org/centerforblind',NULL,'info@seaburyresources.org','Verified','637158405241810','Call to apply for services.',NULL,NULL,NULL,NULL,'990653723421604','1176087327224268',NULL,'854808174954754,923078251322861','638665770674913',NULL,NULL,NULL),(3,577138792955216,'D.C. DEPARTMENT OF BEHAVIORAL HEALTH (DBH): CONSUMER FOCUSED ACTIVITY CENTER: OUR DOOR',NULL,1120305351510755,'The purpose of the community peer operated activity center is to: 1) assist people with psychiatric illness who may also have co-occurring substance use disorder and medical conditions, regain control over their lives and their own recovery process; 2) achieve this goal in an environment that is conducive to support for self-directed recovery, advocacy, education, and information and referral services based on consumer experience, knowledge and input; and 3) provide activities that include: recreational and social, educational, Peer Support and Peer Advocacy groups, health education and linkages to medical care including participating in health fairs, community resource identification, assistance with benefits and entitlement applications; improvement of social interpersonal skills and life skills validation (e.g., Wellness Recovery Action Plan (WRAP) classes); and education on consumer rights.','1140332291662029','http://dbh.dc.gov',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'578228161038746',NULL,NULL,NULL),(4,580209857140665,'Adult Trauma Services',NULL,1265431689708141,'Inpatient - Day Program Partial Hospitalization - Intensive Outpatient\nSpecialty care for post-traumatic stress disorder includes rapid stabilization and skilled intervention. Our innovative treatment model focuses on training individuals in self-management skills using stage-oriented, cognitive and behavioral strategies. Our treatments for PTSD also includes problem-solving techniques with special focus on identifying skills patients can use during treatment and after discharge.\n\nThe Day Center offers two levels of intensity:\nPartial Hospitalization — four or five days of treatment each week dedicated to helping prevent inpatient admission or to shorten an acute inpatient stay\nIntensive Outpatient — a two to three-day a week program designed to help patients struggling with chronic or intermittent work and social dysfunction\nIndividualized treatment plans are developed to:\n\nEncourage maximum levels of functioning\nExpedite the transition to less intensive levels of treatment\nOffer flexible scheduling to accommodate a transition to work\nAvailable Treatment Groups\nGoal setting focuses on identifying issues patients face and establishes a framework for clinical care\nGroup Psychotherapy addresses personal safety and effective expression and management of feelings and to learn and practice interpersonal skills\nPsych-Education/Life Skills dedicated to trauma recovery, coping skills, emotional regulation and problem-solving\nExpressive Therapy identifies safe, contained expression and management of emotions using art therapy and writing','1289140698414142','https://psychinstitute.com/treatment-services/adults/adult-trauma-services/',NULL,NULL,'Verified','941516382466411','It’s easy to get the help you or a loved one needs. Our Clinical Assessment Center is available 24 hours a day, 7 days a week. Physicians, therapists, school personnel and other community and private agencies and organizations may request professional consultations for any individual whose behavior raises concern.\n\nSelf-referrals are accepted, as well as referrals from family and community members for our inpatient substance abuse treatment or mental health care programs. If you have questions about admissions, about the Clinical Assessment Center, our mental health counseling programs, please see our Frequently Asked Questions, or visit our Contact page to get in touch with us directly.\n\nPIW provides no-cost psychiatric evaluation and self assessment screening tools for depression and substance abuse.',NULL,NULL,NULL,NULL,'938568918684495,823866019660328','745214673411437',NULL,'1263089203668614','1045297656470568',NULL,NULL,NULL),(5,585908349000516,'Developmental Assessments',NULL,862675425917588,'Early Stages helps assess and identify any developmental delays in children from age 2 years, 8 months to age 5 years, 10 months. This is a program through DC Public Schools and serves any child attending DC Public Schools, being homeschooled, or not yet in school.',NULL,'http://www.eslearningcenters.com/',NULL,NULL,NULL,'941516382466411',NULL,NULL,NULL,NULL,NULL,'861067587432539','757306317490407',NULL,NULL,NULL,NULL,NULL,NULL),(6,585407675930864,'Supportive Independent Housing Program',NULL,1326157862705937,'What is MBI\'s Supportive Housing Program?\n\nMBI Supportive Independent Housing Program (SIL) is designed to support MBI consumers who already have housing and are having issues with their current housing.\n\nWhat Should I expect?\n\nMeet with MBI/SIL consumers for home visit\nEnsure that the home is in compliance with MBI housing standards\nAct as another resource between the consumer with MBI Services\nShare information with  the CSW’s and Program Administration to ensure that the consumer is receiving the best level of care and services\nAssist with training and skill building (ADL) skills with consumer\nAdvocate on behalf of the consumer (when appropriate) to ensure that their needs are being met.\nRe-evaluate and revise the housing plan with the Treatment team on a regular basis to meet the consumer’s new goals and/ changing needs\n','959978038980815','http://www.mbihs.com/what-we-offer/housing-programs',NULL,'wpinson@mbihs.com','Verified','929094559121639','Am I Eligible?\n\nAll of MBI consumers that are currently living in a residential property in Washington, DC\n\n How Do I Enroll?\n\nTo receive an initial evaluation, contact your CSW\n\nThe advantage of this program is our consumer will have an additional individual who will work with the treatment team on a permanent housing solution.\n\nFor additional information and Inquiries please contact:\n\n\n\n\nBillie Pinson /SIL Program Liaison\n\n202-639-9762 or\n\nwpinson@mbihs.com',NULL,NULL,NULL,NULL,'929037191615824,1179726198865150',NULL,'1296571710419253','868012483124236','817410769508748',NULL,NULL,NULL),(7,590149106022184,'Holly House',NULL,906742630902911,'Located in a quiet, residential neighborhood near Silver Spring, MD, Holly House is a long-term group home for eight men and women with mental illness who are at great risk of homelessness. Holly House is within easy walking distance to public transportation and stores. Holly House residents receive continuing clinical support services from Woodley House as they integrate into the community, participating in individual day programs, full or part-time jobs and volunteer programs.',NULL,'https://woodleyhouse.org/residential-care/holly-house/',NULL,NULL,'Verified','929094559121639','Referrals are accepted from the Department of Behavioral Health, Core Service Agencies, private providers, hospitals and families.\n\nResidents must be formerly homeless, be enrolled with the DC Department of Behavioral Health, and have a recommendation from their Core Service Agency to apply to Holly House. The Core Service Agency will inform them of any needed documentation that they require.\n\nBecoming a resident includes receiving meals, 24-hour residential staff supervision and support services to enable clients to achieve greater independence.\n\nPlease contact Alkita Alhanssary, Holly House Supervisor, for information about how to enter Holly House.\n',NULL,NULL,NULL,NULL,'906348724543792',NULL,'1170089516639143',NULL,NULL,NULL,NULL,NULL),(8,592511260613384,'Downtown Cluster Geriatric Day Care',NULL,900455754248217,'Day services for seniors.','984058750613797','https://www.asburyumcdc.org/',NULL,NULL,'Verified','637158405241810','Call to confirm how to access services.',NULL,NULL,NULL,NULL,'1224416978291385,931894948994087','776532681871781',NULL,NULL,'944084611081362',NULL,NULL,NULL),(9,602724412494897,'Transportation Services','Misler Center',855094084464049,'Misler Adult Day Center is able to provide critically needed transportation to many of our participants using the JCA ElderBus fleet. Each day, trained drivers who are sensitive to the needs of older adults are out in neighborhoods surrounding the Center, providing roundtrip door-to-door service to those who live within our pick up area. Our fleet of accessible buses can accommodate wheelchairs and walkers.','924628911683577','https://accessjca.org/misler-center/',NULL,'Misler@AccessJCA.org','Verified','632609508449013','For more information, to arrange a visit, or to speak with one of our social workers, please call us at 301-468-1740, or use the contact form on our website to send an email inquiry.',NULL,NULL,NULL,NULL,'1100526340352002,1090977082368403','1058170814905410',NULL,'1157835357284365,854808174954754,1032274526726429','1050035692418764',NULL,NULL,NULL),(10,549681153080082,'Know Your Rights',NULL,983721114373124,'An online resource to help educate you on your rights as a survivor of intimate partner violence.','828792720206018','https://www.dashdc.org/housing-resource-center/know-rights/',NULL,NULL,'Verified','917725171609009,929094559121639','Visit our website. If you are in an emergency, contact National Domestic Violence Hotline: 1-800-799-7233 (SAFE) or 1-800-787-3224 (TTY).',NULL,NULL,NULL,NULL,'871700855571478','900562936646293',NULL,'1212718840001878','1043474797867812',NULL,NULL,NULL),(11,563588572334023,'Ride Smart Workshops','Connect-A-Ride',855094084464049,'Ride Smart Workshops\nOffered periodically, these workshops help small groups of older adults learn to use public transportation options and otherwise navigate the National Capital Region.','924628911683577','https://accessjca.org/connect-a-ride/',NULL,'ConnectARide@AccessJCA.org','Verified','632609508449013','Registration is required for Ride Smart workshops. Call 301.738.3252 to register or for more information or email ConnectARide@AccessJCA.org',NULL,NULL,NULL,NULL,'1256462778437672','1276016050822057',NULL,'1262399029280424,854808174954754','1050035692418764',NULL,NULL,NULL),(12,565227181581504,'C.A.P. (Community Anti-violence) After School Program ',NULL,1013543362848937,'We equip, encourage and empower the emerging generation via reading tutoring, homework assistance, mentoring and discipleship development.','628637355176202','http://www.hughesmemorial.org/ministries.aspx',NULL,NULL,'Verified','789038541797078','Call or show up to the next meeting. October through May.',NULL,NULL,NULL,NULL,'905425032669080','1007276077218464',NULL,'1274396898894043,883345659611536','1190125799561725',NULL,NULL,NULL),(13,566502197729713,'Care Management',NULL,1180598613249590,'Families face new challenges as family members age. Life doesn’t come with an event planner, so Seabury care managers are there for when you and your family need help.\n\nSeabury care managers guide older adults and their families through the process of planning for long-term needs. Seabury’s Care Management team is dedicated to improving the quality of life as well as maintaining independence for their clients.\n\nCare Management provides counsel to families on key issues that could include elder law attorneys, home care providers, senior living communities, physicians, rehabilitation centers, mental health providers, financial planners, and others to promote a positive aging experience.','1183011241112934','https://www.seaburyresources.org/caremanagement',NULL,'info@seaburyresources.org','Verified','637158405241810','Call to apply for services.',NULL,NULL,NULL,NULL,'583858667444622','1176087327224268',NULL,'854808174954754','743160673924882',NULL,NULL,NULL),(14,567631577251008,'Food Pantry',NULL,1107997028998056,'Offers a food pantry for people in need of food.','1112335428289741',NULL,NULL,NULL,'Verified','832990803111047','You must have a referral from social services or a case manager that is faxed to us. Then you will set up an appointment by phone.',NULL,NULL,NULL,NULL,'750948313560406,872643474789883,1118383435935760','675697250328431',NULL,'1244888069012632','826486612406662',NULL,NULL,NULL),(15,569770427910971,'Information and Referral',NULL,964889233755760,'DCCIL provides disability-specific information and referral to ensure people with disabilities have access to information needed to achieve or maintain independence in their communities.','875107767611380,608497828316445,1282997809596504','https://dccil.org/what-we-do/our-core-services/',NULL,NULL,'Verified','637158405241810','Call for intake. Services are provided to residents.',NULL,NULL,NULL,NULL,'624495395805685,1009972720361462,857576973728938,1222403878723639,1154182835844763','1180459083504396',NULL,'1322383076619129','825051851809001,904316078691110,1313889595660179',NULL,NULL,NULL),(16,573528188325499,'Homelessness Prevention',NULL,1195870505334629,'We work with families at risk of losing their housing to prevent homelessness. We help stabilize families through services, financial assistance, and connection to mainstream resources so that they do not need to enter the shelter system.\n\nCommunity of Hope\'s Homelessness Prevention Program works to stabilize families at risk of becoming homeless through specialized services and connection to other community resources.\n\nAll families must be referred from the Virginia Williams Family Resource Center. Clients are usually living temporarily with a friend or relative, and have often moved frequently. Clients find themselves on the brink of homelessness and come seeking any assistance available to stay stably housed.\n\nCommunity of Hope helps prevent clients from losing their homes and entering the shelter system through effective targeting of resources. We recognize that different families require different solutions.\n\nOur case managers serve as supporters and advocates for clients – helping them think through their goals and create detailed plans with a realistic timeline. These wide-ranging supportive services include:\n\nComprehensive case management\nMediation services\nFinancial assistance\nBudgeting and financial management\nRental and utility assistance\nReferral for legal services\nThe Homelessness Prevention Program, through expert case management and mediation services, helps families stay stably housed and allows them to remain connected to their natural systems of family and community.','688457108968845','https://www.communityofhopedc.org/housing/homelessness-prevention',NULL,NULL,NULL,'929094559121639','Access to these services comes through referrals from the Virginia Williams Family Resource Center, the central intake for DC’s coordinated homelessness assistance system for families with children.\n\nVisit this page for exact info: https://www.communityofhopedc.org/housing/how-can-i-access-services',NULL,NULL,NULL,NULL,'958866684536217,612480373273711','656180073780206,1268157148852129',NULL,'966756126649195','1255819816076094',NULL,NULL,NULL),(17,577390293811162,'Walk-In Pregnancy Tests',NULL,662579547117824,'Walk-in pregnancy tests. Under 21: $2, Over 21: $5.','901362892558172','http://www.healthybabiesproject.org/contact/',NULL,NULL,'Verified','941516382466411','Walk in.',NULL,NULL,NULL,NULL,'645677274573700','968633845824283',NULL,NULL,'1244665120116979',NULL,NULL,NULL),(18,577584068562238,'Change Your Locks','Keep Safe Housing',983721114373124,'If you have a protection order you are legally entitled to change your locks even if your abuser is on the lease. Use our sample letter (on our website) to request a lock change from your landlord.\nIf your abuser is not on the lease you have the legal right to request a lock change from your landlord at any time. Your landlord or property manager is responsible for changing the locks within 5 business days of the request. Use this sample letter (on our website) to request lock changes, and this letter if your landlord has taken more than 5 business days to change the locks.','828792720206018','https://www.dashdc.org/housing-resource-center/maintain-housing/',NULL,NULL,'Verified','917725171609009','Visit our website for sample letters. You can also visit our walk-in clinic for help. If you are in an emergency, contact National Domestic Violence Hotline: 1-800-799-7233 (SAFE) or 1-800-787-3224 (TTY).',NULL,NULL,NULL,NULL,'871700855571478','900562936646293',NULL,'777455803391753,1256136937607288,1212718840001878','1043474797867812',NULL,NULL,NULL),(19,579430499829276,'Counseling Services',NULL,769893937425938,'Grief counseling is often about finding new solutions to problems of living, or about changing relationships in the context of loss. Our trained, experienced therapists accompany adults and families as they readjust to a world that has drastically changed.','1108850981657232,1166799153375505','https://www.wendtcenter.org/hopes-crime-victim-services/',NULL,NULL,'Verified',NULL,'To become a client, please call: 202.204.5021',NULL,NULL,NULL,NULL,'714080995184693','789043683491652',NULL,NULL,'1231165117410316,622488765022102',NULL,NULL,NULL),(20,576262745925884,'Youth Development',NULL,931366816861797,'The Perry Center, Inc. Youth Development Program provides a continuum of services to develop and educate youth from ages 3 to 18.','1098817401970888','https://www.perryschool.org/services',NULL,NULL,'Verified','789038541797078','Call or walk in.',NULL,NULL,NULL,NULL,'763139241210372','802405581688320',NULL,'743601753506222','896277574789110',NULL,NULL,NULL),(21,596474071852609,'Adult Education',NULL,889845893875767,'Academy of Hope provides a variety of programs and services free of charge to meet the needs of our adult learners. Our programs focus on the following:\n\n- Adult Basic Education (ABE)\n- General Educational Development (GED)\n- National External Diploma Program (NEDP)\n- Gateway to College and Careers\n- Career Academies in the high-demand sectors of hospitality, healthcare and office administration\n\nWe offer additional services to assist our adult learners in attaining their educational goals, including:\n\n- Computer Training\n- Career Assessment and Planning\n\nAcademy of Hope also provides a range of student support services to help break down barriers that may stand in the way of a student meeting his or her goals.','873273529728080,909942619088980','https://aohdc.org/what-we-do/',NULL,NULL,'Verified','789038541797078','Apply in person on campus, call to register, or apply online.',NULL,NULL,NULL,NULL,'1022412281964551,972949389893061,790733365231464','855840227548974,777701460078348,1281999112214963',NULL,'866965462945330,868012483124236','1152392105754818,915998507127869',NULL,NULL,NULL),(22,603778865328891,'Medstar Georgetown University Hospital',NULL,1198455162499731,NULL,NULL,'www.medstargeorgetown.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(23,607885233270947,'Disaster Relief',NULL,1004391421304549,'ACSGW stands ready to help our community through any disaster. Unfortunately, it is hard to predict just what misfortune may impact our lives. Will it be a violent storm, a devastating home fire or some other horrid event that strikes our community? Although such incidents are hard to predict, ACSGW is prepared to offer assistance in the form of case management, food, clothing, household goods and other support. Please think of ACSGW when disaster strikes','950009053464384','https://www.acsgw.org/disasters.html',NULL,NULL,'Verified','878986697513222','If there has been some form of natural disaster, contact ACSGW for help. If you are in an emergency, call 911.',NULL,NULL,NULL,NULL,'937322777502476','1115292082523782',NULL,NULL,'877682236637760',NULL,NULL,NULL),(24,610489256524292,'Home-delivered Meals',NULL,1180598613249590,'Through Seabury’s home delivered meal program, older adults in Washington, D.C. who are unable to travel to shop for food or prepare food themselves have meals delivered to their homes.  ','1183011241112934','https://www.seaburyresources.org/homdeliveredmeals',NULL,'info@seaburyresources.org','Verified','832990803111047','Call to apply for services.',NULL,NULL,NULL,NULL,'1215962717214630','1176087327224268',NULL,'854808174954754','743160673924882',NULL,NULL,NULL),(25,561778285748604,'Nutrition Counseling',NULL,1219589148672769,'At Food & Friends, we consider nutrition to be a vital part of the treatment for our clients. Our community dietitians are available to provide personalized nutrition counseling and meal plans to address each client’s nutritional needs.\n\nIn addition, within the community, we provide the following services, all of which are free of charge:\n\nOn-site cooking classes\nEducational handouts on increasing protein and calorie intake, food safety and more\nOff-site group presentations on nutrition related to HIV/AIDS, cancer and other life-challenging illnesses','857875532631251','https://foodandfriends.org/about-us/#services-we-provide',NULL,NULL,'Verified','941516382466411',NULL,NULL,NULL,NULL,NULL,'1239494728678928,1133561368089400','857395816743172,884617333624034',NULL,NULL,'1251720034767684',NULL,NULL,NULL),(26,573931060003252,'Project ACTION',NULL,744812603775568,'Project ACTION! is a regional coalition of self-advocates and self-advocacy groups from the District of Columbia, Maryland and Virginia.  ACTION! stands for Advocacy, Change, Training, Information, Organizing and Networking.  \n\nPeople with disabilities have many issues and concerns in common, including transportation, health care, jobs, safety, adult education, and others issues.  After a popular adult education program was threatened with closing without notice, students gathered together to protest the budget cuts and quickly learned that there is strength in numbers!   They learned they can accomplish more together than alone.  \n\nThis strong community of self-advocates shares personal experiences of living with developmental disabilities – training and encouraging their peers to speak out on issues important to them.  The groups motto, “Nothing About Us without Us,” is one Quality Trust fully endorses.  Many members have joined boards, committees, work groups, and commissions that make decisions that affect their lives.  Self-advocates meet to learn about their rights, update each other on important issues and events, practice speaking up and sharing their opinions, learn how to lead meetings, set priorities, provide and receive training and celebrate their achievements. ','1185969381076176','https://www.dcqualitytrust.org/families/join-project-action/',NULL,'pholton@dcqualitytrust.org','Verified','637158405241810','Project ACTION! meetings are held on Saturdays at Kennedy Institute of Catholic Charities, located at 801 Buchanan Street, NE, Washington, DC  20017.  Refreshments are provided. \n\nFor more information about Project ACTION! email Phyllis Holton or call her at 202-448-1458 (direct).',NULL,NULL,NULL,NULL,'1294732165044482',NULL,'659954535630939','1292849277583603,891868766081123','1262646425320757',NULL,NULL,NULL),(27,577558646630251,'SOME: BEHAVIORAL HEALTH SERVICES',NULL,908756987447173,'Encourages individuals with substance abuse issues to seek help. Assesses the need of the client during the initial intake stage, where clients work with an addiction counselor to determine the program best suited to their needs.','923653351035648','http://some.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'962036505121926',NULL,NULL,NULL),(28,574661829122399,'Crossing Place',NULL,906742630902911,'Located in Woodley Park, Crossing Place is an eight-bed emergency shelter and crisis stabilization for people experiencing acute mental illness. One of only two private crisis homes in Washington, DC, its therapeutic atmosphere supports clients’ stabilization and recovery. Crossing Place offers short-term (2-14 days) intensive support services at approximately one-third the cost of hospitalization. Crossing Place is staffed 24 hours a day, seven days a week with professional residential crisis specialists who work with the Department of Behavioral Health, medical and psychiatric providers and case managers to support residents. ',NULL,'https://woodleyhouse.org/residential-care/crossing-place/',NULL,NULL,'Verified','929094559121639,878986697513222','Call screening line (202) 830-3517 to begin application. To be eligible, you must be\n- Age 18 or older\n- Experiencing a psychiatric crisis\n- Must be able to maintain safety of self or others\n- Must not be in need of medical detoxification or other inpatient care',NULL,NULL,NULL,NULL,'607359446784933',NULL,NULL,'866965462945330',NULL,NULL,NULL,NULL),(29,576988108950338,'Emergency Assistance Program',NULL,1187372282686349,'Offers emergency rent, mortgage and utility assistance to residents of Ward 6. This is only offered on a case by case basis for participants.','1209121324412172','http://fathermckennacenter.org',NULL,'info@fathermckennacenter.org','Verified','878986697513222,1077790582995406','This is only offered on a case by case basis for participants. Contact your case manager for more information.',NULL,NULL,NULL,NULL,'1123859846194392','1107831955306053',NULL,NULL,'645829762063748',NULL,NULL,NULL),(30,580719808472057,'Camp Bennet',NULL,726173106231202,'Located on 220 scenic acres in beautiful Brookeville, Maryland, Camp Bennett serves as a residential summer camp for financially underprivileged children from all over the Washington, DC, area. Every summer for seven fun-filled weeks, Christian counselors and volunteers lead hundreds of children ages 8-12 through life-changing Bible programs. Children who have never been away from the city streets can experience a week in the country and make new life-long friends.','1135122975308953','http://www.campbennett.org/',NULL,NULL,'Verified','637158405241810','Call for more information.',NULL,NULL,NULL,NULL,'569071299085270',NULL,NULL,'986272445118075','1175347461652522',NULL,NULL,NULL),(31,580120354830667,'Free After School Program',NULL,931366816861797,'Perry School Community Services Center provides a free After-School and Summer Camp program for children in the Washington, D.C. metropolitan area, and particularly Wards 5 & 6.More information on the most recent registration period and the program is contacting the Perry Center at (202) 312-7140 or by emailing Activities and programming for children include:\n\nDeveloping nutrition skills through cooking classes;\nArt projects with mixed media and crafts;\nAnti-bullying and conflict resolution programs;\nHomework assistance and cultural enrichment opportunities;','1098817401970888','https://www.perryschool.org/youth-development',NULL,NULL,'Verified','789038541797078','Call or walk in.',NULL,NULL,NULL,NULL,'763139241210372',NULL,NULL,'1274396898894043,883345659611536','896277574789110',NULL,NULL,NULL),(32,586827752329383,'Genoa',NULL,802521051916688,'Genoa, a QoL Healthcare Company, is a leading pharmacy serving the behavioral health and addiction treatment community for more than 15 years. Genoa is an on-site, full-service pharmacy located in the Community Connections main office waiting room. Genoa takes care of many of the medication needs of our clients, including prescriptions written by psychiatrists, primary care providers, or other specialty prescribers, as well as working with treatment teams to coordinate care.','1044869288351593','http://www.communityconnectionsdc.org/our-services/integrated-care',NULL,NULL,NULL,'941516382466411','Call or walk in for more information.',NULL,NULL,NULL,NULL,'1125537818767812','1060463085599565',NULL,'868012483124236,1200033126219686,866965462945330,804517213435343,937643355135162,1227486019167060','872487510282336',NULL,NULL,NULL),(33,586062612640149,'Maternal Mental Health',NULL,840733417398800,'If you are pregnant or preparing for the addition of a new baby, adjusting to life with a new child, had a baby in the past year, or experienced a loss in pregnancy, Mary’s Center is here for you.  \n\nSignificant life changes like these can cause tremendous amounts of stress and we want you to know you’re not alone. Reach out to Mary’s Center if you are experiencing:  \n\nDifficulty adjusting to a significant life change \nDifficulty with your emotions following a difficult or traumatic birth \nDifficulty bonding with your baby \nFeelings of irritability, sadness, or depression \nPerinatal grief/loss \nScary, intrusive thoughts \nIf you’re struggling with something you don’t see listed above, we strongly encourage you to reach out to us for additional support.\n\nOur Maternal Mental Health program is dedicated to support pregnant and postpartum women, adoptive parents, and their families through a variety of resources and services including:  \n\nCare coordination \nPhone outreach including a brief assessment, educational information, and ways to connect to additional care \nSupport and education, including free online support groups held in  English  and  Spanish \nTherapy and psychiatry  ','1282458965799792,964869638930274,629348329513757','https://www.maryscenter.org/behavioral-health/other-specialties-and-services/maternal-mental-health/',NULL,NULL,NULL,'941516382466411','Mary’s Center is ready to partner with you on your health journey. Don’t hesitate to reach out to us using the information below:  \n\nTo an appointment and indicate your interest in the Maternal Mental Health program, call (202) 846-8053 x 2797\nTo reach the Maternal Mental Health Program Manager, call (202) 545-2061',NULL,NULL,NULL,NULL,'1301804131597006,655687905213046,1253449137217297','1134877289644712,827996522503929,601427652072887',NULL,NULL,'903265014608550,962742212670581,732086812000340',NULL,NULL,NULL),(34,591961230618386,'Child Development Associate Job Training',NULL,840733417398800,'Train for a career working with young children! Briya Public Charter School offers a Child Development Associate (CDA) training program. The 10-month program prepares you for a career as an early childhood teacher or assistant teacher. During training, students learn educational theory and best practices while also getting hands-on teaching experience with children in a childcare or school setting.  \n\nUpon completion of the Child Development Associate training program, you will be prepared to take the national CDA exam and submit a work portfolio for certification review. You will also be certified in CPR/First Aid and ready to begin your new career! \n\nTo qualify for the CDA training, you must:  \nLive in Washington, DC \nBe at least 18 years old \nPass the entrance exam ','629348329513757','https://www.maryscenter.org/education/job-training/child-development-associate/',NULL,NULL,NULL,'789038541797078','Program Details: \nClasses are held Monday-Thursday; 6:00-9:00 pm (English or Spanish) or 12:30-3:00 pm  (Spanish only) at Mary’s Center’s Ontario Road site \n480 hours of practicum experience is required and arranged through Briya  \nRegister for the course or call (202) 232-7777 for more information.  \n\nMary’s Center and Briya Public Charter School work together to provide health care, social services, and education for residents of D.C. ',NULL,NULL,NULL,NULL,'1307595059042459',NULL,NULL,'868012483124236,1263089203668614','732086812000340',NULL,NULL,NULL),(35,597642797256208,'Family Rapid Re-Housing',NULL,1245236106154921,'Everyone Home DC’s Family Rapid Re-Housing Program provides short-term rental and utility assistance to families experiencing homelessness in Washington, DC. Families work with Rapid Re-Housing case managers to set goals for greater housing and economic self-sufficiency.\n\nEveryone Home DC’s Family Rapid Re-Housing team and partners provide support through housing stability focused case management, employment preparation services, affordable housing search support, transportation assistance, mental health services, educational or vocational training, and related services to help make the transition to self-sufficient living possible.\n\nEveryone Home DC’s Family Rapid Re-Housing serves 55 families in scattered site apartments throughout the District.','936934819762396','https://everyonehomedc.org/programs/family-rapid-re-housing/',NULL,NULL,'Verified','929094559121639','Referrals for the Family Rapid Re-Housing Program come from The Community Partnership for the Prevention of Homelessness.\n\nIf you know a family encountering a housing crisis that they cannot resolve on their own, they can access homelessness prevention advice and program assistance referrals exclusively through the Virginia Williams Family Resource Center (920 Rhode Island Ave NE, Washington, DC 20018 | (202)-526-0017), the central intake for DC’s coordinated homelessness assistance system for families.',NULL,NULL,NULL,NULL,'735608882009072','832596400468443,1170433044969408',NULL,'877243931325915,1292849277583603','811198505758894',NULL,NULL,NULL),(36,598601043584489,'PrEP Program for HIV Prevention',NULL,851305007018661,'The PrEP Clinic at Andromeda offers comprehensive sexual health services, including pre-exposure prophylaxis or PrEP, to persons at risk for HIV/AIDS. The PrEP Clinic was created to provide the DC metropolitan population with easy access to healthcare providers who support the utilization of PrEP for HIV prevention.\n\nThe PrEP Clinic is housed at Andromeda, a non-profit health services organization that has been in operation for more than 48 years. Andromeda provides HIV/AIDS treatment services, substance use treatment, primary care and mental health services, nutrition counseling, and health promotion and education. Andromeda is a multicultural organization that understands and supports the needs of all persons, including: LGBT persons, substance users, sex workers, and immigrant populations. Our staff will work with you to address your needs and develop strategies to support your health.','841307455613093','http://andromedahealth.org/our-services/prep-program-for-hiv-prevention/',NULL,NULL,'Verified','941516382466411','Call for appointment',NULL,NULL,NULL,NULL,'860598871725625','930574528621838',NULL,NULL,'1224638786118966',NULL,NULL,NULL),(37,600624054710125,'Tools for Survivors',NULL,809193297555798,'This webpage offers guided information about various concerns related to sexual assault and rape. Please visit this website to learn more.','728145736382163','http://dcrcc.org/counseling/no-straight-path/tools-for-survivors/',NULL,'dcrcc@dcrcc.org','Verified','637158405241810','Visit website.\n',NULL,NULL,NULL,NULL,'819440187923797',NULL,NULL,NULL,'782477248679291',NULL,NULL,NULL),(38,605724148465394,'Model Cities Senior Wellness Center',NULL,1180598613249590,'Model Cities Senior Wellness Center offers a variety of comprehensive programs, classes and activities designed to educate and promote active and healthy aging for older adults in DC. Free for DC residents 60 years of age and older. Come join us to learn, socialize, and engage in some fun healthy activities!\n','1261619093567791','https://www.seaburyresources.org/model-cities-senior-wellness-center',NULL,'info@seaburyresources.org','Verified','637158405241810,789038541797078','Call to apply for services.',NULL,NULL,NULL,NULL,'1117976446223168','1176087327224268',NULL,'854808174954754','708859571613221',NULL,NULL,NULL),(39,607894816484467,'Civics-focused English Classes',NULL,1116810105858975,'The ESL classes complement the civics classes by providing practice in oral, written and reading English in order to enable candidates to pass the English portion of the citizenship exam. Class activities include conversation practice with outside groups of volunteers who come every other week to talk to our students and help them improve oral comprehension and speaking skills. Classes are offered Wednesdays, 6-8 PM and Saturdays, 12:30-2:15 PM.','547920365968268','http://carecendc.org/direct-services/citizenship/',NULL,'info@carecendc.org','Verified','917725171609009,789038541797078','Walk in or call for services. Some services are by appointment only. ',NULL,NULL,NULL,NULL,'1158694379718344','1184118914852207,568535831537843',NULL,'1340162113833071,1295679372454826','842193303927915',NULL,NULL,NULL),(40,611590713528319,'Sustainability',NULL,930909694635560,'A financial assistance program for families including:\n- Direct financial assistance\n- Budgeting classes\n- Tax filing','906651913636867','https://lortonaction.org/youth-programs/',NULL,NULL,'Verified','1077790582995406','Call to register. Walk in during registration hours.',NULL,NULL,NULL,NULL,'906987068756792','1229690477859335,892622133517119,876311376686616,600743088526043,1256920432035968',NULL,'1292849277583603','1276944443091304',NULL,NULL,NULL),(41,612611049847328,'Hypothermia Program',NULL,1187372282686349,'For more than 20 years The Father McKenna Center has responded to the needs of men without a home for a safe and predictable environment during the cold nights of winter. While DC has a Hypothermia Hotline, many of our guests do not feel safe in emergency shelter environments, and there is not support for their transition through homelessness, only maintenance of their status quo.\n\nOur Hypothermia/Transition Program is application based, and each applicant meets with his Case Manager to ensure commitment to the goals and structure of the Program. Men are approved for participation in the Program based on an assessment of their readiness to move toward the next step on their journey out of homelessness, whether that step is a job, a temporary or permanent housing situation, or stability on the road to sobriety or mental health.\n\nWe open on November 1st and operate every night until March 31. The Hypothermia/Transition Program offers the men shelter for the night, a shower, a home-cooked evening meal, and time to work on their personal plan or to socialize.\n\nThe Program has two exceptional characteristics: it builds a cohort and it reintroduces family interactions.\n\nEach year we provide shelter for a consistent group of 18-20 men. This is not a drop-in program, rather the same men join us each night until they find stable housing or reunite with their community. This opportunity to build a bond of trust in a predictable environment cannot be underestimated. The state of homelessness is characterized by chaos and, too often, by fear. We believe the Hypothermia/Transition Program offers a place of not just physical shelter. It also provides a mental and emotional place of safety that allows each man to focus on moving his life forward.\n\nThe success of the Hypothermia/Transition Program is made possible by the consistent and loving support of the Gonzaga Mothers’ Club (GMC). Each season, the GMC and their families commit to cooking and serving the evening meal for 20 men for over 150 nights! Even more remarkable, this is not simply a drop-off service. The meals are brought to the Center by families, who then stay to serve and eat with the men. The act of breaking bread together, sharing conversation, and engaging as brothers and sisters in Christ breaks down barriers and allows everyone at the tables to see each other as individuals. This removal of the us/them divide is a tremendous gift for both our guests and our volunteers.','1209121324412172','https://fathermckennacenter.org/what-we-do/hypothermia-program/',NULL,'info@fathermckennacenter.org','Verified','929094559121639','Have to be approved in an application process. Call or walk in for more information.',NULL,NULL,NULL,NULL,'1123859846194392','1063950960307708',NULL,'625195015492370,1263089203668614','645829762063748',NULL,NULL,NULL),(42,606631780927132,'English Classes',NULL,840733417398800,'Free English Classes for DC Parents\nDC parents can take advantage of free English classes through our trusted partner, Briya Public Charter School! Course details are below: \n\nAll levels are welcome – beginner to advanced  \nAdult students must live in DC and have a child/children ages 0-12. \nParents and young children learn together; while parents learn English and other skills, young children attend the Briya early childhood program \nProgram has open enrollment and weekly registrations throughout the year. \nClasses are Monday-Friday; morning session 9:00-11:30 am; afternoon session 12:30-3:00 pm \nTo register, please  complete our online form  or call (202) 232-7777\nYou may bring your young children (up to age 5) to school with you ','629348329513757','https://www.maryscenter.org/education/english-classes/',NULL,NULL,NULL,'789038541797078','All levels are welcome – beginner to advanced  \nAdult students must live in DC and have a child/children ages 0-12. \nParents and young children learn together; while parents learn English and other skills, young children attend the Briya early childhood program \nProgram has open enrollment and weekly registrations throughout the year. \nClasses are Monday-Friday; morning session 9:00-11:30 am; afternoon session 12:30-3:00 pm \nTo register, please  complete our online form  or call (202) 232-7777\nYou may bring your young children (up to age 5) to school with you ',NULL,NULL,NULL,NULL,'1307595059042459',NULL,NULL,'915486946336080','732086812000340',NULL,NULL,NULL),(43,627629263527494,'Homebuyer Support',NULL,574964812525513,'Offers support to people looking to buy a home. Training sessions are available that go over the various aspects of buying a home. Info is given on Affordable Dwelling Units as well. ','947853021041099','http://housingetc.org/homebuyers/',NULL,NULL,'Verified','929094559121639,1077790582995406','Call our main number (202-667-7006) and ask about scheduling a counseling appointment or attending a workshop. If you decide to meet with a housing counselor then you might be asked to ',NULL,NULL,NULL,NULL,'1178055279307047','1172938193660785,1238194930050189',NULL,NULL,'1138176448388213',NULL,NULL,NULL),(44,629844217460402,'CNCS: AMERICORPS: NCCC',NULL,647276391431213,'More than 1,000 young people, ages 18-24,serve on teams and address environmental projects,diaster preparedness and response,education, public safety, and other unmet human needs.','1201917781354008','http://nationalservice.gov',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'651786461883664',NULL,NULL,NULL),(45,570068555050262,'Clothing Closet ','Labor of Love Human Service Center',877366768823409,'Our closet provides casual and professional wear for men and women. Donations are accepted year-round.','848686188808388','https://www.communityoutreachcdc.org/labor-of-love',NULL,NULL,'Verified','911225335803318','Call or walk in.',NULL,NULL,NULL,NULL,'1011118711605616','542843689156312',NULL,'1194535092428324','764105236981511',NULL,NULL,NULL),(46,595263959299318,'MARSHALL HEIGHTS COMMUNITY DEVELOPMENT ORGANIZATION',NULL,844234717265246,'Offers housing assistance through a Homebuyers Club, HPAP and Housing Counseling programs. Also provides business, economic and workforce development programs. Specializes in assessment, job development and placement, education and vocational skills training','1116781625364190','http://MHCDO.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'802890951138045',NULL,NULL,NULL),(47,599402007780126,'Assertive Community Treatment (ACT)',NULL,802521051916688,'The Assertive Community Treatment (ACT) teams provide comprehensive, community-based, psychiatric treatment, rehabilitation, and support to persons with serious and persistent mental illness. ACT clients often have co-occurring problems with addiction, homelessness, criminal justice involvement, physical illness, and violent victimization. ACT teams embrace the nationally established Evidence Based Practice Model for ACT and achieve a high level of fidelity to the model. Teams are composed of a psychiatrist, nurse, licensed team supervisor, a peer support specialist, and rehabilitation support staff. Staff may develop sub-specialties in group services, substance abuse treatment, forensic services, parenting interventions, and vocational rehabilitation. ACT teams have small caseloads and work as a tight knit interdisciplinary unit to create opportunities for growth and recovery.','1044869288351593','http://www.communityconnectionsdc.org/our-services/behavioral-health',NULL,NULL,NULL,'637158405241810,941516382466411','Call or walk in for more information.',NULL,NULL,NULL,NULL,'1125537818767812','1060463085599565',NULL,'868012483124236,1200033126219686,866965462945330,804517213435343,937643355135162,1227486019167060','872487510282336',NULL,NULL,NULL),(48,623011864568715,'Third Street',NULL,904943826975100,NULL,'1307285743296604','http://www.thirdstreet.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'770770456719894',NULL,NULL,NULL),(49,627323919512057,'Housing & Community Development',NULL,1140996665222837,'The Housing & Community Development Department (HCD) spearheads the integration of place-based and people-based strategies focusing on systemic change within housing, transportation, and community development on the local, state, and national level. The HCD houses the Fair Development Coalition, a grassroots partnership; housing advocacy & development; the Langley Park Crime Prevention Collaborative; and the Housing Matters Campaign.  Our goal is to achieve transformational change through strategic planning, coalition building, effective advocacy, and implementation.','1091435530922324','https://wearecasa.org/programs/410/',NULL,NULL,'Verified','929094559121639','For more information please contact Government & Strategic Relations Specialist: Julio Murillo – jmurillo@wearecasa.org',NULL,NULL,NULL,NULL,'1184988992731200',NULL,'1095190489836587',NULL,'836261919910340',NULL,NULL,NULL),(50,633712201049185,'Wellness Recovery Action Program',NULL,883186000200856,'A peer led self-advocacy program designed to promote peer support and develop a tool-box for building resilience. These groups offer adult and adolescent peers.','920364967013405,1054369210651155','http://hillcrest-dc.org/services/adult-services/',NULL,'info@hillcrest-dc.org','Verified','637158405241810,941516382466411','Call or walk-in for services.',NULL,NULL,NULL,NULL,'1097440010596926',NULL,NULL,'1263089203668614','646846673243288,1261416234116596',NULL,NULL,NULL),(51,633702102837581,'Shelter & Housing',NULL,682552065545256,'With 92 beds, SERVE Family Shelter is Northern Virginia’s largest family homeless shelter. On average, more than 40 percent of shelter guests are children. Shelter guests stay an average of 36 days, and during that time, work with a case manager who helps connect them with the right tools, knowledge and resources for lasting well-being and self-sufficiency.','764854375292129','https://www.nvfs.org/our-services/homelessness-housing/serve-campus/',NULL,NULL,'Verified','929094559121639','Please call to confirm capacity.',NULL,NULL,NULL,NULL,'837377238916897,964860483808020',NULL,'645633521716641','877243931325915,1292849277583603','1341470966230086',NULL,NULL,NULL),(52,636733000958441,'DC Prevention Center Wards 1-2',NULL,1323195974089796,'LAYC’s hosts the DC Prevention Center Wards 1 & 2 (DCPC), an initiative of the DC Department of Behavioral Health (DBH), serving as a dynamic hub that engages, supports, and helps connect the many community elements that are needed for promoting healthy children, youth, and families as well as a drug-free District of Columbia. The theme of the DCPC: “Strong Communities…It’s About Youth, Families, and Caring Adults.”\n\nThe DCPC is designed to strengthen and mobilize communities to prevent substance abuse amongst youth in Wards 1 and 2 by disseminating education and increasing awareness about alcohol, tobacco, and other drugs; identifying community leaders and building community prevention networks to prevent substance abuse in their communities; facilitating Community Conversations and coordinating community forums to strengthen community capacity and address priority risk and protective factors by implementing evidence-based strategies; and providing training and technical assistance for community prevention networks. All of the strategies implemented by the DCPC are based on Substance Abuse and Mental Health Services Administration’s (SAMHSA) Strategic Prevention Framework (SPF).\n','1159564548417950','http://www.layc-dc.org/what-we-do/health-wellness/dc-prevention-center-wards/',NULL,NULL,'Verified','637158405241810,789038541797078','Call or email for more information.',NULL,NULL,NULL,NULL,'1256499247956610','920999838182205,1016645181977967','1278696466858509','1295679372454826','1288365969354186',NULL,NULL,NULL),(53,580520440912412,'Infectious Disease',NULL,840733417398800,'Mary’s Center providers are highly-trained and equipped to treat patients with infectious diseases such as HIV, Hepatitis, Tuberculosis, sexually transmitted infections, and many others. Our Infectious Disease team will work with you to identify, manage, and treat your diagnosis with the utmost care. Mary’s Center provides quality care for a variety of infectious diseases including:  \n\nBloodstream, bone, and joint infections \nComplicated urinary tract infections \nFungal and skin infections \nHIV/AIDS  \nLyme disease \nMalaria and other tropical diseases \nMeningitis \nSexually transmitted infections \nStaphylococcus aureus infections, including MRSA \nWhile many infectious diseases can be prevented by vaccines, frequent and thorough hand-washing also is one of the most effective ways to protect your health, and always talk to your healthcare provider before any international travel. \n','1282458965799792,964869638930274,629348329513757','https://www.maryscenter.org/medical/other-specialties-and-services/infectious-disease/',NULL,NULL,NULL,'941516382466411','Call to make an appointment. We accept most insurance plans including Medicaid and Medicare. If you don’t have health insurance, we’ll help you apply for public benefits or provide care at a discount. Comprehensive list of insurances are available on our website.',NULL,NULL,NULL,NULL,'1301804131597006,1263593198567823,603473645503739','1166531381919312,1070408158016466,575613458279114,973584384940208,669960004909347',NULL,NULL,'903265014608550,962742212670581,732086812000340',NULL,NULL,NULL),(54,581022793280171,'Support for People Living with HIV/AIDS',NULL,574964812525513,'HCS administers the Metropolitan Housing Access Program (MHAP), the centralized source for housing services and housing information for persons living with HIV/AIDS (PLWHA) in the District of Columbia, Prince George’s County, MD and Charles County, MD. ','947853021041099','http://housingetc.org/metropolitan-housing-access-program-mahp/',NULL,NULL,'Verified','929094559121639,1077790582995406','MHAP services differ depending on where you live. Visit website to find out which MHAP services are available in your jurisdiction:',NULL,NULL,NULL,NULL,'1178055279307047','1172938193660785,1238194930050189',NULL,'780785826421817','1138176448388213',NULL,NULL,NULL),(55,588693422814528,'The Career Gateway!',NULL,855094084464049,'The Career Gateway! offers intensive training, take-home materials, a long-term mentor and individual attention for mid-level managers and other professionals who are seeking employment at age 50+.','924628911683577','https://accessjca.org/career-gateway/',NULL,NULL,'Verified','970915508638448','Registration for this five-day workshop is just $75 thanks to generous funding from Montgomery County Aging and Disability Services and the Morris and Gwendolyn Cafritz Foundation. Call to apply.',NULL,NULL,NULL,NULL,'1100526340352002,1090977082368403','1276016050822057',NULL,'854808174954754,1114978823107611,1178794928615970','1050035692418764',NULL,NULL,NULL),(56,596938254485583,'Inpatient Detoxification Program',NULL,1265431689708141,'Our inpatient detoxification program is medically supervised for individuals with alcohol and drug addiction. This short-term substance abuse rehabilitation program addresses medical and psychiatric factors associated with dependency. After completing our inpatient substance abuse treatment program, our staff will help the patient find additional mental health services in DC, or the surrounding area, to continue their recovery.','1289140698414142','https://psychinstitute.com/treatment-services/adults/adult-detoxification-program/',NULL,NULL,'Verified','941516382466411','It’s easy to get the help you or a loved one needs. Our Clinical Assessment Center is available 24 hours a day, 7 days a week. Physicians, therapists, school personnel and other community and private agencies and organizations may request professional consultations for any individual whose behavior raises concern.\n\nSelf-referrals are accepted, as well as referrals from family and community members for our inpatient substance abuse treatment or mental health care programs. If you have questions about admissions, about the Clinical Assessment Center, our mental health counseling programs, please see our Frequently Asked Questions, or visit our Contact page to get in touch with us directly.\n\nPIW provides no-cost psychiatric evaluation and self assessment screening tools for depression and substance abuse.',NULL,NULL,NULL,NULL,'938568918684495,823866019660328','745214673411437',NULL,'1263089203668614','1045297656470568',NULL,NULL,NULL),(57,595461104582359,'Workforce Development',NULL,692112692154000,'Throughout our many years of service, A Wider Circle has seen far too few people rise out of poverty. Those who have reached independence did so, in large part, because they got jobs and had the support of others. Our Workforce Development Program is a holistic, intensive, and highly personalized approach to preparing adults to enter the workforce and advance in their careers. As with all our efforts to end poverty, our workforce readiness programming is rooted in the power of connections. Partnerships with community employers are key to connecting job seekers with jobs and area businesses with excellent staff members.\n\nBoot Camps and Workshops\n\nDSC_0242 cropOur intensive, 40-hour Boot Camp combines career planning with the “soft skills” that employers seek. Topics include goal setting, conflict resolution, and phone etiquette, as well as hands-on support and practice with resume writing, cover letters, and interviewing. Following the Boot Camp, each job seeker is paired with a job coach from the community.\n\nBoot Camp workshops are held six times a year at A Wider Circle’s Professional Development Center\n\nFor job seekers who cannot attend our Boot Camp (and for Boot Camp graduates who would like a refresher), we offer workshops and one-to-one job search assistance appointments during which participants get personalized attention from volunteers.\n\n \n\nProfessional Clothing\n\njohnA Wider Circle’s Professional Development Center – through which we serve more than 2,000 individuals each year – has a showroom of professional attire and accessories that is… better than Bloomingdale’s and nicer than Nordstrom.\n\nAnyone in need of professional attire and accessories is welcome, regardless of whether or not they are enrolled in our classes. Each client is scheduled with a personal shopper who assists him or her in selecting outfits, accessorizing, and feeling confident.','610894518918920','http://awidercircle.org/workforcedevelopmentprogram/',NULL,'alicia@awidercircle.org','Verified','911225335803318,970915508638448','To set up an appointment to receive professional attire and accessories, please contact Alicia Donahoe at alicia@awidercircle.org.',NULL,NULL,NULL,NULL,'877523491860439','646160018921336,1236548249618145',NULL,NULL,'1154169690232586',NULL,NULL,NULL),(58,602650991439185,'Foster Grandparents',NULL,761153930697275,'UPO’s Foster Grandparent Program trains low-income seniors with caring spirits to provide attention, guidance, and support to DC children in a variety of local settings, including early education centers, elementary schools, hospitals, and youth programs.\n\nVolunteering as a foster grandparent is the perfect opportunity for individuals aged 55 and older to share their experience and wisdom with children who will cherish the lessons to be learned.','594960886051316,999755198000719','https://www.upo.org/foster-grandparents/',NULL,NULL,'Verified','637158405241810','Call to apply or apply online. For more information, contact Foster Grandparent Program Director Cheryl Christmas at 202-610-5826 or cchristmas@upo.org.',NULL,NULL,NULL,NULL,NULL,'587544010010943,940897095189363,682372519823224','1242020855566510',NULL,'1304904589817191,1166860713798541',NULL,NULL,NULL),(59,607074649518713,'Health & Nutrition',NULL,612828763371641,'Mazique provides high-quality health services including oral health, mental health and nutritional services while continuously developing culturally and linguistically appropriate growth and support for our children and families.','836904778271068','https://www.mazique.org/services/',NULL,NULL,'Verified','941516382466411','Call for more information.',NULL,NULL,NULL,NULL,'1200602057472122','888042423183025',NULL,NULL,'626820886744559',NULL,NULL,NULL),(60,612309985819526,'Community Meals',NULL,804045327953048,'Delivers meals to various agencies and non-profits around the DC area. You must receive meals at those agencies, you cannot get meals individually directly from DC Central Kitchen.\n\nEvery day with the help of dedicated volunteers, we transform 3,000 pounds of otherwise wasted food into 5,000 healthy meals for our community. These aren’t simply bags of donated groceries or crates of canned goods – they’re real meals, made by hand by graduates of our Culinary Job Training program who now work for us full-time at living wages. We then put these meals onto our fleet of trucks and deliver them to more than 80 partner agencies in the Washington metropolitan area, including homeless shelters, rehabilitation clinics, and after-school programs.','771634087422781','https://dccentralkitchen.org/community-meals/',NULL,NULL,'Verified','832990803111047','No application process. Services are provided to various agencies and non-profits.',NULL,NULL,NULL,NULL,'819191608404189',NULL,'932493235875618',NULL,'730657096706420',NULL,NULL,NULL),(61,609582364629457,'Adult Medicine',NULL,605134586578120,'\n	•	Wellness Visits\n	•	Sick Visits\n	•	Flu Shots\n	•	Physicals\n	•	Comprehensive Screenings for disease detection (blood pressure, blood sugar, cholesterol etc.)\n	•	Diagnosing, treating, and helping patients manage acute and chronic illnesses','770635363010046,1002753920993717','http://eechealth.com/our-services/',NULL,NULL,'Verified','941516382466411','Call for patient intake. If you are already a patient, call to set up an appointment.',NULL,NULL,NULL,NULL,'1198488947117166,877271835912480','761526422726808,895454221155573,951328657288514,776932249812148,1321570127371250,777400646901906,619611122248463,1106120630749215',NULL,'1263089203668614','651804021834110,1128987918758522',NULL,NULL,NULL),(62,617097787641398,'New Parent Support',NULL,1195870505334629,'Moms and dads of children under three can benefit from our Healthy Start Program. These free services provide pregnant women, new moms and their families with the support and encouragement they need. We help you strengthen the bond between you and your child right in your home. We come to you!\n\nWith Healthy Start, you will receive:\n\nEducational and fun home visit sessions (for those who qualify)\nSupport for when you feel tired or worried\nTips on how to care for and bond with your baby\nHelp with getting daycare, WIC, medical care and other resources\nInformation about birth control and breastfeeding\nFood and fun at parent support group sessions for mom and dad\nDiapers and baby supplies when needed','1000709017081839','https://www.communityofhopedc.org/healthcare/wellness-programs',NULL,NULL,NULL,'941516382466411,637158405241810','For more information on how to join Healthy Start, please contact Marsha Greaves, Program Director, at 202.407.7747.',NULL,NULL,NULL,NULL,'763524779006557','922694115907703,1197713243335218',NULL,'915486946336080','920259856619905',NULL,NULL,NULL),(63,615186024715740,'Intensive Outpatient Services',NULL,883186000200856,'Treatment for Substance Use for Adolescents and Adults','920364967013405,1054369210651155','http://hillcrest-dc.org/services/children-services/',NULL,'info@hillcrest-dc.org','Verified','941516382466411','Call or walk-in for services.',NULL,NULL,NULL,NULL,'1097440010596926',NULL,NULL,'1274396898894043,883345659611536','646846673243288,1261416234116596',NULL,NULL,NULL),(64,615914620488320,'DC Office on Aging',NULL,874266502610128,'Older Adult Service and Information System (OASIS) offers challenging programs in the arts, humanities, health, wellness, travel, and volunteer service. This national growth program creates opportunities for adults 55 years of age and older to continue their personal growth and meaningful service to the community. (202) 362-9600 Ext. 560.\n\nSeniorWorks II is a structured internship program for District seniors seeking short-term volunteer opportunities and assignments working in public and private agencies, sponsored by the DC Office on Aging. Part-time volunteer internship assignments are generally limited to three months or less, with a small stipend provided to defray the intern/volunteer\'s travel and other workplace expenses. \n\nThe Older Workers Employment and Training Program is funded with a grant from Department of Employment Services. The program provides employment and training opportunities for District residents 55 years of age and older. Services are provided under Title I of the Act, and emphasize the development of employment and training opportunities through job search assistance workshops, on-the-job training, job development, and placement and classroom skills training. The Office is an active one-stop partner in the District of Columbia Workforce initiative. \n\nThe McMasters program sponsored in partnership with McDonalds\' Corporation helps older workers adjust to the work-a-day world. Its goals are to build an individual\'s confidence, self-esteem, and provide a job opportunity that fits into his/her life style and personal schedule.','1223680649678241','www.dcoa.dc.gov',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(65,620920746047249,'SPANISH CATHOLIC CENTER: DENTAL CLINIC',NULL,624726610902590,'Provides dental care for children and adults including restorative and preventative treatments. Referrals for surgery and emergency treatments are given if needed.','1297060122320888','http://www.catholiccharitiesdc.org/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1091712845549464',NULL,NULL,NULL),(66,621104147916374,'COMMUNITY COUNCIL FOR THE HOMELESS AT FRIENDSHIP PLACE',NULL,791950857737387,'Provides street outreach, addiction counseling, referrals, a medical clinic, psychiatric care and case management services all aimed at giving the homeless men and women in Northwest Washington assistance in rebuilding their lives by addressing their basic needs.','931886810745529','http://cchfp.org/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1152494666421051',NULL,NULL,NULL),(67,632654541686281,'Family Engagement Programs',NULL,1279230501938511,'We are committed to ensuring parents and caregivers are both supported and supportive. Our Family Engagement program helps strengthen the home-school relationship for our students and connects caregivers to critical resources.\n\nOur family engagement efforts include:\nA Home Visiting Program, which provides caregivers essential support during their child’s critical early years.\nThe Parenting Journey, a course that allows caregivers to reflect on how they were parented as children, and supports them to make intentional parenting decisions to ensure strong outcomes for their children.\nA partnership with Healthy Futures, which offers resources and trainings on social-emotional development.\nOur program also offers education to caregivers, connecting them to a range of vital resources related to parenting, financial literacy, and adult education.','947434898715713','https://marthastable.org/family-engagement-program/',NULL,NULL,'Verified','637158405241810,1077790582995406,789038541797078','Call to apply.',NULL,NULL,NULL,NULL,'1235881686916009','1128449542578572,799792178245127',NULL,'1292849277583603,915486946336080','1273798320035626',NULL,NULL,NULL),(68,642373200193088,'Unity Health',NULL,1043772486617212,NULL,NULL,'http://unityhealthcare.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(69,645815813705213,'Raising SAFE Kids',NULL,948113581207578,'We offer a comprehensive, in-depth curriculum for parents of children of all ages.\nOUR  TOPICS INCLUDE:\nBullying\nHuman Development\nPositive Reinforcement\nDiscipline\nThe Impact of Technology/Social Media\nManaging Anger\nSetting Limits\nRaising Resilient Children\n\n','911858349594317','https://www.wearecsc.org/parenting',NULL,'info@wearecsc.org','Verified','637158405241810,789038541797078','Please call to apply.',NULL,NULL,NULL,NULL,'615096380531905','1179201057626161',NULL,'915486946336080','921919612082211',NULL,NULL,NULL),(70,645384002034771,'Miriam\'s House',NULL,1186080684764999,'Miriam’s House,  a Housing First model, provides permanent supportive housing for formerly homeless women who are living with HIV and AIDS. Up to 25 women live and work together on managing and improving their physical health while addressing other self-sufficiency goals, which can include addiction recovery, mental wellness, education, employment, income, and long-term housing.','1186014650404910','https://www.nstreetvillage.org/about-the-village/programs-impact/housing-community/',NULL,NULL,'Verified','929094559121639,637158405241810','We encourage you to attend a WELCOME SESSION Monday-Friday at 9:15 am at the N Street Village Day Center (1333 N St. NW) where we will review housing options, tour the Village Day Center, and refer to outside resources as needed.\n\nFor N Street Village Affordable Housing, please contact WC Smith at (202) 319-9100.\n\nFor Immediate Shelter, go to our Patricia Handy Place for Women at 810 5th St NW between 4:00-7:00pm daily. Limited availability; beds are assigned on first-come, first-serve basis.\n\nN Street Village serves adult women 18 years old and over and individuals that identify as transgender. If you are seeking family services, please call Virginia Willams Center at (202) 526-0017 Monday-Thursday from 8:00am-4:30pm.\n\nFor emergencies or if you see someone in need, please call the Shelter Hotline (202) 399-7093 or 911.',NULL,NULL,NULL,NULL,'876749748721110,1260394353602193','587111670709851',NULL,'836091364973509,877243931325915','929144501518325',NULL,NULL,NULL),(71,590895767819582,'Healing Circle',NULL,948113581207578,' Collaborative Solutions for Communities (CSC) in partnership with the DC Department of Corrections is committed to helping women successfully transition home to their families. CSC has 20 years of experience helping families discover and uncover their own strengths and abilities to heal and build futures together. Through Healing Circles, and one-on-one family supportive services, participants will find the strength and confidence to rebuild their lives and reconnect with their families.','911858349594317','https://www.wearecsc.org/training-institute',NULL,'info@wearecsc.org','Verified','637158405241810','Clients will be referred by the department of corrections. You can call or email for more information.',NULL,NULL,NULL,NULL,'615096380531905','1179201057626161',NULL,'836091364973509,664148755918958','921919612082211',NULL,NULL,NULL),(72,597026276891169,'Adult Day Health Program (ADHP)',NULL,1326157862705937,'Purpose: \n\nThis program was designed to provide medically supervised adult day services to DC residents who are home-bound with chronic health problems and can benefit from various supervised therapeutic activities in an integrated community \n\n \n\nServices:\n\nParticipants will receive services based on the individual’s assessed needs (plan of care) and the participant-centered service plan. Services will include but are not limited to:\n\nNursing Services\nIndividual and Group Therapeutic Activities Including Social, Recreational and Educational Activities\nMeals (breakfast, lunch and snack based on individual dietary requirements)\nIndividual and Group Counseling for Participants and Families\nPersonal Care Assistance\nMedication Administration, Assistance and Counseling\nTransportation\nNutritional Services & Education\nCommunity Outings\nSafe and Secure Environment & Respite for Caregivers While Enrolled in the Program.','959978038980815','http://www.mbihs.com/what-we-offer/adult-day-health-program-%28adhp%29',NULL,' cbrown@mbihs.com        ','Verified','941516382466411,637158405241810','Eligibility\n\nApproved by Medicaid in DC, medicare, other accepted insurance, & private pay\nAge: 55 or older\nHave chronic medical condition\nIncome up to 150% of federal poverty level\nHave an assessment determination form authorizing/specifying level of need for ADHP Services\n ',NULL,NULL,NULL,NULL,'929037191615824,1211781059829341',NULL,NULL,'822271561821597,1279872477210132','817410769508748',NULL,NULL,NULL),(73,605446506944549,'Transitional Housing Program',NULL,1306699628219808,'SBY’s Transitional Housing Program offers service-enriched apartment-style living for families exiting emergency shelters in the District of Columbia.\n\nInitiated in collaboration with the Community Partnership for the Prevention of Homelessness, SBY grants ten families exiting city shelters seamless access to transitional housing units at Belmont Crossing Apartments. Residents receive a wide range of housing, case management, employment assistance, life skills education and other positive youth development services. Continuously updated, individualized service plans for each resident are geared towards the overall goal of assisting families in transitioning to independent or subsidized permanent housing.','818297935399976','https://www.sashabruce.org/programs/safehomes/transitional-housing-program/',NULL,'nharris@sashabruce.org','Verified','929094559121639,637158405241810','Call or email to access this program.',NULL,NULL,NULL,NULL,'1248521145824482','882054301651193',NULL,'877243931325915,883345659611536,1292849277583603','876404395390211',NULL,NULL,NULL),(74,615988503257217,'Adult Psychotherapy',NULL,840733417398800,'Life can throw unexpected challenges your way and it’s important to know you’ve got someone to rely on when things get tough. Our compassionate and affirming behavioral health care team offers help and hope when you need it most. You can rely on the qualified team at Mary’s Center for your needs including:  \n\nIndividual Therapy: Sometimes life’s challenges are hard to face alone. When you come to individual therapy, a Mary’s Center therapist will work alongside you to address a lingering challenge, inspire change, and help you improve your overall quality of life.\nFamily and Couples Therapy: Coming to therapy as a family can be a beneficial tool towards healing. We offer understanding, confidential talk therapy for couples and families who want to improve their communication and resolve conflict in a healthy way. \nGroup Therapy: Expressing your challenges to others who are in a similar circumstance can be very healing. Group therapy at Mary’s Center is led by one or more of our trained therapists in a safe, confidential and supportive setting.  \nPsychiatry: For many people, medication is an integral part of mental health recovery. If you and your individual therapist decide medication is needed, our psychiatrists are available for ongoing medication management services. \nWhatever your challenge, our highly-trained therapists can meet your needs. Our team of providers specialize in a variety of behavioral health needs including:\n\nAnxiety \nDepression \nEmotional or physical trauma, including post-traumatic stress disorder (PTSD)  \nLGBTQIA needs \nMaternal mental health \nSubstance Abuse','1282458965799792,964869638930274,629348329513757','https://www.maryscenter.org/behavioral-health/adults-and-seniors/therapy/',NULL,NULL,NULL,'941516382466411','Mary’s Center is ready to partner with you on your health journey. Don’t hesitate to reach out to us using the information below:  \n\nTo make an appointment, call (844) 796-2797 anytime \nIf you are a current behavioral health participant and need to contact Mary’s Center’s Behavioral Health department directly, please call: \nDC Behavioral Health Direct Line (202) 851-3671  \nMaryland Behavioral Health Direct Line (240) 839-3401 \n\nBehavioral Health Services  are by appointment only Monday-Friday from 8:00am to 6:00pm (other hours by arrangement).\n\nWe accept most insurance plans including Medicaid and Medicare. If you don’t have health insurance, we’ll help you apply for public benefits or provide care at a discount. Comprehensive list of insurances are available on our website.',NULL,NULL,NULL,NULL,'1301804131597006,1345728742501995','1134877289644712,827996522503929,601427652072887',NULL,'1263089203668614,854808174954754','903265014608550,962742212670581,732086812000340',NULL,NULL,NULL),(75,626403044236059,'Interview Interpretation',NULL,1116810105858975,'Qualified staff members may accompany a citizenship applicant who is eligible for the language exemption (under the 55/15 or 50/20 rule) and provide interpretation services. Those who need assistance should contact our office as soon as they receive their notice to appear for the interview before USCIS.','547920365968268','http://carecendc.org/direct-services/citizenship/',NULL,'info@carecendc.org','Verified','917725171609009','Call for services as soon you receive a notice to appear for your interview before USCIS.',NULL,NULL,NULL,NULL,'1158694379718344',NULL,NULL,'1340162113833071,1295679372454826','842193303927915',NULL,NULL,NULL),(76,638393936667053,'Recovery Support Services',NULL,883186000200856,'Recovery Support Management assists clients with the implementation of the recovery support plan.','920364967013405,1054369210651155','http://hillcrest-dc.org/services/adult-services/',NULL,'info@hillcrest-dc.org','Verified','637158405241810','Call or walk-in for services.',NULL,NULL,NULL,NULL,'1097440010596926',NULL,NULL,'1263089203668614','646846673243288,1261416234116596',NULL,NULL,NULL),(77,642012149083751,'Outreach Program',NULL,644694600510926,'Our outreach team is responsible for engaging the DC community in regards to prevention of substance abuse, mental illness, and homelessness.  The outreach team is comprised of community support workers, and clinical team from Neighbor’s Consejo.  Our goals are to involve the community in reforming disadvantageous behavior and cognition, develop relationships with residents, and continued education for a better future.','818839794992906',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1231516890380928',NULL,NULL,NULL),(78,657511678545226,'Immigration Legal Services',NULL,1116810105858975,'CARECEN’s legal department helps community members navigate the confusing and intimidating immigration process. The program seeks to facilitate Latino immigrants’ transition to the United States, reunite families, secure work authorization and economic security, and seek legal relief and justice for victims of crimes and abuse. Specifically, the low- or no-cost services provided include assistance with naturalization, family visa petitions, consular processing, obtaining and maintaining Temporary Protected Status, and filing for U Visas. In addition to direct services, CARECEN’s legal department educates community members through “Know Your Rights” forums on topics including immigration, civil rights, and notario fraud.\n\nAnnually, our legal staff provides direct service to more than 3,000 community members in the following areas:\n\nAssisting eligible youth to apply for deferred action (click here for more info)\nAssisting eligible Lawful Permanent Residents in applying for U.S. citizenship.\nAssisting with renewal of Employment Authorization Documents.\nAssisting residents in obtaining and maintaining Temporary Protected Status (TPS).\nHelping families reunite through assistance with family visa petitions, adjustment of status and consular processing.\nAssisting eligible clients obtain Lawful Permanent Residence under the provisions of the Nicaraguan and Central American Relief Act (NACARA).\nObtaining legal relief for victims of criminal acts under the U Visa program.\nProviding court representation for individuals in removal proceedings.\nHolding individual consultations, educational workshops and immigration clinics to provide information on legalization under existing laws and proposed measures for reform.\nProviding referrals of complex immigration cases to pro bono and low cost attorneys.','547920365968268','http://carecendc.org/direct-services/immigration-legal-services/',NULL,'info@carecendc.org','Verified','917725171609009','By-appointment Immigration Consultations are available on the following Saturdays in 2018.  Pre-payment is required to reserve your appointment.',NULL,NULL,NULL,NULL,'1158694379718344','578888268971743',NULL,'1340162113833071,1295679372454826','842193303927915',NULL,NULL,NULL),(79,660868979951197,'Operation Backpack',NULL,726173106231202,'Remember going back to school as a child with all your new supplies & backpack, maybe even your Trapper Keeper! That excitement is what children all over Washington D.C. will be experiencing in just a few weeks, but some are not ready and need our help. Parents often cannot afford to purchase the supplies when forced to choose between new shoes for school or a new backpack.\n\nOperation Backpack is Central Union Mission’s program designed to help low-income families have the needed supplies.','838780960881380','https://www.missiondc.org/what-we-do/family-programs/school-readiness-program/',NULL,NULL,'Verified','911225335803318','Call to inquire about receiving a backpack. Go online for donation guidelines.',NULL,NULL,NULL,NULL,'842965887033119','598863931807682',NULL,'1292849277583603','601101607323805',NULL,NULL,NULL),(80,662641889613680,'Anchor Counseling Services',NULL,1331447374298751,'Are you living with depression, addiction, or just too much stress? Anchor Counseling Services, part of Catholic Charities’ free-standing mental health clinic, is here to help. Tap into our 50-plus years of experience providing professional counseling and supportive guidance for reflection, exploration, and self-improvement.  You can schedule your one-on-one appointment with our licensed professionals when it works best for you.\n\nOUR SERVICES\nOur licensed mental health professionals at Anchor Counseling Services can provide one-on-one counseling to assist you with:\n\nDepression\nAnxiety\nBipolar Disorder\nSelf Esteem\nGrief and Loss\nAnger Management\nSubstance Abuse\nTrauma/PTSD\nRelationship/Intimacy\nFamily Dynamics\nStress management','1012923803825523','http://catholiccharitiesdc.org/page.aspx?pid=366',NULL,NULL,'Verified','941516382466411','Call to set up an intake.\n\nWe accept Amerihealth,Trusted, Medstar, DC Medicaid, Medicare, Optimum (previously United Healthcare), and most CareFirst BlueCross/BlueShield insurance plans. We will verify your insurance coverage once you schedule an initial consultation appointment and provide you with information regarding any co-pays or deductible you might have.  If we do not accept your insurance or if you don’t have insurance, you can still see one of our therapists and pay the appointment fee ($125/hour). Fees and co-pays are due at the time of service.  We accept Visa and MasterCard.',NULL,NULL,NULL,NULL,'1188739171637564','1309930863286628',NULL,NULL,'638813775258256',NULL,NULL,NULL),(81,616047069998063,'Reading and Educating to Advance Lives','REAL',855094084464049,'REAL connects volunteers with children and their parents through literacy and health activities in Department of Health and Human Services waiting rooms. Volunteers read, talk about shapes/letters/numbers/colors, talk about healthy foods, draw and color, do activity sheets, etc. with children who are present. Volunteers also offer free books for children to take home with them. Sites in Germantown, Rockville, and Silver Spring.','924628911683577','https://accessjca.org/interages/',NULL,NULL,'Verified','789038541797078','Call to find out more.',NULL,NULL,NULL,NULL,'1100526340352002,1090977082368403','1276016050822057',NULL,'761929300455945,854808174954754','1050035692418764',NULL,NULL,NULL),(82,616081055315775,'Survivor Resilience Fund',NULL,983721114373124,'Through our Survivor Resilience Fund, DASH provides emergency financial assistance to help survivors address needs which might threaten their permanent housing, help them achieve safety, and gain the support they need to move forward with their lives. This innovative fund can cover a number of expenses including home security measures, utilities, moving costs, legal or medical fees and first month’s rent. In addition to determining what financial support is needed, DASH staff will go over a safety and wellness plan with survivors to help equip them to remain safe while in the community. Providing survivors with financial support such as this can mean the difference between housing stability and life on the streets.','828792720206018','https://www.dashdc.org/programs-services/safe-housing/',NULL,NULL,'Verified','929094559121639,1077790582995406','Call for help or walk in to the housing clinic. Exact locations of residences is kept confidential to protect the safety of our residents. If you are in an emergency, contact National Domestic Violence Hotline: 1-800-799-7233 (SAFE) or 1-800-787-3224 (TTY).',NULL,NULL,NULL,NULL,'871700855571478','900562936646293',NULL,'1212718840001878','1043474797867812',NULL,NULL,NULL),(83,617081192222015,'English and Adult Education',NULL,1140996665222837,'CASA’s classes utilize a combination of communicative task-based learning and Popular Education techniques. Lessons are focused upon concrete and practical everyday experiences. Students, as adults, come to class with experiences they are encouraged to share and peer teach while performing tasks. Class materials are geared towards student’s life experiences and promote both civic engagement and community empowerment.','818820237164190,1091435530922324,979563581148756,1240567562394258','https://wearecasa.org/programs/education/',NULL,'rcusic@wearecasa.org','Verified','789038541797078','Call to apply or apply online. Visit our website to see when each class is offered at the various locations.',NULL,NULL,NULL,NULL,'958973665695309','615195958300567,940374540509771,878447457899091','789879098577824','656944907385650','612619690370287,836261919910340,1210638555366240,987608607195027',NULL,NULL,NULL),(84,623630268141505,'Training and Education',NULL,769893937425938,'Wendt Center experts provide on-site training on numerous subjects relating to adult and child grief and trauma. From skill building techniques in play therapy to in-depth presentations on traumatic bereavement, our trainers share knowledge gained from current direct practice and extensive training and research opportunities. As active members of the National Child Traumatic Stress Network and the International Society for Traumatic Stress Studies, we strive to provide stimulating, interactive presentations that fuse clinical experience with state of the art theory and research.','1108850981657232,1166799153375505','https://www.wendtcenter.org/hopes-crime-victim-services/',NULL,NULL,'Verified',NULL,'To become a client, please call: 202.204.5021',NULL,NULL,NULL,NULL,'714080995184693','789043683491652',NULL,NULL,'1231165117410316,622488765022102',NULL,NULL,NULL),(85,626861523724993,'Supported Independent Living',NULL,906742630902911,'Woodley House owns and leases apartments and condominiums throughout Washington, DC for our residents who can thrive without 24-hour care as they reintegrate into the community. The Supported Independent Living Program is the last step before total independence. Residents live on their own or with roommates in a shared apartment environment with continuing monitoring and support from Woodley House Life Skills Trainers. Staff provide weekly coaching, counseling support and skills training, focusing on mastering basic skills that will ease their transition toward self-sufficiency and successful independent living.',NULL,'https://woodleyhouse.org/residential-care/supported-independent-living/',NULL,NULL,'Verified','929094559121639,637158405241810','Referrals are accepted from the Department of Behavioral Health, Core Service Agencies, private providers, hospitals and families.\n\nPrivately-paying residents need a psychiatrist who can include Woodley House in the resident’s treatment plan and thereby provide a referral to Woodley House. Privately paying residents can come from outside Washington, DC and must demonstrate proof of their ability to pay.\n\nResidents who require financial assistance must show proof of Washington, DC residency, be enrolled with the DC Department of Behavioral Health (with an eCura Number) and have a recommendation from their Core Service Agency to apply to Woodley House and have access to public funding assistance. The Core Service Agency will provide the resident all necessary documentation.\n\nThe cost for residents are determined on a sliding scale, including fees, skills training and clinical support services. For more information about how to enter our Supported Independent Living Apartment Program, please contact:',NULL,NULL,NULL,NULL,'966435484864334',NULL,'1215015803426176',NULL,NULL,NULL,NULL,NULL),(86,640103169037193,'Food Pantry',NULL,915322254234555,'A food pantry for those in need.','671468679071199','https://www.reformationdc.org/in-the-community',NULL,NULL,'Verified','832990803111047','Walk in during hours. You do not need an ID but it\'s helpful if you do. You will need to provide your name, address, and the number of people in your household. You can only visit the food pantry once every 60 days because we have limited amounts of food. \n\nWe prefer that only DC residents visit because we are limited but we wont turn anyone away if they are in great need.',NULL,NULL,NULL,NULL,'852143936371728','647305599401067',NULL,NULL,'948985953505133',NULL,NULL,NULL),(87,642284944498747,'Mobile Outreach',NULL,810479025131545,'A mobile service providing outreach to the DC area providing support and referral to sex workers. Services may be provided on the mobile site, referred back to headquarters, or referred to another agency.',NULL,NULL,NULL,NULL,'Verified','637158405241810,941516382466411,929094559121639','If you are curious about the mobile clinic\'s locations, call. Otherwise, head to the main location for services.',NULL,NULL,NULL,NULL,'1174880928735577,878348692886905','905292149512870,1180568407412895,1078769706102153',NULL,NULL,NULL,NULL,NULL,NULL),(88,651504031814159,'Evening Program',NULL,801110030219864,'Thrive DC’s Evening Program offers a safe, peer supported environment for women and children.\n\nSince 1979 we have always reserved dinner for women and their dependents, as they often face the greatest challenges in the face of homelessness and poverty.\n\nDuring the Evening Program, we offer dinner, showers, laundry, emergency groceries, enrichment and therapeutic activities, and a safe place.\n\nEvening Schedule\nEach evening we serve 20 – 40 women and their dependents. The schedule is as follows:\n\n2:00 PM – Program opens, clients & volunteers arrive.\n3:00 PM – Meal is served and groups meet for arts, fitness, other group activities.\n4:00 PM – Program is over and the floor is closed. The office remains open until 5:00 PM.','1220597047470925','https://www.thrivedc.org/programs/dinner/',NULL,NULL,'Verified','832990803111047,637158405241810','If you need assistance, please call one of our case managers at (202) 737-9311.Case Management at Thrive DC\n\nYou can also come directly to our offices:\n\nMonday – Friday\n8:30 AM – 2:00 PM (Men & Women)\n2:00 PM – 4:00 PM (Women Only)\n1525 Newton St. NW\nWashington, DC 20010\n\nWe are located on the bottom level of St. Stephen and the Incarnation Episcopal Church. No appointment necessary, just come in and ask for one of our case managers.',NULL,NULL,NULL,NULL,'665113076769939','1183059385696004',NULL,'836091364973509,1274396898894043,877243931325915','962322435473993',NULL,NULL,NULL),(89,657179015884472,'Activities','Kensington Clubs',855094084464049,'The Kensington Club programs are planned and implemented by our professional staff of Certified Therapeutic Recreation Specialists and activities leaders. Activities are tailored to meet members’ needs, strengths and interests.\n\nActivities and services include:\n\nStimulating discussions on a broad range of topics from current events to history, art and literature\nPhysical and cognitive exercise\nReminiscing activities\nGuest entertainers and speakers\nMusical programs\nTherapeutic art programs\nField trips to local areas of interest\nCaregiver education and support\nMorning coffee and catered lunch\nInformation and referral to community resources','924628911683577,805806723754090,1179174778771993','https://accessjca.org/kensington-clubs/',NULL,NULL,'Verified','637158405241810','For information or to schedule a visit, please call.',NULL,NULL,NULL,NULL,'958720616157709,898009380902296','600730005000820,878694033728814,1149591818853041',NULL,'618828421943202,854808174954754,1157835357284365','1050035692418764,1203002351100645,594266389872303',NULL,NULL,NULL),(90,668000665510895,'\"TERRIFIC, INC. (WARD 1): CASE/CARE MANAGEMENT\"',NULL,1284728776860892,'Provides Case Management services.','882333039588739','http://terrificinc.org/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'891450530336608',NULL,NULL,NULL),(91,668729683192909,'Food Program',NULL,1004391421304549,'Adventist Community Services of Greater Washington (ACSGW) collects food donations from throughout the community and keeps it available at our center at 501 Sligo Avenue for people who need some assistance. Community members needing assistance can come to the center and discuss their needs with a case worker during our regular hours (Monday - Thursday from 10:00am -2:30pm). Qualified clients can visit the center once a month for food.\n\nThe food that is available varies throughout the month. It just depends on what ACSGW has received. Typically, we have nonperishable food, such as canned goods and pastas, as well as perishable food, such as fruits and vegetables. Sometimes we meat or poultry for our clients. Usually, we also have breads.\n\nPeople needing food must first visit our center to talk with a case manager to explain their need and provide the information necessary to ensure they meet current qualifications. You can request an appointment with a case manager by calling us at 301-585-6556 or sending an e-mail using the form, below. People who qualify can receive food the same day. Since we often provide more food than a person can carry, you should consider bringing a shopping cart or someone else with you to help you carry the food home.','950009053464384','https://www.acsgw.org/food.html',NULL,NULL,'Verified','832990803111047','An appointment is required, please call to make an appointment.',NULL,NULL,NULL,NULL,'937322777502476','1115292082523782',NULL,NULL,'877682236637760',NULL,NULL,NULL),(92,666406976354887,'Supportive Employment',NULL,883186000200856,'Supported employment program is to provide evidence based support and assist with employment services for our clients. Through a multi-tiered method of wellness, we will help clients with obtaining education and skills for employment opportunities.','920364967013405,1054369210651155','http://hillcrest-dc.org/services/adult-services/',NULL,'info@hillcrest-dc.org','Verified','970915508638448,637158405241810','Call or walk-in for services.',NULL,NULL,NULL,NULL,'1097440010596926',NULL,NULL,'1263089203668614','646846673243288,1261416234116596',NULL,NULL,NULL),(93,667209917494721,'The Behavioral Health Feeding and Eating Disorders Program',NULL,1061724977026001,'The Behavioral Health Feeding and Eating Disorders Program offers comprehensive evaluation and treatment planning for children and adolescents with eating disorders. Depending on the need of the individual, this includes an evaluation by a psychiatrist for diagnostic clarification, therapeutic treatment and medication management (if indicated) of the eating disorder and any accompanying conditions (such as depression, anxiety disorders and behavioral issues). Other aspects of the evaluation and treatment include parent consultation with a nutritionist, family-based or individual therapy and medical monitoring with referral to pediatrics/adolescent medicine as needed. \nWe also offer comprehensive evaluation and treatment planning for infants and young children with feeding disorders. Depending on the needs of the individual patient, this may involve some or all of the following: a psychiatric evaluation, including the observation of a family meal and play time, as well as evaluation for need of medication management. This is done as part of a multidisciplinary assessment in collaboration with a nurse practitioner, a nutritionist and gastroenterologist, and consultation with speech and occupational therapy. \n\nParent training for management of eating and other behavioral concerns. \n\nOur Focus\nAnorexia Nervosa\nBulimia Nervosa\nBinge Eating Disorder\nAvoidant Restrictive Food Intake Disorder, (ARFID) including Infantile Anorexia, Sensory Food Aversion, Post-Traumatic Feeding Disorder and other food intake disorders.\nEvidenced-Based Therapies Offered for Eating Disorders\nFamily Based Therapy (FBT) in the Maudsley Treatment Model for Anorexia Nervosa\nCognitive Behavior Therapy for Bulimia Nervosa, Anorexia Nervosa and Binge Eating Disorders','1282604214927911,856126341619748,979447652621070','https://childrensnational.org/departments/the-behavioral-health-feeding-and-eating-disorders-program',NULL,NULL,NULL,'941516382466411','Call or visit website to make an appointment or refer a patient.',NULL,NULL,NULL,NULL,'978304346911390','892012398827551,1095419747725144,587218394770946',NULL,'1274396898894043','928813128095347,787442654546775,1067302604787333',NULL,NULL,NULL),(94,605774245554167,'D.C. OFFICE OF LGBTQ AFFAIRS',NULL,743525753773182,'The Mayor‚Äôs Office of Lesbian, Gay, Bisexual, Transgender and Questioning Affairs (LGBTQ) is a permanent, cabinet-level office within the Office of Community Affairs in the Executive Office of the Mayor, established by statute in 2006 to address the important concerns of the District\'s gay, lesbian, bisexual and transgender residents. The District of Columbia has one of the highest concentrations of LGBTQ residents in the country with an estimated 7 to 10% of the population being LGBTQ.','1161706256775181','http://www.glbt.dc.gov',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'882267988490168',NULL,NULL,NULL),(95,613307132570587,'Tools for Loved Ones',NULL,809193297555798,'This webpage offers guidance for people the loved ones of victims of sexual assault and rape. Caring for a loved one who is a survivor of sexual assault is difficult and this website offers guidance.','728145736382163','http://dcrcc.org/counseling/no-straight-path/tools-for-loved-ones/',NULL,'dcrcc@dcrcc.org','Verified','637158405241810','Visit website.\n',NULL,NULL,NULL,NULL,'819440187923797',NULL,NULL,NULL,'782477248679291',NULL,NULL,NULL),(96,615976785591225,'Tutoring',NULL,1116810105858975,'As the exam date nears, CARECEN offers individual tutoring to those who need intensive practice before their interview. Candidates are paired up with volunteer tutors and they meet at CARECEN, typically twice a week, to practice their English and answering the exam’s history and government questions.','547920365968268','http://carecendc.org/direct-services/citizenship/',NULL,'info@carecendc.org','Verified','917725171609009,789038541797078','Call or walk in to get more information on getting tutoring services.',NULL,NULL,NULL,NULL,'1158694379718344',NULL,NULL,'1340162113833071,1295679372454826','842193303927915',NULL,NULL,NULL),(97,614149741156528,'Culinary Job Training',NULL,804045327953048,'For almost 30 years, DC Central Kitchen’s Culinary Job Training program has helped more than 1,700 men and women launch culinary careers. We care about our students’ potential much more than their pasts, and work to prepare adults facing high barriers to employment for careers in the food service industry. Thanks to our generous donors, all admitted students receive full scholarships to attend our program, so there is no cost to our students at any point in their training or in the two years of post-graduation support we provide.\n\nWe offer two training options:\n\nCulinary Job Training at DC Central Kitchen:\n\nOur renowned training program provides culinary arts education, career readiness training, and real-world internships for adults who have experienced barriers to employment. Through this fourteen week course offered at our headquarters (425 Second Street NW), trainees will prepare to earn two valuable credentials, including the ServSafe Food Protection Manager Certification. Learn more about Culinary Job Training at DC Central Kitchen>>\n\nCulinary Job Training at DC Central Kitchen Cafe:\n\nDC Central Kitchen Cafe provides hands-on culinary training and career readiness training to young adults ages 18-24 who are not in school and not working. With enrollment offered the first Monday of each month, trainees will progress through the course at their own pace as they work alongside staff at our fast-casual cafe located on the campus of THEARC (1901 Mississippi Avenue, SE).\n\nCareers and Opportunities:\n\nOur graduates work across Washington, DC’s thriving culinary industry, including top restaurants, large hotels, corporate cafeterias, local artisans, hospitals, schools, and universities.\n\nEmployers interested in hiring DC Central Kitchen graduates can contact our Chief Programs Officer, Kim Brown, at kbrown@dccentralkitchen.org.\nUpcoming CJT at DC Central Kitchen Class Flyer\nVIEW\nCJT at DC Central Kitchen Cafe Flyer','1277910214924473','https://dccentralkitchen.org/enroll/',NULL,NULL,'Verified','970915508638448','Apply online.\n\nThanks to the generous support of individual, foundation, corporate, and government partners, DC Central Kitchen pledges to meet 100% of demonstrated financial need for all admitted students. The per-student cost for the Culinary Job Training program at DC Central Kitchen Cafe is $14,084 (includes Tuition: $5,192; Books: $65; Licensing and Certification Fees: $127; Required Equipment $670; and other kitchen, occupancy, and stipend expenses totaling $8,030).',NULL,NULL,NULL,NULL,'819191608404189',NULL,'790340031601441','1070225300187916,1222973168897685','730657096706420',NULL,NULL,NULL),(98,636134392103308,'Phase IV',NULL,1318451956583107,'Each resident goes through four phases of treatment. In Phase 4, residents are now employed and preparing for re-entry while supported by counseling.','1147455525775238','http://cleanandsoberstreets.org/How_It_Works.html',NULL,NULL,'Verified','637158405241810','You must have been admitted and gone through the previous phase of this four phase program. We accept referrals from the DC Department of Behavioral Health.',NULL,NULL,NULL,NULL,'883461165895110',NULL,NULL,'1244888069012632','711002699024806',NULL,NULL,NULL),(99,637113061667348,'Nutrition Counseling',NULL,840733417398800,'You probably know eating whole, nutritious food leads to improved health, but many of us need a little guidance. There is so much conflicting diet information, it can be hard to know what’s best for you—especially if you or a loved one have a complex health condition.  \n\nAt Mary’s Center, you can trust our knowledgeable and friendly nutritionists to guide you and your family to better health through better food. Our nutritionists are co-located within the medical area and the Women, Infant, and Children (WIC) program to provide all the nutrition counseling necessary to ensure your family stays well fed. When you visit Mary’s Center for nutrition counseling, you will:   \n\nFind nutrition resources, education, and individual and group nutrition counseling  \nGet help navigating your WIC and SNAP benefits \nReceive nutrition guidance while you are breastfeeding your baby  \nLearn about managing chronic conditions through your diet \nRegardless of your needs, our nutrition counselors will be by your side to build a better diet, increase your vitality, and improve your overall health.','964869638930274,629348329513757','https://www.maryscenter.org/medical/other-specialties-and-services/nutrition-counseling/',NULL,NULL,NULL,'832990803111047,941516382466411','Mary’s Center is ready to partner with you on your health journey. Don’t hesitate to reach out to us using the information below:  \n\nTo learn more about WIC or make a WIC application appointment, call (202) 232-6679 \n\nWe accept most insurance plans including Medicaid and Medicare. If you don’t have health insurance, we’ll help you apply for public benefits or provide care at a discount. Comprehensive list of insurances are available on our website.',NULL,NULL,NULL,NULL,'1301804131597006,1263593198567823,603473645503739','621996763448625,747443860105703,598752576659212,1283475567989779',NULL,NULL,'962742212670581,732086812000340',NULL,NULL,NULL),(100,637918031832415,'Behavioral Services for Homeless Youth',NULL,1323195974089796,'LAYC is excited to bring the Behavioral Services for Homeless Youth Program (BHHY) to D.C. as a way to end youth homelessness and improve overall health and wellbeing.\n\nBHHY is a federally-funded program that provides services to youth ages 17-24 who are experiencing homelessness and are using substances.\n\nTREATMENT APPROACHES\nEvidence Based Practices (EBPs):  Motivational Interviewing, Trauma Focused – Cognitive Behavioral Therapy, Adolescent Community Reinforcement Approach\nCase Management: linkage to community resources, psycho-education, advocacy\nLife-Skills Groups: money management, time management, communication and healthy relationships\nReferrals to drug testing for youth receiving SUD treatment\nWHO IS ELIGIBLE?\nYouth between the ages of 17 and 24 experiencing homelessness and using substances\nResidents of the District of Columbia\nSERVICES\nLinking youth to housing, employment and other resources\nProviding Individual Mental Health and Substance Use Disorder counseling\nTeaching Life Skills (Professional Development, Goal Setting, etc.)','1159564548417950','http://www.layc-dc.org/what-we-do/health-wellness/behavioral-services-for-homeless-youth/',NULL,NULL,'Verified','941516382466411','Call or email for more information. Referral form is available on website.',NULL,NULL,NULL,NULL,'1080778313579001,665879809068779','920999838182205,1016645181977967','1328428091308050,697976339958489','1295679372454826,883345659611536,877243931325915','1288365969354186',NULL,NULL,NULL),(101,644091225156703,'50+ Employment Expos',NULL,855094084464049,'Over 50 & Looking for Employment?\n\nAt our annual 50+ Employment Expos, you can:\n\nnetwork with area employers and community resource organizations,\nget a free résumé review, and\nlearn new job-search skills.\nThere are dozens of employers with available jobs and community resources to help with your employment search.','924628911683577','https://accessjca.org/employment-expos/',NULL,NULL,'Verified','970915508638448','This is offered a few times a year so check the website or call for information on the most current upcoming exposition.',NULL,NULL,NULL,NULL,'1100526340352002,1090977082368403',NULL,NULL,'854808174954754,1114978823107611,1178794928615970','1050035692418764',NULL,NULL,NULL),(102,644620777168393,'Immigration and Naturalization',NULL,1141864402494387,'Immigration and Naturalization\nAs a large percentage of the Asian Pacific Islander community consists of immigrants, the APALRC provides legal assistance on immigration and naturalization cases. Because of complex U.S. immigration laws, language barriers, cultural preferences and traditions, the APALRC helps immigrants access and navigate the U.S. justice system.\n\nThe APALRC provides assistance in adjustment of status, consular processing, Deferred Action for Childhood Arrivals (DACA), Employment authorization, family-based petitions, Naturalization, Removal hearings, T visas, temporary Protected Status (TPS), U visas, Violence Against Women Act (VAWA) petitions.\n\nThe APALRC has created individual projects to help specific groups of people.\n\nReaching for the Dream Project: helps undocumented youth immigrants secure temporary deportation reprieve and employment authorization under President Obama’s Deferred Action for Childhood Arrivals program (DACA).\n\nJustice for Filipino Teachers Project: provides legal representation to Filipino teachers trafficked to the U.S. under fraudulent labor contracts\n\nNew Americans Campaign: an area network of immigration legal providers assisting eligible legal permanent residents become naturalized citizens.  ','1264011549910449','https://www.apalrc.org/immigration/',NULL,'helpline@apalrc.org','Verified','917725171609009','Call for services',NULL,NULL,NULL,NULL,'1010201225467528',NULL,NULL,'884944905632896','1018319997039351',NULL,NULL,NULL),(103,671489333574807,'Child Sponsorship',NULL,1276678931351667,'Working with Families and groups to provide opportunities for children in need. Through partnerships sponsoring children and families at hoome and internationally.',NULL,'http://www.nazareneoutpostministries.org/programs-and-services/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(104,674557198522049,'Medical Interpretation',NULL,887352348953420,'In order to ensure equal access to healthcare for Limited English Proficient individuals, La Clínica provides medical interpretation in over eight languages and American Sign Language (ASL) on-site and at community health organizations and local hospitals. We are D.C.’s only non-profit provider of health-related interpreter services to government agencies and healthcare organizations, among them the DC Department of Health Care Finance (DHCF), Department of Health (DOH), and other Federally Qualified Health Centers (FQHCs). Medical interpretation is paired with navigation to help clients prepare for office visits, complete intake forms, attend appointments, receive treatment instructions, and arrange follow-up visits. Our model combines personalized attention, community knowledge, and linkages with a professional language services operation, including a streamlined and efficient claims-based billing system.','1170113060894673,868710877316469','https://lcdp.org/_en/programs-language-access.html',NULL,NULL,'Verified','941516382466411',NULL,NULL,NULL,NULL,NULL,'660265936787847,1143026726991574,853098088747359,887062299451299','1202170493625306,686273477676422,1136144186376874',NULL,'670413521970743,1295679372454826','1080723808883365,1214063268443455',NULL,NULL,NULL),(105,619922899003410,'Senior Helpline',NULL,855094084464049,'JCA can help you find the senior services you need within the Greater Washington, D.C. area — housing, home care, recreation and more — through the Rose Benté Lee Senior HelpLine and the Steven M. Reich HomeCare Resource Center.','924628911683577','https://accessjca.org/information-and-referral/',NULL,NULL,'Verified','637158405241810','To talk with an Information & Referral Specialist, call us at 240.290.3311 or 703.652.1515, or send an email.',NULL,NULL,NULL,NULL,'904979906912360,879017523095473','1276016050822057',NULL,'854808174954754','1050035692418764',NULL,NULL,NULL),(106,627760898509669,'Escorted Transportation','Connect-A-Ride',855094084464049,'This program serves eligible low-income residents of Montgomery County who are unable to travel alone. Customers must require assistance due to physical, cognitive or emotional impairment. The program assists with transportation to medical appointments, grocery stores and other destinations.','924628911683577','https://accessjca.org/connect-a-ride/',NULL,'Escorted.Transport@AccessJCA.org','Verified','632609508449013','For information or to enroll, call 240.395.0915 or email Escorted.Transport@AccessJCA.org.',NULL,NULL,NULL,NULL,'1256462778437672,826005584996919','1276016050822057',NULL,'1262399029280424,854808174954754','1050035692418764',NULL,NULL,NULL),(107,639467846851619,'Online Housing Resources',NULL,810479025131545,'An online group of resources providing information on various housing services around DC.',NULL,'https://www.hips.org/housing-resources.html',NULL,NULL,'Verified','929094559121639','Visit website to check out the resources.',NULL,NULL,NULL,NULL,'1174880928735577,878348692886905',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(108,642601279257974,'Clothing Closet',NULL,1150695227682882,'A clothing closet providing clothing to those in need.','994308933727557','https://assumptiondc.org/outreach/',NULL,NULL,'Verified','911225335803318','Walk in.',NULL,NULL,NULL,NULL,'576203813370859,1068293081202730','924548406180044',NULL,NULL,'1245750861687096',NULL,NULL,NULL),(109,646395612481753,'Transitional Rehab Program',NULL,1114103792920259,'Provides residential housing and supportive services to 40 homeless men. Services include food, substance abuse counseling, case management, employment and housing placement assistance. Washers and dryers are available on the site. Dormitory style sleeping for 40 men. Projected length of stay is 6 months.  La Casa has bilingual staff in English and Spanish.\n\nTransitional housing is affordable supportive housing designed to provide housing and appropriate support services to persons who are homeless or who are close to homelessness. The transition is to help them be more self sufficient to move towards independent living on their own. Transitional housing locations are oftentimes called Halfway Houses. The naming of the two (Halfway House OR Transitional House) is oftentimes interchangeable.\n\nMany Transitional Housing programs are subsidized and are income based. Income based transitional housing generally charges 30% of your income for rent when you do have income. Contact the transitional housing facility to see if this applies.\n\nServices provided at transitional housing facilities varies from substance abuse treatment, to psychological assistance, job training, domestic violence assistance, etc. The assistance provided varies, but it is generally affordable and low cost housing. Read the descriptions of each of the transitional living locations for more detailed information. Transitional housing facilities also may or may not assist with alcohol and/or drug substance abuse treatment.Drug And Alcohol Rehab programs are intended to treat alcohol and/or drug dependency.  The cost of participating in one of these programs and the method of treatment range significantly. The database operated on this website only includes residential rehab programs (not outpatient programs). We also provide Access to Recovery (ATR) Grant programs for substance abuse treatment. ','595592759444028','https://www.shelterlistings.org/details/31468/',NULL,NULL,'Verified','929094559121639','Fees may apply for this Transitional Housing resource. Contact La Casa Transitional Rehab Program with the contact information we provided to get full details. Oftentimes you can apply for sliding scale fee payment or other options if you are low income. You will need to speak with them to see if you qualify.',NULL,NULL,NULL,NULL,'1213542765723083','1179201057626161',NULL,'877243931325915,625195015492370','855901575106743',NULL,NULL,NULL),(110,644648091160119,'Eden House',NULL,1186080684764999,'Located in N Street Village’s flagship building, Eden House is a 51-unit apartment complex that provides affordable housing for low- and moderate-income families and individuals.','1186014650404910','https://www.nstreetvillage.org/about-the-village/programs-impact/housing-community/',NULL,NULL,'Verified','929094559121639,637158405241810','We encourage you to attend a WELCOME SESSION Monday-Friday at 9:15 am at the N Street Village Day Center (1333 N St. NW) where we will review housing options, tour the Village Day Center, and refer to outside resources as needed.\n\nFor N Street Village Affordable Housing, please contact WC Smith at (202) 319-9100.\n\nFor Immediate Shelter, go to our Patricia Handy Place for Women at 810 5th St NW between 4:00-7:00pm daily. Limited availability; beds are assigned on first-come, first-serve basis.\n\nN Street Village serves adult women 18 years old and over and individuals that identify as transgender. If you are seeking family services, please call Virginia Willams Center at (202) 526-0017 Monday-Thursday from 8:00am-4:30pm.\n\nFor emergencies or if you see someone in need, please call the Shelter Hotline (202) 399-7093 or 911.',NULL,NULL,NULL,NULL,'876749748721110,1260394353602193','587111670709851',NULL,'836091364973509,877243931325915','929144501518325',NULL,NULL,NULL),(111,651208869509343,'Health Home Program',NULL,883186000200856,'A multidisciplinary team which advocates and coordinates primary health and behavioral health services for clients.','920364967013405,1054369210651155','http://hillcrest-dc.org/services/adult-services/',NULL,'info@hillcrest-dc.org','Verified','941516382466411','Call or walk-in for services.',NULL,NULL,NULL,NULL,'1097440010596926',NULL,NULL,'1263089203668614','646846673243288,1261416234116596',NULL,NULL,NULL),(112,653156323573606,'Seminars',NULL,1276678931351667,'Parenting and Relationship Workshops. Wedding Services available.(Pre marital Counseling required.)','1001921907887485','http://www.nazareneoutpostministries.org/programs-and-services/',NULL,NULL,'Verified','637158405241810','Call to make an appointment.',NULL,NULL,NULL,NULL,'842254025136504',NULL,NULL,'915486946336080,1292849277583603,651281137045548','753150645151105',NULL,NULL,NULL),(113,653858529595915,'Next Steps Program',NULL,1341330878033407,'The Next Step Program provides job assistance, a pre-GED course, and services to individuals living with HIV/AIDS.\n\nCaseworkers and staff help to:\n\n- Develop a plan to find a place to live\n- Identify and apply to shelters and transitional housing programs\n- Get ready for successful employment through STRIVE\n- Develop a professional resume and prepare for job interviews\n- Learn how to use computers to search for employment and submit online job applications\n- Set-up and use e-mail to apply for jobs\n- Obtain a valid photo ID\n- Select appropriate clothing for a job interview\n- Receive mail and phone messages from potential employers\n- Complete applications for benefits such as Social Security and food stamps\n- Apply for medical benefits and find medical care\n- Enter detox and recovery programs\n- Find legal advice\n- Develop a personal spending plan','1108000021700211,948736838709158,1229901678210145,880015218951352,955920420939787','http://samaritanministry.org/program',NULL,NULL,'Verified',NULL,'Visit the office nearest you between 9am-11am, Monday through Friday to complete the intake with a caseworker.',NULL,NULL,NULL,NULL,'1313749480020796,1278070780621235,1116577714869583,929291849442144,907595396415056,809087167806044,779145162518714,1240962571903687,798196836607721','1315075616326203,901698481561498,899511741518736',NULL,NULL,'915426938281998,1291310824415800,931556635311387,757642919857969,1125465450764814',NULL,NULL,NULL),(114,671724061345975,'Rape Crisis Hotline',NULL,809193297555798,'For people in crisis, our hotline offers 24 hour services.','728145736382163','http://dcrcc.org/counseling/no-straight-path/crisis-intervention/',NULL,NULL,'Verified','878986697513222,637158405241810','Call our hotline 202-333-RAPE (7273)',NULL,NULL,NULL,NULL,'1248802193472840','745214673411437',NULL,NULL,'782477248679291',NULL,NULL,NULL),(115,670644496333952,'Toddlers',NULL,580772169029651,'For children 19 months+, the Toddler Program builds upon the Infant Program by introducing new activities and learning opportunities that foster the social, emotional, physical and intellectual development of your child. We use the Creative Curriculum, a play-based learning curriculum, in our toddler classrooms. The physical learning environments are designed to promote creativity through self-discovery and trial and error.','813926334906214,1191165945054651,816301601038577','https://barbarachambers.org/programs/',NULL,NULL,'Verified','637158405241810','Enroll your child online.',NULL,NULL,NULL,NULL,'986167438798239,1090445511708047,574820988537178','640276804195373',NULL,'628619044391936','1219279263504235,1258337392299415,1309359311970768',NULL,NULL,NULL),(116,672539129008408,'Domestic Violence',NULL,769893937425938,'The Wendt Center provides specialized crisis intervention and counseling services to survivors of domestic violence, including children.','1108850981657232,1166799153375505','https://www.wendtcenter.org/domestic-violence/',NULL,NULL,'Verified',NULL,'Call the National Domestic Violence Hotline 24 days, 7 days a week, anywhere in the country: 800-799-SAFE.\nFor the DC Domestic Violence Hotline call 202-749-8000.\nFor an appointment call the Wendt Center 202-624-0010.',NULL,NULL,NULL,NULL,'1071202278113160,801719759212724,1137743103213639','789043683491652',NULL,NULL,'1231165117410316,622488765022102',NULL,NULL,NULL),(117,678882337307747,'Holocaust Survivor Program',NULL,970560028876577,'JSSA provides multiple services for Holocaust survivors living independently in the community.\n\nServices include:\n\n- Limited urgent needs assistance\n- Claims assistance\n- Ongoing care management\n- Homemaker assistance\n- Personal care assistance\n- Emergency call system in your home\n- Pro bono dental program\n- Pro Bono eye care program\n- Meals on Wheels (Kosher meals delivered to your home)\n- Escorted transportation to medical appointments\n\nJSSA can also offer counseling/mental health services that are insurance reimbursable.','1104646684650585,1321118518935089','https://www.jssa.org/get-help/holocaust-survivor-services/',NULL,NULL,'Verified','637158405241810','Call for services.',NULL,NULL,NULL,NULL,'815545569707089,1047807433568619','799390782148011,823008542949204,790762956605328,1094678156609302,1113885469544387',NULL,'752956657718236','1328302797893590,1218692669680880',NULL,NULL,NULL),(118,685821962980238,'Mental Health Treatment',NULL,1323195974089796,'LAYC’s Behavioral Health Treatment Team uses various approaches. This includes the Trauma Focused Cognitive Behavioral Therapy (TF-CBT), including medication management, and other rehabilitation services. The TF-CBT approach is a systematic treatment approach grounded in cognitive-behavioral therapy. It is developed for children/youth that have experienced trauma and are exhibiting symptoms that may have a profound and long-lasting negative impact on their daily functioning, health, and safety. CBI Services are time-limited, intensive mental health services delivered to youth who have a history of involvement with Child Protective Services or Juvenile Court, a history of negative involvement with schools due to behavioral issues, or are at risk of out-of-home placement due to negative behavior or emotional challenges.\n\nWHO IS ELIGIBLE?\nYouth between the ages 12 to 21\nResidents of the District of Columbia\nYouth experiencing emotional, psychological, or behavioral problems\nSERVICES\nAssessment\nIndividual, group, and family counseling\nCommunity Based Intervention\nCrisis intervention\nPsychiatric evaluations and medication management\nCommunity support\nReferrals\nLOCATION','1159564548417950','http://www.layc-dc.org/what-we-do/health-wellness/mental-health-treatment/',NULL,NULL,'Verified','941516382466411','Call or email for more information.',NULL,NULL,NULL,NULL,'665879809068779','920999838182205,1016645181977967','1328428091308050','1295679372454826','1288365969354186',NULL,NULL,NULL),(119,688139575815288,'Bilingual Dispute Resolution Clinic',NULL,1116810105858975,'As part of an initiative launched in 2011, in partnership with the D.C. Superior Court, CARECEN offers bilingual dispute resolution services on-site twice a month to individuals with employment, consumer, tenant, and other issues.\n\nThis is a free, by-appointment clinic in CARECEN’s offices, held on the second and fourth Wednesday of every month. Community members with disputes involving unpaid wages, neighbor conflicts, tenant problems (security deposits and repairs), consumer problems (with vendors, contractors, auto shops, etc.), or other monies owed between individuals are pre-screened by CARECEN staff and scheduled for interviews with the Bilingual Dispute Resolution Specialist the day of the clinic. To be assisted during the clinic, at least one of the parties involved in the dispute must live or do business in D.C.','547920365968268','http://carecendc.org/direct-services/immigration-legal-services/',NULL,'info@carecendc.org','Verified','917725171609009','Walk in or call for services. Some services are by appointment only. ',NULL,NULL,NULL,NULL,'1158694379718344','578888268971743',NULL,'1340162113833071,1295679372454826','842193303927915',NULL,NULL,NULL),(120,634028809032783,'Scattered-site Permanent Supportive Housing Program',NULL,787727417537507,'For clients under the scattered site PSHP, OAH case managers provide intensive mobile case management. All supportive services include supportive counseling, crisis intervention, financial management and assistance in receiving public benefits and referrals to resources and/or programs. OAH also connects residents with off-site services that include mental health and assertive community treatment, alcohol and drug abuse counseling, employment counseling, day programs, volunteer opportunities, self-help groups, medical treatment, and food pantries.\n\nOAH On-site Supportive Services:\n- Outreach and engagement\n- Orientation to building and apartment, assistance in obtaining subsidy\n- Financial management, help with activities of daily living\n- Supportive counseling, crisis intervention','920572231138004','https://openarmshousing.org/programs',NULL,'info@openarmshousing.org','Verified','929094559121639','You must be referred to our program through Coordinated Entry and the DHS.',NULL,NULL,NULL,NULL,'1130020356495609','819527791411716',NULL,NULL,'663934110398598',NULL,NULL,NULL),(121,635156280108722,'CONGRESS HEIGHTS SERVICE CENTER',NULL,659021595524966,'Provides Commodity Supplemental Food Program (CSFP) services.','674131229606594',NULL,NULL,NULL,'Inactive',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1094251756466267',NULL,NULL,NULL),(122,636128659634571,'MIRIAM\'S KITCHEN',NULL,1043249662316489,'Every Wednesday, 12noon-2pm nearly 100 guests join Miriam\'s Cafe for a healthy lunch, the opportunity to access case management services, and the chance to participate in life skills classes.','1220017101351760','http://miriamskitchen.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'850193305992354',NULL,NULL,NULL),(123,641610186670486,'Suicide Grief Support',NULL,970560028876577,'A comprehensive program for specialized bereavement support for survivors of suicide loss, encompassing expert clinical training, counseling services, a support group, information and referral services, and community educational programs.','1104646684650585','https://www.jssa.org/get-help/adults-couples-and-parents/counseling/suicide-grief-support/',NULL,NULL,'Verified','637158405241810','Pre-registration required for the Support Group for Survivors of Suicide Loss. Email Ellen Lebedow at elebedow@jssa.org.\n\nFor more information about the Support Group for Teen Survivors of Suicide Loss, please contact Heidi Cohen, LCSW-C, at 301-610-8379.',NULL,NULL,NULL,NULL,'815545569707089','573957674876281,773649767743777',NULL,'586981821517675,1211730899647476','1328302797893590',NULL,NULL,NULL),(124,647232963972591,'Clothes Closet',NULL,1013543362848937,'We give away free clothes the second Saturday of every month (except July and August) from 11:00 am until 1:00 pm. No sign-up required.','628637355176202','http://www.hughesmemorial.org/ministries.aspx',NULL,NULL,'Verified','911225335803318','Walk in.',NULL,NULL,NULL,NULL,'905425032669080','1146330288608786',NULL,NULL,'1190125799561725',NULL,NULL,NULL),(125,647808349539409,'Foggy Bottom Food Pantry',NULL,606016520179422,'The Foggy Bottom Food Pantry provides assistance to Washington, DC families in need. The Food Pantry provides fresh produce, meats, bread, cereal, and snacks.','791197553917784','http://www.theunitedchurch.org/new-events/2019/2/9/foggy-bottom-food-pantry-le83x',NULL,NULL,'Verified','832990803111047','Walk in. Clients should bring a photo ID showing their current Washington, DC address.\n\nPlease note the schedule is subject to change around Thanksgiving and Christmas. Check our calendar for openings.',NULL,NULL,NULL,NULL,'1303072516221458','884338031728165',NULL,'868012483124236,1274524177531453,565669778208779','1116967911199305',NULL,NULL,NULL),(126,647361700663696,'Transitional Living Program',NULL,577764298046742,'This free service is for LGBT youth between the ages of 18 and 24 years old, and guarantees stable housing and support services for up to 18 months. This program requires members to complete 35 hours devoted to personal improvement, which can be combined with a school or employment program that helps them create a financial base and stability to thrive.','572381295862246','https://casaruby.org/our-services/#hiv',NULL,NULL,'Verified','929094559121639','Call or walk in for more information.\n',NULL,NULL,NULL,NULL,'937785373035309','605106466070807,872554493521158','599621071767378','1200832408072169,605403471620978,1222973168897685','603292299584681',NULL,NULL,NULL),(127,652574554780668,'D.C. DEPARTMENT OF BEHAVIORAL HEALTH (DBH): SUBSTANCE USE DISORDER SERVICES: WARDS SEVEN AND EIGHT PREVENTION CENTER',NULL,932228398355792,'The Department Of Behavioral Health (DBH): Substance Use Disorder Services provides four Prevention Centers to provide substance use disorder services including detoxification, residential and outpatient services based on the level of need. It also provides a range of prevention and recovery services.','799908624348129','http://dbh.dc.gov',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'688999009453287',NULL,NULL,NULL),(128,656905764489449,'Latino & Immigration Services',NULL,577764298046742,'This is a unique program that meets the needs of LGBTQ immigrants from around the world. We understand the needs and constraints that have forced people to leave their countries of origin, escaping discrimination, fear, and rejection. Through this program, Casa Ruby seeks to improve living conditions and make it easier to transition to a new country.','572381295862246','https://casaruby.org/our-services/#hiv',NULL,NULL,'Verified','917725171609009','Call or walk in for more information.\n',NULL,NULL,NULL,NULL,'937785373035309','605106466070807,872554493521158','1189733668647287','1200832408072169,605403471620978,1340162113833071','603292299584681',NULL,NULL,NULL),(129,662348348100050,'Self-Help Office (SHO)',NULL,1093127605400642,'LCE’s Self Help Office (SHO) empowers seniors through advocacy and community partnerships. A legal associate and volunteers provide direct assistance, helping more than 300 seniors each year. Services include, but are not limited to:\n\n- Providing information for requesting DC government services\n- Providing educational information on various legal topics;\n- Providing self-help guides;\n- Conducting public benefits checkups;\n- Helping  with the preparation of applications for public benefits;\n- Helping  write consumer complaint letters;\n- Providing referrals to social service agencies;\n- Providing information on filing small claims cases;\n- Providing information on small estate probate and recording deeds;\n- Providing information on requests for vital records;\nRequesting and disputing credit report information\n\nLCE believes there is no substitute for having staff \"on the ground\" in the community. We serve at six partnering locations:\n\n- Downtown Cluster/NW\n- Israel Baptist/NE\n- Capitol View Baptist/NE\n- IONA/NW\n- Bread for the City/SE\n- AARP DC State Office/SE','1287901333269561','https://www.aarp.org/legal-counsel-for-elderly/what-we-do/info-2017/self-help-office.html?intcmp=AE-LCE-WWD-R1C2LL2',NULL,NULL,'Verified','637158405241810,1077790582995406,917725171609009','You must first call and make an appointment. ',NULL,NULL,NULL,NULL,'1262951146146675',NULL,NULL,NULL,'763163886168100',NULL,NULL,NULL),(130,658231090559812,'Thriving Together',NULL,970560028876577,'Led by a trained mental health professional from JSSA, Thriving Together provides premarital and married couples with the tools they need to:\n\n- Identify strength and growth areas\n- Increase communication and intimacy\n- Understand personality traits and dynamics\n- Improve conflict resolution skills\n- Reduce interpersonal stress\n- Create healthy expectations','977589590864235,1321118518935089','https://www.jssa.org/relationship-coaching/',NULL,NULL,'Verified','637158405241810','To learn more, please contact Kirsten Sidell at 301-610-8328 or ksidell@jssa.org.',NULL,NULL,NULL,NULL,'815545569707089,1047807433568619','1094678156609302,1113885469544387,573957674876281,773649767743777',NULL,'1211730899647476,835895554702710','863218507660277,1218692669680880',NULL,NULL,NULL),(131,668963134824856,'JOINT BASE MYER-HENDERSON HALL: ARMY COMMUNITY SERVICE (ACS)',NULL,888574254962004,'Provides assistance in accessing social services for service members, DoD Employees and their families.','1154204314985719','http://jbmhh.armymwr.com/programs/army-community-service-acs',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1214906324166131',NULL,NULL,NULL),(132,673534610271949,'Psychiatric Evaluation',NULL,883186000200856,'An assessment to determine the source of the emotional and behavioral concerns and determine appropriate course of treatment','920364967013405,1054369210651155','http://hillcrest-dc.org/services/children-services/',NULL,'info@hillcrest-dc.org','Verified','941516382466411','Call or walk-in for services.',NULL,NULL,NULL,NULL,'1097440010596926',NULL,NULL,'1274396898894043,883345659611536,1292849277583603,915486946336080','646846673243288,1261416234116596',NULL,NULL,NULL),(133,679830596478752,'Recovery Housing',NULL,1186080684764999,'Recovery Housing is a therapeutic community program for up to 21 women with co-occurring mental illness and addiction. Women work to stabilize their mental health and recovery with the support of each other, their recovery networks and our staff. Part of the process is to document and present your autobiography. Some residents explore their personal journey as participants in our Theatre Lab Life Stories partnership. By dramatizing their personal stories women are able to find and share their remarkable stories of courage and resilience.','1186014650404910','https://www.nstreetvillage.org/about-the-village/programs-impact/housing-community/',NULL,NULL,'Verified','929094559121639,941516382466411,637158405241810','We encourage you to attend a WELCOME SESSION Monday-Friday at 9:15 am at the N Street Village Day Center (1333 N St. NW) where we will review housing options, tour the Village Day Center, and refer to outside resources as needed.\n\nFor N Street Village Affordable Housing, please contact WC Smith at (202) 319-9100.\n\nFor Immediate Shelter, go to our Patricia Handy Place for Women at 810 5th St NW between 4:00-7:00pm daily. Limited availability; beds are assigned on first-come, first-serve basis.\n\nN Street Village serves adult women 18 years old and over and individuals that identify as transgender. If you are seeking family services, please call Virginia Willams Center at (202) 526-0017 Monday-Thursday from 8:00am-4:30pm.\n\nFor emergencies or if you see someone in need, please call the Shelter Hotline (202) 399-7093 or 911.',NULL,NULL,NULL,NULL,'876749748721110,1260394353602193','587111670709851',NULL,'836091364973509,877243931325915','929144501518325',NULL,NULL,NULL),(134,680052874958118,'Clothing Closet',NULL,866237660806724,'A clothing closet for those in need.','640375823525191','http://acamec.org/ministries/allen-food-pantry',NULL,NULL,'Verified','911225335803318','Walk in.',NULL,NULL,NULL,NULL,'654485576131912','1080981189328944',NULL,NULL,'632170755225855',NULL,NULL,NULL),(135,681767171553959,'There is No Straight Path',NULL,809193297555798,'Website offers interactive artwork to describe the complex nature of healing from sexual assault. \n\nImagining healing is one of the most challenging tasks asked of a survivor. The word itself conjures the visual of a spinning turntable as one navigates feelings of hopelessness, shame, anger, fear, doubt and anxiety. The wreckage caused by trauma can easily overwhelm and paralyze us, making us feel stuck and keeping us in crisis.\n\nDCRCC is committed to the belief that everyone can heal from trauma. We work to preserve individual agency in one’s healing. We seek to build a hub of resources to enable individuals to have more models and greater access to tools and support. The premise of ‘There is No Straight Path’ is to reframe healing as gathering tools and developing skills that begin to restore a sense of power and control. We offer the insight that healing is not a linear path but rather a spiral of resiliency. Like a winding labyrinth, the trials of regaining connection, battling loneliness, managing frustration, building trust, practicing self love and finding hope line a spiral circling outward as we emerge with new insights and more resources','728145736382163','http://dcrcc.org/counseling/no-straight-path/',NULL,'alindamood@dcrcc.org','Verified','878986697513222,637158405241810','Email or call for more information.',NULL,NULL,NULL,NULL,'819440187923797',NULL,NULL,NULL,'782477248679291',NULL,NULL,NULL),(136,682308202362189,'Hospitality Institute',NULL,1323664977480953,'The Hospitality Institute is an addition of CHGW’s existing workforce readiness curriculum created in partnership with Accenture, which provides an opportunity for youth to gain critical career skills through skills training, career coaching, and experiential learning. The six-week curriculum includes 29 hours of classroom and web-based professional skills training followed by on-the-job shadowing. After completing the six-week course, participants will have obtained industry recognized Guest Service Gold and ServSafe Food Handler Manager Certifications. Our unique partnership with Grads of Life connects youth with employers helping them to get the interview and land employment.','1106602330344467','http://covenanthousedc.org/our-services/hospitality-institute/',NULL,'kwhitehead@chdc.org','Verified','789038541797078,970915508638448','If you are interested in starting your career in hospitality, please call 202-610-9600 or email.',NULL,NULL,NULL,NULL,'613066881487958','1272942074938025',NULL,'883345659611536','899989255714132',NULL,NULL,NULL),(137,684439431487008,'WHITMAN-WALKER CLINIC: LEGAL SERVICES PROGRAM',NULL,1280475814917857,'Offers a variety of pro bono legal services to persons living with HIV/AIDS. Provides legal counseling and representation in the areas of confidentiality, insurance, discrimination, immigration, future planning documents, and access to public benefits.','948165240614648','http://wwc.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(138,685530407413205,'Rehabilitation',NULL,1195280864464976,'Our goal is to make each of our residents and patients feel complete and whole. This can be challenging if you’ve just been released from surgery, have suffered a stroke, or have a chronic condition that inhibits your ability to live fully. That’s where our rehabilitation services come in. Our team of compassionate and motivated professionals provide the therapy, encouragement and support our residents need to achieve their maximum potential.\n\nPhysical Therapy\nOur Physical Therapists work with individuals to start the journey to recovery. The ultimate goal is to return people to optimum physical functioning, so they can return to their home or senior living community and continue leading their lives.\n\nOccupational Therapy\nOccupational Therapists help those individuals who have reduced functioning in the activities of daily living, such as dressing, bathing, grooming, etc. The goal is to enable the patient to regain the skills necessary to live safely in their own home.\n\nSpeech Therapy\nFor people with speech, communication and swallowing issues, our Speech Therapists can diagnose and treat numerous disorders.','814720878521693','https://www.stoddardbaptistglobal.org/our-services/rehabilitation/',NULL,NULL,'Verified','941516382466411','Call for services.',NULL,NULL,NULL,NULL,'1257614234179117',NULL,NULL,'854808174954754','1230684095904498',NULL,NULL,NULL),(139,688871630742360,'Transition Services',NULL,964889233755760,'DCCIL assists individuals with significant disabilities who live in nursing homes and other institutions to transition to community-based residences as well as assist in establishing community-based supports and services, provides assistance to individuals with significant disabilities who are at risk of entering institutions so that the individuals may remain in the community and facilitates the transition of youth who are individuals with significant disabilities.','875107767611380,608497828316445,1282997809596504','https://dccil.org/what-we-do/our-core-services/',NULL,NULL,'Verified','637158405241810','Call for intake. Services are provided to residents.',NULL,NULL,NULL,NULL,'624495395805685,1009972720361462,857576973728938,1222403878723639,1154182835844763','1180459083504396',NULL,'1322383076619129','825051851809001,904316078691110,1313889595660179',NULL,NULL,NULL),(140,695948265970000,'Counseling Services',NULL,809193297555798,'DCRCC CONTINUUM OF CARE & COUNSELING PHILOSOPHY\n\nIndividuals who have experienced any form of sexual violence have survived a profound violation which can lead to deep, difficult feelings—including shock, shame, anger, and grief. These feelings can impact a persons’ relationship with family, friends, partners, and work. Whether you experienced sexual violence recently or decades ago, it is possible to heal, and you are not alone. DCRCC has trained therapists to support you in FREE individual or group therapy.\n\nThe DCRCC Clinical Program exists to support and empower survivors of sexual violence. Our therapy is based on empowering the survivors to regain control over their lives, helping the client to have choices, understanding that education is power, respecting their right to self-determination with the understanding that all forms of oppression are connected.\n\nValues\n\nWe believe in the capacity for every survivor to heal and thrive.\nCommitted to the belief that all forms of oppression are linked, we value accessibility, cultural respect and understanding, as well as the empowerment of all people.\nWe respect the unique experiences of each survivor and believe that survivors are experts in their own experiences.\nWe support people to find their own power to improve the quality of their lives.\nWe believe that healing from sexual trauma is a series of journeys. We serve as guides assisting the survivor on the next part of their journey, providing them with tools and support, along with an invitation to hope, trust, and embrace their power.\nWe act and advocate with authenticity and integrity by staying true to these core values in all we do.DCRCC CONTINUUM OF CARE & COUNSELING PHILOSOPHY\n\nIndividuals who have experienced any form of sexual violence have survived a profound violation which can lead to deep, difficult feelings—including shock, shame, anger, and grief. These feelings can impact a persons’ relationship with family, friends, partners, and work. Whether you experienced sexual violence recently or decades ago, it is possible to heal, and you are not alone. DCRCC has trained therapists to support you in FREE individual or group therapy.\n\nThe DCRCC Clinical Program exists to support and empower survivors of sexual violence. Our therapy is based on empowering the survivors to regain control over their lives, helping the client to have choices, understanding that education is power, respecting their right to self-determination with the understanding that all forms of oppression are connected.\n\nValues\n\nWe believe in the capacity for every survivor to heal and thrive.\nCommitted to the belief that all forms of oppression are linked, we value accessibility, cultural respect and understanding, as well as the empowerment of all people.\nWe respect the unique experiences of each survivor and believe that survivors are experts in their own experiences.\nWe support people to find their own power to improve the quality of their lives.\nWe believe that healing from sexual trauma is a series of journeys. We serve as guides assisting the survivor on the next part of their journey, providing them with tools and support, along with an invitation to hope, trust, and embrace their power.\nWe act and advocate with authenticity and integrity by staying true to these core values in all we do.','728145736382163','http://dcrcc.org/counseling/counseling-philosophy/',NULL,'dcrcc@dcrcc.org','Verified','637158405241810','Call to begin an application.',NULL,NULL,NULL,NULL,'819440187923797',NULL,NULL,NULL,'782477248679291',NULL,NULL,NULL),(141,699918289813778,'Returning Citizens Program',NULL,1326157862705937,'The Returning Citizens Program is designed to be a one-Stop Solution for those released from incarceration wanting to be fully and successfully reintegrated into society. The RC Program provides services such as: Pre and Post release services.\n\nService Divisions\nPre-Release\nWe help you start transitioning prior to your release date from incarceration with a comprehensive plan that tackles employment, housing, your mental and physical health, family support, as well as help you gather community resources beneficial to your new style of living.\n\nServices We Provide During This Process Include:\n\nNeeds Assessment\nTransition Planning\nCase Management\nFamily Engagement\nPost Release\nAs the largest Core Mental Health Agency in the District of Columbia, MBIHS is in a unique position to provide a myriad of supportive services under one roof. Under this program and during the Post Release phase, you will have access to the following:\n\nMental & Behavioral Health Services\n\nSubstance Abuse Counseling\n\nPhysical Health Care:\n\nPhysical Health education and engagement\nPhysical Health coordination and referrals\nBenefits Counseling:\n\nWe will help you obtain medical insurance, Identification Cards, Supplemental Security Income/Social Security Disability Insurance (SSI/SSDI), International Development Association (IDA), food stamps, and other types of benefits.\n\nEducation Counseling\n\nEducation Support Placement\nDigital Training\nHousing Opportunities\n\nHousing Counseling- Trained Staff will help you achieve your housing goals\nHousing Placement Support- Collaborative agencies and MBIHS housing wil. laid you in obtaining transitional and permanent housing.\nHousing Advocacy- Supportive staff will advocate for individuals for affordable housing placement and suitable living conditions.\nEmployment Services:\n\nJoin our 30,60, or 90 day track towards getting employed\nJob Readiness, Job coaching, and Job Placement\nSupportive Employment Services\nRehabilitation Services Administration\nIntensive Work Readiness Training:\n\nThe participant will be in customized group settings to familiarize him or her with skills necessary to successfully seek and hold a job that works for him or her. Topics that will be covered include:\n\nThe purpose & function of a Resume\nHow to Prepare a Resume\nHow to Retrieve and Complete an Employment Application\nLearning How to Pass Different Types of Interviews\nPracticing Different Interview Techniques & Skills\nStandard interview & Workplace Attire\nWorkplace Ethics & Rules of Workplace Interaction\nIndividual Employment Plan (IEP)\n\nOur Case managers will assist in developing written pre and post employment plans for the participant to gain a long-term point of view of their job and/or career goal.\n\nBy developing an IEP,  the individual has just enabled the case manager and the job developer to review, discuss, analyze, andHELP him or her gain a more stable and fulfilling career-filled and financially stable lifestyle.\n\nJob Search, Job Placement and Post Placement Assistance\nThe program will provide job placement assistance. Working with an assigned job developer, each participant is guided through the job-search process, learning how to effectively market him or herself, until he or she has secured gainful employment.\n\nFamily Engagement\nCommunity Support Workers will work with the families to assist in making the transition. MBI staff use Family Group Conferencing (FGC) when working with families. Young people need the sense of community, identity and stability that only the family, in its various forms, can provide. Families are more likely than professionals to find solutions, which actively involve other family members, thus keeping the child within the care of the family, rather than transferring care of the child to the state. The key features of the FGC model are preparation, information giving, and private family time, agreeing on the plan, and monitoring and review.','959978038980815','http://www.mbihs.com/what-we-offer/returning-citizens-program',NULL,NULL,'Verified','637158405241810,1232587316936391,929094559121639,789038541797078','Call to join the program.',NULL,NULL,NULL,NULL,'929037191615824',NULL,NULL,'664148755918958','817410769508748',NULL,NULL,NULL),(142,705771849785076,'Homeless Services',NULL,574964812525513,'Services are offered to help people without a home locate affordable housing and avoid homelessness.','947853021041099','http://housingetc.org/',NULL,NULL,'Verified','929094559121639,1077790582995406','Call to schedule an appointment or find out when workshops are taking place.',NULL,NULL,NULL,NULL,'1178055279307047','1172938193660785,1238194930050189',NULL,'877243931325915,966756126649195','1138176448388213',NULL,NULL,NULL),(143,724876636641588,'American Job Center',NULL,1211152552512890,'Provides comprehensive employment, unemployment, resume preparation and training services to residents of the District of Columbia. Provides labor exchange services to employers who are seeking qualified workers and to job seekers.\n\nThe American Job Center, formerly the DC Works! One-Stop Center, offers job-seekers, students, businesses and career professionals access to a comprehensive array of employment-related services and tools in one convenient location. Through the District’s American Job Center, residents can utilize resources such as career counseling, career planning, resume assistance, direct job placement, classroom and on-the-job-training, information about local and national labor markets, unemployment compensation and much more.  The Department of Employment Services, supported with resources from the District government and the US Department of Labor, operates the centers that are strategically located and accessible throughout the District.\n\nWhether looking for a job, facing a career transition, seeking new skills, or you just want a new start, visit the District of Columbia American Job Center, your workforce connection for the following services:\n\nCareer counseling\nJob search assistance\nConnections to employers with current job openings\nWorkshops on topics such as:\nResume Building\nJob search strategies\nInterviewing skills\nComputer Basics\nNavigating DCNetworks\nReferrals to education and training programs (see attachments below)\nApprenticeship information\nLabor Market Information and various career ladders\nAccess to computers, fax machines, telephones and copiers\nGeneral information about Unemployment Insurance\nUnemployment Insurance - Overview\nUnemployment Insurance - Frequently Asked Questions*\n*Please note: The public can file for unemployment compensation benefits at the centers from 8:30 am - 4:00 pm.\n\nThe District of Columbia’s American Job Center network is geared to assist all job-seekers to develop solid career plans that lead to satisfying careers. Planning your job search and developing short and long-term employment goals are central to any good career plan.','614054990318357','https://does.dc.gov/service/american-job-center',NULL,'does@dc.gov','Verified','970915508638448,1077790582995406','You can walk in and file for unemployment at during business hours. Call or walk in for information on all services.\n\nTo be eligible for programs you must be at least 18 years of age, a District resident and meet Workforce Investment Act income requirements.  All residents will be required to submit proof of the following:\n\nProof of Birth    \nProof of Social Security Number\nProof of DC Residency              \nProof of Family Income',NULL,NULL,NULL,NULL,'1186759129130174,875468115344861','1199959158515631',NULL,NULL,'1146287597878979',NULL,NULL,NULL),(144,738209311024775,'Tenant Advocacy',NULL,1116810105858975,'CARECEN acts as a liaison between city agencies and tenants. CARECEN assists tenants in solving housing and health code violations while preventing displacement and abuse. Tenants become familiar with housing laws and regulations and learn how to take advantage of existing laws or advocate for changes in current policies. In many instances, CARECEN facilitates testimonies by tenants before the City Council, DC Courts, and other officials.','547920365968268','http://carecendc.org/direct-services/housing-services/',NULL,'info@carecendc.org','Verified','917725171609009,929094559121639','Walk in or call for services. Some services are by appointment only. ',NULL,NULL,NULL,NULL,'1158694379718344','578888268971743',NULL,'1295679372454826','842193303927915',NULL,NULL,NULL),(145,735696343430795,'Birth Control/Sexual Health ',NULL,1195870505334629,'We provide a range of services to meet all your sexual health and family planning needs!\n\nOur counselors are here to help answer any questions you may have about your reproductive health. You can receive services in a supportive and confidential setting:\n\nPregnancy planning and testing\nBirth control (free IUDs and implants for interested teens and some available same day)\nEmergency contraception\nSexual health education\nConfidential teen visits\nConfidential HIV/AIDS and STI testing and counseling\nHPV vaccine','1090162375763715,1146632771763115,1000709017081839','https://www.communityofhopedc.org/healthcare/wellness-programs',NULL,NULL,NULL,'941516382466411','Call to make an appointment. We accept many health insurances and offer a sliding fee scale and payment plans. A comprehensive list of insurances we accept is available on our website.',NULL,NULL,NULL,NULL,'1279880844015186','1201313382171851,961771055926549',NULL,NULL,'1016957397804274,771726091253980,920259856619905',NULL,NULL,NULL),(146,741770132344686,'Supportive Housing',NULL,883186000200856,'Designed to find and support our clients in housing based on their choice and level of care.','920364967013405,1054369210651155','http://hillcrest-dc.org/services/adult-services/',NULL,'info@hillcrest-dc.org','Verified','929094559121639,637158405241810','Call or walk-in for services.',NULL,NULL,NULL,NULL,'1097440010596926',NULL,NULL,'1263089203668614','646846673243288,1261416234116596',NULL,NULL,NULL),(147,748177592722248,'Pre-Employment Program',NULL,970560028876577,'JSSA offers transition services for students with disabilities (ages 15-22) to help them prepare for success after high school or college. These services include post-secondary program counseling, career assessments, workplace readiness training, and work-based learning opportunities such as internships.\n\nJSSA\'s Specialized Employment services helps teens with autism secure summer jobs at RSVP Pools in Maryland. Internships are available year-round for students with disabilities attending secondary school or college.','977589590864235,946508354826345,1321118518935089','https://www.jssa.org/get-help/specialized-employment/',NULL,NULL,'Verified','970915508638448','Call for more information.',NULL,NULL,NULL,NULL,'1289392147201269,1215754131378315','806655987955880',NULL,'1322383076619129,1152885158441684','863218507660277,1257520076925731,1218692669680880',NULL,NULL,NULL),(148,768961725734908,'East River Family Strengthening Collaborative',NULL,1204249190863211,'Offers case management services including assessments, family visits, school visits, senior meals, youth violence and drug prevention programs, parenting education, and support for grandparents who are caregivers of grandchildren.\n\nCase management\nSenior services\nYouth services\nCrisis intervention\nHousing assistance\nFatherhood support\nLifeskill training\nCommunity engagement\nCapacity building\nTechnical assistance\nParent Education and Support Services\nTruancy\nFinancial Literacy and Tax preparation classes','866160986976618','http://www.erfsc.org/case-management/',NULL,'info@erfsc.org','Verified','637158405241810,929094559121639,878986697513222,1077790582995406,917725171609009','Call for services',NULL,NULL,NULL,NULL,'1228368122652082','1048017825983621,798704743007649',NULL,NULL,'1205097520595212',NULL,NULL,NULL),(149,767255821745825,'Early Childhood Services',NULL,970560028876577,'JSSA’s early childhood services include:\n\n- Psychosocial evaluation and functional assessments\n- Counseling for children and their sibling(s)\n- Neuropsychological , psychological and psychoeducational testing\n- Age-appropriate social skills therapy groups\n- Support groups and parenting workshops\n- Skill development for managing challenging behaviors\n- Counseling for children with special needs (including autism, Asperger’s and other pervasive developmental disorders)\n- Consultation services for early childhood professionals','977589590864235,1321118518935089','https://www.jssa.org/get-help/children-and-adolescents/early-childhood-services/',NULL,NULL,'Verified','637158405241810','Call for services.',NULL,NULL,NULL,NULL,'815545569707089,1047807433568619','1094678156609302,1113885469544387,573957674876281,773649767743777',NULL,'586981821517675,1274396898894043','863218507660277,1218692669680880',NULL,NULL,NULL),(150,774338968156105,'LGBTQ Health Program',NULL,887352348953420,'La Clínica operates two sites and safe spaces called ‘Empodérate Centers’. Our program is the only comprehensive, bilingual HIV prevention program that targets Latino men who have sex with men and transgender Latinas in the Washington, D.C. Metropolitan Area. Historically, LGBTQ individuals have been among the most impacted by HIV within the local Latino community. La Clínica addresses this issue by tackling the underlying causes of the epidemic, including stigma, isolation, depression, and the lack of safe and substance/alcohol-free spaces for immigrants that frequently face rejection from families and communities due to homophobia, transphobia, and socioeconomic and immigration status.','868710877316469','https://lcdp.org/_en/programs-community-health-action.html',NULL,NULL,'Verified','941516382466411',NULL,NULL,NULL,NULL,NULL,'887062299451299','1136144186376874',NULL,'625195015492370,1186681173947755','1214063268443455',NULL,NULL,NULL),(151,772580143837637,'Integrated Health',NULL,976379482380679,'As Pathways to Housing DC has evolved over the past fifteen years, so too has the national landscape of healthcare services. Individuals served by the public mental health system are dying, on average, 25 years earlier than the general population. This is largely due to chronic health conditions such as diabetes, hypertension, cancers, and other obesity- and smoking-related diseases. These illnesses are worsened by years of malnutrition, living out in the harsh elements, and limited access to preventive health care. Pathways to Housing DC originated as a mental health and substance abuse provider. We have grown our partnerships with primary care providers and other local nonprofits over the past few years, recognizing that physical health and mental health are inextricably linked. We are committed to growing life expectancy and improving the health of the individuals we serve.\n\nTimely access to healthcare and health education greatly impact an individual’s ability to recover, live longer, and maintain a healthy lifestyle. We currently provide integrated mental health and primary care services to all Pathways clients through an on-site, walk-in clinic via our partnership with Unity Health Care (the District’s largest Federally Qualified Health Center). The program has impacted the lives of the people we serve by increasing their awareness of, and adherence to, healthy behaviors and independence in managing their healthcare needs. We have seen an increase in the number of preventive care visits, a decrease in emergency department visits, an increase in the percentage of clients linked to primary care providers, an increase in adherence to diabetes management and regular lab work for clients with diabetes and pre-diabetes, an increase in adherence to follow-up medical appointments and medication, an increase in healthy eating, an increase in social support and a decrease in substance use.\n\nUltimately, our goal is to ensure that the people we serve are empowered and able to live longer, healthier and more hopeful lives.','743353111808252','https://pathwaystohousingdc.org/what-we-do/integrated-health/',NULL,NULL,'Verified','941516382466411','Call to make an appointment. This is provided through a partnership with Unity Health.',NULL,NULL,NULL,NULL,'972386234094039','1281502720636268',NULL,'877243931325915','1137409735223363',NULL,NULL,NULL),(152,777481511640778,'DC Healthy Start',NULL,922709314921881,'DC Healthy Start is a program for the residents of the District of Columbia that provides support and referrals for services and resources for all women, parents and infants up to 2 years of age. DC Healthy Start is a federally funded program under the Health Resources and Service Administration (HRSA) that aims to improve birth outcomes for infants and women of child bearing age. Healthy Start’s overall goals are to reduce differences in access to health services, improve the quality of the local health care system, empower women and their families and increase community participation in health care decisions. \n\nWhat kind of services can I receive through DC Healthy Start? \n\n Care Coordination/Case Management Services\n Reproductive Life Planning\n Health Education\n Health and Wellness Screenings\n Centering Pregnancy Sessions\n Breastfeeding Support\n Parenting Classes• Male Support Services for Parenting Fathers','659628565110513','https://dchealth.dc.gov/service/dc-healthy-start',NULL,'dchealthystart@dc.gov','Verified','941516382466411','Call or email to apply.',NULL,NULL,NULL,NULL,'1256399030177407','910273761873267',NULL,'1244783161808236','1225625601966457',NULL,NULL,NULL),(153,777479494055010,'Legal Network',NULL,1331447374298751,'For 30 years, the Catholic Charities Legal Network has provided pro bono legal services, giving persons accessing this program general information, access to volunteer attorneys and law firms, as well as referrals to other appropriate legal service organizations.\n\n*The Legal Network does not handle Criminal, Fee-Generating or Immigration Cases. Find more information on Immigration Legal Services.\n\nSERVICES\nThe Catholic Charities Legal Network focuses on serving low-income families and individuals whose earnings are equal to or less than 200% of the U.S. Federal Poverty Guidelines. The Catholic Charities Legal Network offers its services to residents of the District of Columbia and surrounding Maryland counties of Montgomery, Prince George’s, Calvert, Charles, and St. Mary’s. Civil law subject areas this program addresses are:\n\nConsumer Debt/Bankruptcy\nEmployment\nFamily Law (including Child Custody and Domestic Violence)\nLandlord-Tenant/Housing Issues\nPublic Benefits (Social Security, Disability)\nWills and Probate, Guardianship and Conservatorship\n','546085340417620','https://www.catholiccharitiesdc.org/gethelp/legal-and-financial-services/',NULL,NULL,'Verified','917725171609009','Call for intake.',NULL,NULL,NULL,NULL,'637096323626057','1150084771473447,1080167812313489',NULL,NULL,'1072933446361784',NULL,NULL,NULL),(154,714211448512130,'Online Employment Resources',NULL,810479025131545,'An online group of resources offering information on various employment services around DC.',NULL,'https://www.hips.org/employment-resources.html',NULL,NULL,'Verified','970915508638448','Visit website to check out the resources.',NULL,NULL,NULL,NULL,'1174880928735577,878348692886905',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(155,718050681265809,'Domestic Violence',NULL,820488001755900,'For victims of domestic violence:\n\nNLSP can help obtain a Civil Protection Order (CPO). This will prohibit your abuser from harassing you.\nNOTE: NLSP assists victims of domestic violence or trafficking without regard to immigration status. We will not consider the income of the abuser when determining eligibility for services.\n\nDo you need help now?\n\nWhen you are ready to get legal help, call 202-832-NLSP during our intake hours. If you need assistance outside of NLSP’s business hours, you can use the following resources:\n\nYour first priority is your immediate safety. If you are in immediate danger, call 911.\n\nHouse of Ruth provides a 24-hour shelter/safe place for battered women and their children with support groups and other resources for recovery. However, their intake hours are limited, so please contact them by phone at 202-667-7001 ext. 320. The administrative office of House of Ruth is located at 5 Thomas Circle, NW, Washington, DC 20005.\n\nIf you want to talk to someone about what you\'re going through, My Sister’s Place offers a confidential 24-Hour hotline: (202) 529-5991.','931728525653879,1053529725692782,647497712481280','http://www.nlsp.org/services/domestic-violence',NULL,NULL,'Verified','917725171609009','Call or walk in during intake hours for an intake. Income eligibility guidelines (http://www.nlsp.org/eligibility) may be flexible on a case by case basis.',NULL,NULL,NULL,NULL,'1129255270268768','1084017663290159,1199926477647156',NULL,'868012483124236,740778097678832,1304855358240586,1212718840001878','669385991599023,762902046422581,1290871308678350',NULL,NULL,NULL),(156,721115353360225,'Day Treatment Program',NULL,1326157862705937,' Do You Have an Issue With:\n\nAnger Management\nIrritability\nDepression\nSocializing\nIsolation\nRacing Thoughts\nNutrition and Health\nSelf-Esteem\nParenting\nDomestic Conflicts\nTrauma\nMBI Health Services’ Day Treatment Program offers a structured clinical program that focuses on developing positive mental, behavioral, and physical skills through a range of social, psycho-educational, behavioral, and cognitive mental health interventions. This program is designed to have a curriculum that assists our patients in the restoration of independent and community living skills, strengthening appropriate socialization skills, as well as teaching our patients on learning how to adapt to his or her ever-changing surroundings. \n\nA few of our services offered at the Day Treatment Program Include:\n\nTherapeutic Group Counseling\nIndividual Group Counseling\nCommunity Support\nMedication Management\nReferral to wrap around services\nTransportation Stipend\nHot Breakfast and Lunch\nHousing Assistance\nEmployment Services','959978038980815','http://www.mbihs.com/what-we-offer/day-treatment-program',NULL,NULL,'Verified','637158405241810','Call to join the program.',NULL,NULL,NULL,NULL,'929037191615824',NULL,NULL,NULL,'817410769508748',NULL,NULL,NULL),(157,723134469644452,'VillageRides',NULL,855094084464049,'VillageRides supports neighborhood volunteer transportation for seniors and adults with disabilities who do not drive and live within areas served by participating villages and community organizations in Montgomery County and Prince George’s County.','924628911683577','https://accessjca.org/villagerides/',NULL,'https://accessjca.org/villagerides/VillageRides@AccessJCA.org','Verified','632609508449013','If you need a volunteer ride for yourself or are a caregiver, family member or a neighbor of a senior citizen who needs transportation services and lives in one of our partnering community organizations, you can connect directly to them by clicking on their logos on our website or by calling VillageRides at 301.255.4212 for more information.\n\nIf you are looking for transportation options for a senior who does not live in the areas served by VillageRides, please call Connect-A-Ride at 301.738.3252.\n\nWe are always seeking new volunteer drivers. Call VillageRides at 301.255.4212 for more information.',NULL,NULL,NULL,NULL,'1268373072226461','1276016050822057',NULL,'854808174954754','1050035692418764',NULL,NULL,NULL),(158,727116699390008,'Dental',NULL,840733417398800,'We keep smiles picture perfect! The friendly dentists and support staff at our state-of-the-art dental offices provide care for the whole family. Equipped with brand new, top-of-the-line tools, our skilled team takes great care with each patient and helps make sure your oral health is in excellent shape. Our highly trained staff care for all ages through a variety of services including:  \n\nAdults and Seniors  \nPreventive care: X-rays, cleanings, fluoride varnish, and oral hygiene instructions  \nRestorative care:  Fillings, extractions, crowns, bridges, anterior root canals, and more  \nRemovable care:  We make complete and partial dentures  \nTeeth whitening:  A bleaching tray will be made, and bleaching material provided \nChildren and Teens   \nPreventive care: X-rays (over 6 years old), cleanings, fluoride varnish, oral hygiene instructions, and sealants  \nRestorative care:  Fillings, extractions, and stainless-steel crowns  \nReferrals to orthodontist  ','964869638930274,629348329513757','https://www.maryscenter.org/dental/',NULL,NULL,NULL,'941516382466411','Call to make an appointment. We accept most insurance plans including Medicaid and Medicare. If you don’t have health insurance, we’ll help you apply for public benefits or provide care at a discount. Comprehensive list of insurances are available on our website.',NULL,NULL,NULL,NULL,'609237693650331,1301804131597006','644550844370242,1059813935264051',NULL,'670413521970743','962742212670581,732086812000340',NULL,NULL,NULL),(159,725916932978557,'D.C. DEPARTMENT OF CONSUMER AND REGULATORY AFFAIRS (D.C.RA): BUILDING AND LAND REGULATION ADMINISTRATION',NULL,1213058378158421,'Regulates all building and land use within the District of Columbia to ensure safety and conformity to local and federal laws and regulations. Manages permit processing, building inspection, and zoning program; covering new construction, alterations and repairs.','1298013609220199','http://dcra.dc.gov/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'912991375068271',NULL,NULL,NULL),(160,733244062080278,'Substance Abuse Treatment',NULL,964008795352849,'Regional Addiction Prevention (RAP), Inc. uses the therapeutic community (TC) approach to substance abuse treatment. We offer drug and alcohol-free residential settings that use the influence of the community consisting of treatment staff and those in recovery, as key agents of change.\n\nIn addition to using the concept of community as treatment method, the TC employs the principle of “self-help.” Self-help implies that the individuals in treatment are the main contributors to the change process. “Mutual self-help” means that individuals also assume partial responsibility for the recovery of their peers – an important aspect of an individual’s own treatment. The stages of treatment reflect increased levels of personal and social responsibility. We use a variety of group processes to help individuals learn and assimilate social values and develop more effective social skills.\n\nOur TC is centered on cultural values. Recognizing that a client’s culture is an inseparable part of his or her self-image, we provide clients information to combat what Dr. Carter G. Woodson* described as the “mis-education” that has shaped their lives. This information is vital in helping clients to clarify who they are and to place themselves as worthy citizens. Our cultural teaching is based on respect and support of all individuals and their communities.\n\n*Dr. Carter G. Woodson created what we now know as African American History Month. He believed that African Americans should know their past in order to participate intelligently in their future.','803526594539754','http://www.rapinc.org/substance.html',NULL,NULL,'Verified','941516382466411,637158405241810','Call to make an appointment.',NULL,NULL,NULL,NULL,'747827439705313','1206135641605542,1203598271271102',NULL,'664148755918958,780785826421817,915486946336080','601647045974328',NULL,NULL,NULL),(161,734280780069484,'Health & Wellness',NULL,1186080684764999,'The Wellness Center at N Street Village offers integrated mental health, physical health, and addiction recovery services to homeless and low-income women. Our program offerings take a holistic approach to wellness-  addressing the mind, body, and spirit. Thanks to program partnerships, and dedicated volunteers including client alumna, we offer a full spectrum of daily wellness programs that promote health education, physical fitness, and holistic well-being.\n\nPhysical Health\nIn partnership with Unity Health Care, we have onsite primary health care and dental clinics. In addition, we have Village staff, volunteers and other partnerships which provide services and support groups for women coping with HIV/AIDS, addiction, trauma and other challenges.  We offer daily classes – from Yoga and Aerobics to Smoking Cessation and Diabetes prevention.\n\nMental Health\nWe provide women with mental health education, support groups, crisis intervention assistance, and referral services. In partnership with Mary’s Center, we offer weekly individual therapy and psychiatric services. We also offer a variety of mental health promotion and holistic wellness classes like anger management, meditation, massage, and trauma recovery support programs.\n\nIn addition, we have a full offering of arts classes from open studio to an acting program in partnership with Theatre Lab. Women can also express themselves through written word in our autobiography, journaling, and poetry classes.\n','1186014650404910','https://www.nstreetvillage.org/about-the-village/programs-impact/health-wellness/',NULL,NULL,'Verified','941516382466411','We encourage you to attend a WELCOME SESSION Monday-Friday at 9:15 am at the N Street Village Day Center (1333 N St. NW) where we will review housing options, tour the Village Day Center, and refer to outside resources as needed.\n\nPlease call to make an appointment. Appointments are on a first-come first-served basis. Clinic hours are only offered Tuesdays and Thursdays from 9:00am to 12:00pm.\n\nN Street Village serves adult women 18 years old and over and individuals that identify as transgender. If you are seeking family services, please call Virginia Willams Center at (202) 526-0017 Monday-Thursday from 8:00am-4:30pm.',NULL,NULL,NULL,NULL,'876749748721110,1260394353602193','733422375074097',NULL,'836091364973509,877243931325915','929144501518325',NULL,NULL,NULL),(162,739078424499970,'Health for Heroes (Active Duty & Veterans)',NULL,840733417398800,'Mary’s Center is grateful for your service and we want to help you protect your health. We have been providing healthcare, education, and social services for over 30 years and are honored to offer high-quality care to the many active duty military members, veterans, and reservists in our community. When you visit Mary’s Center, you and your family can expect access to comprehensive care including:  \n\nMedical services such as:\nAnnual physicals, check-ups, and immunizations \nHealth screenings for chronic conditions (cancer screenings available based on your personal risk) \nTreatment and management of acute and chronic conditions \nSick visits \nHIV prevention and care \nInfectious disease care\nCleanings and screenings \nCrowns and bridges \nExtractions, fillings, and sealants\nBehavioral Health services such as:\nTherapy for trauma, depression, anxiety, and other illnesses \nPsychiatric evaluations and care coordination \nSubstance abuse treatment \nEarly childhood behavioral health treatment \nWe also offer a wide variety of family support services including: \nHome Visiting and Care Coordination \nInsurance enrollment assistance ','1282458965799792,964869638930274,629348329513757','https://www.maryscenter.org/medical/other-specialties-and-services/health-for-heroes/',NULL,NULL,NULL,'941516382466411','Call to make an appointment. We accept most insurance plans including Medicaid and Medicare. If you don’t have health insurance, we’ll help you apply for public benefits or provide care at a discount. Comprehensive list of insurances are available on our website.',NULL,NULL,NULL,NULL,'1301804131597006,1263593198567823,603473645503739','1166531381919312,1070408158016466,575613458279114,973584384940208,669960004909347',NULL,'1260550501779199,1135008555245828','903265014608550,962742212670581,732086812000340',NULL,NULL,NULL),(163,743182672086208,'Laboratory Services',NULL,605134586578120,'Our certified technician works with our providers to collect blood, fluids, and tissue samples which are used in a variety of comprehensive testing to detect diseases, and monitor treatment in the management of patient care.','770635363010046,1002753920993717','http://eechealth.com/our-services/',NULL,NULL,'Verified','941516382466411','Call for patient intake. If you are already a patient, call to set up an appointment.',NULL,NULL,NULL,NULL,'1198488947117166,877271835912480','761526422726808,895454221155573,951328657288514,776932249812148,1321570127371250,777400646901906,619611122248463,1106120630749215',NULL,NULL,'651804021834110,1128987918758522',NULL,NULL,NULL),(164,754621632893339,'Ready2Cook',NULL,726173106231202,'Ready2Cook offers two options for culinary-minded students: \n\nMission Muffins\nMission Muffins is a bakery run by homeless employees, who bake, market, sell and deliver delicious baked goods. Employees are paid and live at the Mission; they receive training for bakery work and business management.  Read More>\n\nVisit our Mission Muffins website to view our menu and order products or download the Mission Muffins Brochure.\n\nCulinary Job Training Program\nStudents can also participate in the Culinary Job Training Program, sponsored in partnership with DC Central Kitchen. Graduates gain valuable kitchen skills required for cooking jobs as well as soft skills necessary to be successful in the workplace.','1154195373907801','https://www.missiondc.org/what-we-do/mens-ministry/workforce/',NULL,NULL,'Verified','970915508638448','Call for more information. This program is offered to men at the shelter.',NULL,NULL,NULL,NULL,'842965887033119','642319256352941',NULL,'1319255723578292,800545996069324,625195015492370,877243931325915','585594366267961',NULL,NULL,NULL),(165,757050460311671,'Housing Services Program',NULL,577764298046742,'Our Housing Services Program provides stable living arrangements for young people experiencing homelessness or at risk of losing their homes. Our array of services accommodate people with various needs, from shelter for a night, to more stable housing, including subsidized rent for up to 6 months. In addition to our shelters, we provide case management for our clients, including advice on other available resources and assistance in meeting other needs.','572381295862246','https://casaruby.org/our-services/#hiv',NULL,NULL,'Verified','929094559121639','Call or walk in for more information.\n',NULL,NULL,NULL,NULL,'937785373035309','605106466070807,872554493521158','599621071767378','1200832408072169,605403471620978','603292299584681',NULL,NULL,NULL),(166,757455042685009,'Appellate Advocacy',NULL,1091757696945828,'Established in 2004 with seed money from the DC Bar Foundation, which continues to provide generous support, Legal Aid’s Appellate Project has become a “model of excellence” that the National Legal Aid and Defender Association has urged other legal services programs to emulate. The Project was named for its founding Director, Barbara McDowell, after her untimely death.\n\nThe Project not only litigates appeals on behalf of Legal Aid clients but also files “friend of the court” briefs on cases involving matters of importance to people living in poverty. Beyond litigation, the Project provides appellate instruction, consultation, and advice to the larger D.C. legal services community. Although most of the Project’s work involves cases before the District’s highest court – the District of Columbia Court of Appeals – the Project also gets involved in administrative appeals and cases before the District of Columbia Superior Court and the federal courts.\n\nLearn more about Barbara McDowell, the renowned appellate litigator and U.S. Supreme Court advocate who served as the project’s first director and after whom our appellate advocacy project is named.\n\nAfter Barbara’s untimely death, Legal Aid created the Barbara McDowell Endowment Fund for Appellate Litigation with funds donated both from Barbara’s estate and from the generous donations of her husband, Jerry Hartman. The Fund was created “to honor the immeasurable contributions that Barbara made to Legal Aid and the legal needs of persons living in poverty in the District of Columbia.” Jerry has continued to donate generously in Barbara’s honor to the Fund to sustain the ongoing, important work of The Barbara McDowell Appellate Advocacy Project. Jerry also founded The Barbara McDowell and Gerald S. Hartman Foundation, which supports organizations that undertake systemic litigation on behalf of disadvantaged persons and groups throughout the United States.','768639914164498,1052799655566995','https://www.legalaiddc.org/appellate-advocacy/',NULL,NULL,'Verified','917725171609009','You can apply online or utilize walk-in intake hours. Call for more information.',NULL,NULL,NULL,NULL,'1289374770713295,1234325977097951','871092289270509,1035182743655741,1155614982637715',NULL,NULL,'635267247673749,1157364802959844',NULL,NULL,NULL),(167,771378282180941,'Short-term Living Program',NULL,577764298046742,'This free service is for LGBT youth between the ages of 18 and 24 years old, and guarantees stable housing and support services for 3 to 6 months, with the purpose of helping clients transition into more permanent housing.','572381295862246','https://casaruby.org/our-services/#hiv',NULL,NULL,'Verified','929094559121639','Call or walk in for more information.\n',NULL,NULL,NULL,NULL,'937785373035309','605106466070807,872554493521158','599621071767378','1200832408072169,605403471620978,1222973168897685','603292299584681',NULL,NULL,NULL),(168,777108871381104,'SOME: SHALOM HOUSE',NULL,1319047892616905,'Offers affordable, housing for adults transitioning from homelessness to independent living. Residents pay 30% of their income as rent, participate in regular house meetings and maintain their health and sobriety.','1261924735850333','http://some.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1320872330999559',NULL,NULL,NULL),(169,780601488413554,'D.C. DEPARTMENT OF BEHAVIORAL HEALTH (DBH): SUBSTANCE USE DISORDER SERVICES: WARDS FIVE AND SIX PREVENTION CENTER',NULL,1276788103667282,'The Department Of Behavioral Health (DBH): Substance Use Disorder Services provides four Prevention Centers to provide substance use disorder services including detoxification, residential and outpatient services based on the level of need. It also provides a range of prevention and recovery services.','1185866432124387','http://dbh.dc.gov',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'626337120120757',NULL,NULL,NULL),(170,787765929715080,'Home$mart Post-purchase Education',NULL,855802893163707,'First-time homeowners can face many challenges during the first few years in their new home, but with the right resources and education, they can surmount these obstacles successfully. We’re arming DC homeowners with the tools and knowledge they need to navigate all the ups and downs of homeownership. Our Home$mart post-purchase classes help new homeowners tackle the challenges that can arise in the first few years of homeownership and beyond. These classes are for current homeowners looking for knowledge and resources to help them be successful homeowners. Additionally, these classes can be counted toward sweat equity hours for families that are already owners of DC Habitat homes.  \n\nOur first class series, “Life After Settlement,” focuses on what to do after you’ve closed on your home to prepare for the future. Over the course of this series, you’ll learn what’s in those mortgage documents, home maintenance and repairs, how to create a S.M.A.R.T. budget and save, how to prevent mortgage delinquency and foreclosure, how to go green and do-it-yourself, and what good credit looks like and how you can get it.','884179044911706','https://dchabitat.org/housing-services/homesmart-post-purchase-education/',NULL,NULL,'Verified','789038541797078,929094559121639','Sign up for the course online.',NULL,NULL,NULL,NULL,'1093912479911840','1140008964398815',NULL,'1294818681778567,868012483124236','1098238485894342',NULL,NULL,NULL),(171,786302163414865,'Neighborhood Community Centers',NULL,919690199169575,'Community centers providing:\n- Referrals to community resources\n- Meal distribution\n- Group counseling\n- Case management\n- Tutoring\n- Mentoring\n- Out of school programs\n- School readiness\n- School supplies\n- Early childhood education\n- Literacy\n- ESL\n- Workforce readiness\n\nOur community centers are places where residents of all ages connect with their neighbors, learn to lead, and make changes that strengthen the community where their families live.\n\nWe engage adults and youth in community programming, leadership development activities, and social and educational opportunities. ​With our community partners, we provide resources for learning, mentorship, and health screenings to community residents.\n','928012146500435,1246140596600748','http://www.ucmagency.org/neighborhood-community-centers.html',NULL,NULL,'Verified','789038541797078,911225335803318,637158405241810,941516382466411','Call for more information or walk in. Time and application process will vary by service.',NULL,NULL,NULL,NULL,'676690284227155,746366368083217','554058492941520,1120594852165211,826011901306447,1232282827720859',NULL,'883345659611536,1292849277583603,915486946336080,1274396898894043','1126520692919525,890837741306671',NULL,NULL,NULL),(172,794527613963060,'Clothing Closet',NULL,706476638607137,'Offers a clothing closet to DC residents in need of clothing. Must bring own bags.','692842183271323','https://www.brighterdaydc.org/',NULL,NULL,'Verified','911225335803318','Walk in.',NULL,NULL,NULL,NULL,'919075870505440','900620545310091',NULL,'868012483124236,1274524177531453','915998507127869',NULL,NULL,NULL),(173,730763164086236,'Home Delivered Meals',NULL,1219589148672769,'Monday through Saturday, Food & Friends delivers nutritionally-tailored, delicious meals directly to our clients’ homes. Each delivery includes food for breakfast, lunch and dinner, along with liquid nutritional supplements, as needed. Our community dietitians and professional chefs work closely to provide individualized services to our clients. Food & Friends offers 11 specialized meal plans to meet our clients’ nutritional needs.','857875532631251','https://foodandfriends.org/about-us/#services-we-provide',NULL,NULL,'Verified','832990803111047',NULL,NULL,NULL,NULL,NULL,'1239494728678928,1133561368089400','857395816743172,884617333624034',NULL,NULL,'1251720034767684',NULL,NULL,NULL),(174,748118421956392,'\"DEAF AND HEARING OUTREACH CENTER, FAMILY MATTER OF GREATER WASHINGTON\"',NULL,NULL,'Provides Deaf & Hard of Hearing services','1295023062659721','http://familymattersdc.org/services/deaf-and-hard-of-hearing/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'621335851884833',NULL,NULL,NULL),(175,747822750998769,'Chronic Disease Management ',NULL,1195870505334629,'We help you manage your health, so that you can lead a healthy lifestyle.\n\nPersonalized health goals and care plans\nAccess to a care coordinator to assist with education and specialty care appointments\nAssistance with overcoming transportation, language, medication/supplies and other barriers to getting the care you need\nGroup care and referrals for support to manage stress and change\nWe teach you about disease prevention, healthy lifestyles and other self-care activities.','1090162375763715,1146632771763115,1000709017081839','https://www.communityofhopedc.org/healthcare/wellness-programs',NULL,NULL,NULL,'941516382466411','Call to make an appointment. We accept many health insurances and offer a sliding fee scale and payment plans. A comprehensive list of insurances we accept is available on our website.',NULL,NULL,NULL,NULL,'1279880844015186,763524779006557,665495770462606','1201313382171851,961771055926549,1133644382136224,849922591487683,774772066237737,1257079363804425,1223815259564202,1305096827911095',NULL,NULL,'1016957397804274,771726091253980,920259856619905',NULL,NULL,NULL),(176,750164217924618,'Comfort Care',NULL,1195280864464976,'For those who are nearing the end of life and are no longer interested in curative or life-prolonging care, we offer Comfort Care. The goal of Comfort Care is to make the person’s last days (which may be several days or many months) as comfortable as possible. This includes addressing their physical, emotional, social, and spiritual needs as they make their transition. We also offer grief support for family members.','814720878521693','https://www.stoddardbaptistglobal.org/our-services/comfort-care/',NULL,NULL,'Verified','941516382466411','Call for information.',NULL,NULL,NULL,NULL,'1257614234179117',NULL,NULL,'854808174954754','1230684095904498',NULL,NULL,NULL),(177,754669198968415,'Health at Home',NULL,840733417398800,'Get the care you need when you need it most. When coming to the clinic is a challenge, Mary’s Center “Health at Home” telemedicine program quickly connects you to a caring medical provider in a matter of moments, saving you precious time and energy at a time when you’re not feeling your best.  \n\nThe Health at Home program currently serves patients with plans through the following Medicaid Managed Care Organizations: \n\nAmeriHealth Caritas DC \nTrusted Health Plan \nAmerigroup DC   \nBy harnessing the power of technology, a Mary’s Center home visitor will come to your home and connect you to your Mary’s Center provider through a live video on a laptop computer. The home visitor will bring everything they need to connect, including a computer, Wi-Fi internet access, and medications.  \n\nRegular management and follow-up of chronic conditions results in improved health. Our Health at Home team and our providers actively reach out to patients who may qualify for the program.  If you believe you may be a good fit for the “Health at Home” program but haven’t heard from our team or talked with your provider, please don’t hesitate to reach out to us.  \n',NULL,'https://www.maryscenter.org/medical/other-specialties-and-services/health-at-home/',NULL,'healthathome@maryscenter.org',NULL,'941516382466411','Call to make an appointment. We accept most insurance plans including Medicaid and Medicare. If you don’t have health insurance, we’ll help you apply for public benefits or provide care at a discount. Comprehensive list of insurances are available on our website.',NULL,NULL,NULL,NULL,'976451647500271,1301804131597006',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(178,758846747979067,'DC Prevention Center',NULL,1306699628219808,'The DC Prevention Center for Wards 5 & 6 is a collaborative venture in conjunction with the Department of Health (DOH), Addiction Prevention and Recovery Administration (APRA), and Sasha Bruce Youthwork. Our vision is to support a healthy and drug free District of Columbia where all children are safe, drug free and connected and supported by a network of caring families, community organizations, and faith based organizations. As we identify prevalent risk factors within Wards 5 & 6, it will be important to engage in community conversations and trainings that will help to develop and sustain an infrastructure of community leadership.\n\nWe also offer and host:\n• Structured trainings and workshops that will increase community knowledge, skills, and awareness of substance abuse trends and indicators\n• Community Conversations on underage drinking, so-called gateway drugs and risk & protective factors','1083708956779513','https://www.sashabruce.org/programs/lifeskills/preventioncenter/',NULL,'cdark@sashabruce.org','Verified','637158405241810','Call, walk in, or email to access this program. ',NULL,NULL,NULL,NULL,'742520224803831','882054301651193',NULL,NULL,'626337120120757',NULL,NULL,NULL),(179,761018228722418,'Permanent Supportive Housing',NULL,1186080684764999,'Permanent Supportive Housing at our flagship location provides affordable housing with embedded services to 44 individuals who are coping with mental health issues, addiction, trauma, physical health problems or other issues which require support to help them remain stably housed. Residents live in studio or shared apartments, and enjoy social and therapeutic activities provided by the Village. ','1186014650404910','https://www.nstreetvillage.org/about-the-village/programs-impact/housing-community/',NULL,NULL,'Verified','929094559121639,637158405241810','We encourage you to attend a WELCOME SESSION Monday-Friday at 9:15 am at the N Street Village Day Center (1333 N St. NW) where we will review housing options, tour the Village Day Center, and refer to outside resources as needed.\n\nFor N Street Village Affordable Housing, please contact WC Smith at (202) 319-9100.\n\nFor Immediate Shelter, go to our Patricia Handy Place for Women at 810 5th St NW between 4:00-7:00pm daily. Limited availability; beds are assigned on first-come, first-serve basis.\n\nN Street Village serves adult women 18 years old and over and individuals that identify as transgender. If you are seeking family services, please call Virginia Willams Center at (202) 526-0017 Monday-Thursday from 8:00am-4:30pm.\n\nFor emergencies or if you see someone in need, please call the Shelter Hotline (202) 399-7093 or 911.',NULL,NULL,NULL,NULL,'876749748721110,1260394353602193','587111670709851',NULL,'836091364973509,877243931325915','929144501518325',NULL,NULL,NULL),(180,765387458092097,'Housing',NULL,1287130751059247,'Calvary provides transitional and permanent supportive housing services that enable women to make lasting changes in their lives.\n\nWe provide women with basic services and nutritious meals at our facility, allowing them to focus on healing, building their skills, and building their futures.\n\nOur Sister Circle program offers permanent supportive housing services to women who live independently, but still receive long-term assistance. Sister Circle fosters a close-knit community of peer support and sisterhood.','1315826372203677','https://www.calvaryservices.org/program/housing/',NULL,NULL,'Verified','929094559121639','To access our services, you must first receive a referral from a core service agency. If they match you with our organization, you will be sent over for an intake. If you have additional questions, please call.',NULL,NULL,NULL,NULL,'1285405208459287','890039510897571',NULL,'836091364973509,877243931325915,1212718840001878','926608893625888',NULL,NULL,NULL),(181,767682966554088,'Food and Nutrition Support',NULL,840733417398800,'A balanced diet plays a big part in building a healthy body, but we know it can be hard to get the right kind of foods for you and your family. In addition to nutrition counseling, Mary’s Center is an official site for the federally-funded Women, Infants, and Children  (WIC) program and Supplemental Nutrition Assistance Program Education (SNAP-Ed), Mary’s Center connects you to the nutrition resources and services available in our community and puts healthy food at your family’s fingertips.  \n','964869638930274,629348329513757','https://www.maryscenter.org/social-services/referrals-and-resources/food-and-nutrition-assistance/',NULL,NULL,NULL,'637158405241810','Mary’s Center is ready to partner with you on your health journey. Don’t hesitate to reach out to us using the information below: \n\nTo learn more about WIC or make a WIC application appointment, call (202) 232-6679  \n\n*A fourth DC WIC site can be found at Adventure Dental located at 1060 Brentwood Road NE',NULL,NULL,NULL,NULL,'1286112501247852','1134877289644712,827996522503929,601427652072887',NULL,NULL,'962742212670581,732086812000340',NULL,NULL,NULL),(182,775356580769657,'Monitoring',NULL,744812603775568,'Quality Trust was created to serve as an independent monitoring organization to ensure services to and for people with developmental disabilities are responsive to the needs of each person receiving services in DC. Quality Trust monitors visit people where they live and spend their days. Our activities includes individual program monitoring, follow up on abuse, neglect and personal thefts incidents, environmental site visits, regular reporting of data collected, trending and tracking of different types of critical events (e.g., hospitalizations, nursing home placements, deaths, etc.) and technical support to providers. Quality Trust’s Monitoring Team includes a monitoring coordinator, four monitoring specialists, and a registered nurse with over 50 years of combined experience supporting and working with people with developmental disabilities. All people monitored are personally interviewed to ensure the assessment reflects what is most important to and for each person. The goal of our assessment is to collect data and ensure that required supports are in place.','1185969381076176','https://www.dcqualitytrust.org/advocates/monitoring/',NULL,'jlethbridge@dcqualitytrust.org.org','Verified','637158405241810','Call for more info on monitoring services.',NULL,NULL,NULL,NULL,'759133304767858','655204523101840','866390871990408','1292849277583603,891868766081123','1262646425320757',NULL,NULL,NULL),(183,780286718217610,'Social Services',NULL,1168436736852155,'The participants of Vida Senior Centers are mostly first-generation Hispanics, who throughout their lives accumulated little pension and few social benefits, either because they were late to the United States or because their salaries were always low In any case, the majority of VIDA participants are below the poverty line. And being a poor older adult in Washington DC is a huge challenge, largely because of the price of rentals in the city. In addition, Hispanic older adults never knew about the social benefits offered by the federal or city government, and even when they know there is some benefit, it is difficult for them to apply for the benefit because they cannot read the documents that They explain the benefits, cannot fill out the forms, or do not know how to follow those procedures. To face this tangle of procedures, Vida has a Social Services Counselor. All participants of Vida Senior Centers receive help from our counselors to apply for affordable housing, transportation and social benefits for programs that benefit older adults. With regard to immigration procedures, VIDA not only helps participants to start and follow-up on their migration processes, but also offers a weekly “Citizenship Class” in which participants are prepared to take the Citizenship exam. We also connect them with the agencies that help them file their taxes and file legal procedures, if necessary. Likewise, VIDA is an official distributor of boxes of the Food Bank, and with this it helps to identify older adults at greater risk. So, in summary, when it comes to social services:\n\n• Home Application Procedures\n• Migratory processes\n• Preparation for the Citizenship Exam\n• Application for transportation benefits\n• Legal and employment services\n• Procedures for cell phone subsidy\n• Tax return\n• Contact them with adult service agencies','646558365152210,632725434790464','http://box2142.temp.domains/~vidasen1/social-services/',NULL,NULL,'Verified','637158405241810,917725171609009','Call to join the center.',NULL,NULL,NULL,NULL,'1147869714969920','592146566922528',NULL,'1295679372454826,854808174954754','990219526768898,620565499902964',NULL,NULL,NULL),(184,784062651801689,'Medical Assistant Job Training',NULL,840733417398800,'Train to be a Medical Assistant! Briya Public Charter School offers a Medical Assistant training program. The 12-15 month program prepares you for a career as a Registered Medical Assistant, working alongside doctors and nurses in clinics and hospitals.  \n\nThroughout the course, you will gain hands-on practice with clinical lab skills such as drawing blood, giving injections, and taking blood pressure. You will also gain proficiency in administrative skills, including updating patient records and coding insurance forms. Briya offers the Medical Assistant Program in collaboration with Mary’s Center, providing students embedded learning opportunities with Mary’s Center nursing and medical assistant staff. \n\nUpon completion of the Medical Assistant training program, you will be prepared to take the national Registered Medical Assistant Exam and begin your new career! ','629348329513757','https://www.maryscenter.org/education/job-training/medical-assistant/',NULL,NULL,NULL,'789038541797078','To qualify for the Medical Assistant training program, you must: \nLive in Washington, D.C. \nHave a high school diploma or GED \nPass entrance exams in reading and math  \nProgram Details: \nClasses are held Monday-Thursday, 6:00-9:00 p.m., at Mary’s Center’s Georgia Avenue site \nThe course lasts 12-15 months, including coursework (August through June) and externships and summer test prep sessions (July through August) \nOne month of full-time clinic training at medical centers across the DC area is required \nRegister for the course or call (202) 232-7777 for more information. \n\nMary’s Center and Briya Public Charter School work together to provide health care, social services, and education for residents of D.C. ',NULL,NULL,NULL,NULL,'1307595059042459',NULL,NULL,'868012483124236,1224478530518610,1227957138475220','732086812000340',NULL,NULL,NULL),(185,797834103829212,'Cornerstone Building/Emergency and Transitional Safe Housing','Cornerstone Residence',983721114373124,'When it opened in November 2010, the Cornerstone Residence became the District’s largest dedicated safe housing program. Here, DASH provides 42 apartment units for survivors of domestic violence and their families in crisis. Residents may live at Cornerstone for up to 24 months while working with DASH advocates (case workers) to address their needs and ultimately live safely and independently. All services are offered on a voluntary basis, affording residents the opportunity to determine their own goals toward re-establishing their lives on their own terms. All residents are connected to a range of community resources to help them move toward long-term or permanent housing, as well as emotional and financial independence. ','828792720206018','https://www.dashdc.org/programs-services/safe-housing/',NULL,NULL,'Verified','929094559121639','Call for help or walk in to the housing clinic. Exact locations of residences is kept confidential to protect the safety of our residents. If you are in an emergency, contact National Domestic Violence Hotline: 1-800-799-7233 (SAFE) or 1-800-787-3224 (TTY).',NULL,NULL,NULL,NULL,'871700855571478','900562936646293',NULL,'1212718840001878','1043474797867812',NULL,NULL,NULL),(186,740916631620812,'Food Assistance',NULL,726173106231202,'Families and individuals rely on the Mission’s food assistance program in emergencies and as a steady source of food.\n\nIn partnership with individuals, corporations and churches, the Mission distributes almost $8 million worth of in-kind food, toiletries, clothing and household items each year.','838780960881380','https://www.missiondc.org/what-we-do/family-programs/food-assistance/',NULL,NULL,'Verified','832990803111047','Call or walk in for help.\n\nIf you are currently in need of assistance outside of FMC operating hours, please contact the Hunger Lifeline at (202) 644-9807 (Monday-Friday 9am–5pm) or visit the Food Bank Network Website or DC Food Finder Website to search for services such as food, healthcare, housing, and job training. If you are in need of furniture, contact A Wider Circle at (301) 608-3504.',NULL,NULL,NULL,NULL,'842965887033119','598863931807682',NULL,'1292849277583603','601101607323805',NULL,NULL,NULL),(187,753253159497862,'Family Homelessness Prevention',NULL,1245236106154921,'Everyone Home DC’s Homelessness Prevention Program offers services for families at risk of becoming homeless through mediation, flexible financial assistance, and connecting them to supportive resources. Families who come to Everyone Home DC for support are often living temporarily with relatives and friends, moving frequently. They find themselves on the verge of homelessness and are seeking assistance to stabilize their housing.\n\nEveryone Home DC’s prevention specialists serve as supporters and champions for clients, assisting families with developing a plan, identifying resources, and setting goals that will allow them to remain stably housed and connected to their natural systems of support, rather than having to enter the shelter system.','936934819762396','https://everyonehomedc.org/programs/family-homelessness-prevention/',NULL,NULL,'Verified','929094559121639','Access to Everyone Home DC’s Homelessness Prevention services comes through referrals from the Virginia Williams Family Resource Center, the central intake for DC’s coordinated homelessness assistance system for families. If you know a family encountering a housing crisis that they cannot resolve on their own, they can access homelessness prevention advice and program assistance referrals exclusively through the Virginia Williams Family Resource Center (920 Rhode Island Ave NE, Washington, DC 20018 | (202)-526-0017).',NULL,NULL,NULL,NULL,'735608882009072','832596400468443,1170433044969408',NULL,'966756126649195,1292849277583603','811198505758894',NULL,NULL,NULL),(188,759287871630149,'Early Childhood Education',NULL,682552065545256,'Healthy Families and Early Head Start foster learning and development in children and provide parents with the tools to continue this growth. In addition to SERVE’s Early Head Start classroom, home-based programs help families build strong parenting skills and ensure children are healthy and meet developmental milestones.','764854375292129',NULL,NULL,NULL,'Verified','789038541797078','Call to enroll.',NULL,NULL,NULL,NULL,'736909404940832,964860483808020',NULL,'998959625812107','1274396898894043,826113037014422','1341470966230086',NULL,NULL,NULL),(189,757654002604408,'Temporary Housing at Girard Street Apartments',NULL,1195870505334629,'Located in the Columbia Heights neighborhood of Northwest, DC, Girard Street Apartments provides apartment-style emergency shelter for 20 homeless families with children.\n\nAt their most vulnerable moment, families find safety and security. From the first day they enter our program, families begin to search for long-term housing and develop a family stability plan, which includes a wide range of supportive services and resources:\n\nGoal-oriented case management Assistance on finding an affordable apartment\nConnection to employment and training\nConnection to behavioral health services\nLife skills classes on parenting\nChildren’s activities\nBudget and financial management\nConnection to community resources.','984945374868800','https://www.communityofhopedc.org/girard-street-apartments-0',NULL,NULL,NULL,'929094559121639','Access to these services comes through referrals from the Virginia Williams Family Resource Center, the central intake for DC’s coordinated homelessness assistance system for families with children.\n\nVisit this page for exact info: https://www.communityofhopedc.org/housing/how-can-i-access-services',NULL,NULL,NULL,NULL,'958866684536217,612480373273711','656180073780206,1268157148852129',NULL,'966756126649195,877243931325915','1180267371580937',NULL,NULL,NULL),(190,762888373958688,'Senior Medicare Patrol (SMP)','SMP',1093127605400642,'The SMP DC office empowers and assists Medicare beneficiaries, their families, and caregivers to prevent, detect, and report health care fraud, errors, and abuse through outreach, counseling, and education. DC SMP is a grant-funded project of the federal U.S. Department of Health and Human Services (HHS), U.S. Administration for Community Living (ACL). Our work is in three main areas:\n\nConduct Outreach and Education:  SMP DC gives presentations to groups, exhibits at events, and works one-on-one with Medicare beneficiaries. In 2013 more than 1 million people were served by the national SMP program outreach and education efforts across the country;\nEngage Volunteers: Protecting older persons’ health, finances, and medical identity while saving precious Medicare dollars is a cause that attracts civic-minded Americans;\nReceive Beneficiary Complaints: When Medicare beneficiaries, caregivers, and family members bring their complaints to - our office, we make- a determination about whether or not fraud, errors, or abuse is suspected. When fraud or abuse is suspected, –we make referrals to the appropriate state and federal agencies for further investigation.','1287901333269561','https://www.aarp.org/legal-counsel-for-elderly/what-we-do/info-2017/senior-medicare-patrol.html?intcmp=AE-LCE-WWD-R1C2LL3',NULL,'LCESMP@aarp.org','Verified','637158405241810,1077790582995406,917725171609009','Call for information',NULL,NULL,NULL,NULL,'793218371104365','885227948751306',NULL,'854808174954754','763163886168100',NULL,NULL,NULL),(191,771396624281852,'Community Support Services',NULL,883186000200856,'Education, school and community consultation, and services provided in the home, school, and other settings to improve parenting, academic, daily living, and behavioral management skills.','920364967013405,1054369210651155','http://hillcrest-dc.org/services/children-services/',NULL,'info@hillcrest-dc.org','Verified','637158405241810','Call or walk-in for services.',NULL,NULL,NULL,NULL,'1097440010596926',NULL,NULL,'1274396898894043,883345659611536,1292849277583603,915486946336080','646846673243288,1261416234116596',NULL,NULL,NULL),(192,770458474126572,'Affordable Housing Development ',NULL,1178149503221687,NULL,NULL,'https://housingup.org/ending-homelessness/developing-affordable-housing/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(193,775820607481251,'Inpatient Psychiatry',NULL,1061724977026001,'Inpatient psychiatry services for children and adolescents at Children\'s National are provided through the Psychiatry and Behavioral Sciences program, one of the earliest pediatric programs in the nation. Throughout our history, we have emphasized a family-centered approach to care for the benefit of patients and their families.\n\nSupport and Inpatient Services\nWe recognize how challenging a child’s illness can be for the entire family, especially when parents cannot see what’s wrong. Mental illness and psychiatric conditions are particularly complex because there are many factors that may influence your child’s emotions and behaviors. As well, the signs and symptoms of a psychiatric condition are often different between younger children and teens.\n\nOur multidisciplinary team is composed of pediatric psychiatrists, nurses, social workers, academic counselors, psychologists, and expressive (art) therapists, who see to all aspects of care. They have extensive experience in the specialized care and treatment of children and teens with complicated emotional and behavioral disturbances.\n\nThe inpatient unit was specifically designed to meet the developmental and psychiatric needs of children and adolescents. We offer two separate programs to meet the distinct medical needs of children and teens — a 12-bed unit for patients aged 2-12 and a 14-bed unit for those aged 13-17. Working closely with pediatric specialists at Children’s National, we can also treat patients with other medical conditions on the psychiatric unit, including children with diabetes, HIV, and eating disorders.','1282604214927911,856126341619748,979447652621070','https://childrensnational.org/departments/psychiatry-and-behavioral-sciences/inpatient-psychiatry',NULL,NULL,NULL,'941516382466411','Call or visit website to make an appointment or refer a patient.',NULL,NULL,NULL,NULL,'1220504141221415','892012398827551,1095419747725144,587218394770946',NULL,'1274396898894043,798275500344709','928813128095347,787442654546775,1067302604787333',NULL,NULL,NULL),(194,777260696695053,'C.R.E.A.T.E.','Children Reaching Educational Achievements Through Enrichment',761153930697275,'When children are supported, motivated, and celebrated, there’s no end to what they can accomplish! That’s why it’s so important to keep them occupied and educated after school, over the summer, and whenever else they need attention and encouragement.\nUPO’s Children Reaching Educational Achievements Through Enrichment (C.R.E.A.T.E.) program provides a safe, secure place for children to interact with their friends as they learn new things, eat healthy snacks, and think differently.','594960886051316,999755198000719','https://www.upo.org/youth-services/',NULL,NULL,'Verified','789038541797078','Please call to enroll.',NULL,NULL,NULL,NULL,'757819596231988,665905423802380','587544010010943,940897095189363,682372519823224','773180771408189','740331137219886','1304904589817191,1166860713798541',NULL,NULL,NULL),(195,789456565791843,'Men and Boys Program',NULL,727757843857751,'The goal of the Men and Boys program is to provide men and boys with support services and opportunities to increase fathers’ ability to contribute positively to the well – being of their children, improve the quality of relationships between fathers and the mothers of their children.','1286648129611472','http://www.fsfsc.org/family-services',NULL,NULL,'Verified','637158405241810','Call for more information.',NULL,NULL,NULL,NULL,'932602737976044,1191551618847760','864359470475118,1202312403680116',NULL,'900766491176234,625195015492370,908163423675008','1231516890380928',NULL,NULL,NULL),(196,797891805827498,'The Pathways for Young Adults Program (PYAP)',NULL,1262229839027778,'The Pathways for Young Adults Program is designed to assist out-of-school and out-of-work District residents ages 18-24 by combining occupational training, life skills development and work readiness instructions to connect them back to the world of work successfully.  The three areas of occupational training include allied health, administrative Services and basic IT/Admin. Tech. \n\nThrough PYAP, we strive to provide youth with the opportunity to:\n\nGain meaningful work experience through a paid internship; \nLearn and develop skills, attitudes and commitment necessary to succeed in today’s world of work; while interacting with dynamic working professionals in a positive work environment.;\nReceive occupational training necessary to gain a nationally recognized credential within the specialized field of interest.\n Recruitment and Enrollment\n The Pathways for Young Adults Program operates in a cohort format. Specific dates are provided to each participant /vendor as the participant matriculates through all phases. For more information contact: YouthJobs@dc.gov .\n\n\nProgram Structure\nThe PYAP is designed for youth to combine occupational training and work-readiness instruction to connect youth to meaningful industry-oriented work experience. Youth will be assigned to an internship with an approved employer. Youth must commit to work between 25-40 hours per week throughout all phases of the program. \n\nPhase I: Occupational Training \nPhase II: Work Readiness \nPhase III: Internship Experience ','1191156779628062,871972134291589,968786376614445,945061241324147','https://contemporaryservices.net/programs-and-services/',NULL,NULL,'Not vetted',NULL,'Walk in for services',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1070225300187916,1222973168897685','1240535751990184,1104690815663262,594681114588627,1156542764196212',NULL,NULL,NULL),(197,800132260226272,'Children\'s Program',NULL,1326157862705937,'MBI\'s Youth Division services children ages 5-17 and their families. Services include individual therapy, group therapy, family therapy, community support, psychiatry and school based.\n\nServices Provided:\n\nDiagnostic Assessments; referral for Psychiatric Assessment/Medication Management\nTreatment Planning\nCrisis Interventions\nIndividual Therapy\nGroup Therapy\nPlay therapy\nClassroom Observations Parent & Teacher Trainings\nWellness, Education, & Prevention Programs\nEarly Recognition & Screening Program\nReferral for Hospitalization & Specialty Care','609550690795774','http://www.mbihs.com/what-we-offer/children%27s-program',NULL,NULL,'Verified',NULL,NULL,NULL,NULL,NULL,NULL,'929037191615824',NULL,NULL,'910994843667047,1274396898894043','1231516890380928',NULL,NULL,NULL),(198,803655377623585,'Legal Hotline',NULL,1093127605400642,'Legal Counsel for the Elderly’s Legal Hotline provides free legal advice, assistance, and referrals to:\n\nAll D.C. residents 60 years of age or older\nD.C. residents 55 years of age or older with Social Security and Supplemental Security Income disability issues\nD.C. residents 18+ regarding D.C’s home adaptation program, Safe at Home\n\nCallers first speak to our intake specialists, who gather information including name, address, date of birth, marital status, household members, income and asset information, and a general description of the legal problem or question.\n\nOur intake team includes staff who are bilingual in Spanish and English. Intake specialists provide this information to the hotline attorneys who are authorized to practice law in the District of Columbia. Hotline attorneys return calls as promptly as workload permits.\n\nThe Legal Hotline attorney gathers further information about the question or problem, and provides advice or assistance. If the problem requires further legal representation, the hotline attorney can refer the client to an LCE staff attorney or other programs depending upon the nature of the issue and program limitations on client income and assets.','1287901333269561','https://www.aarp.org/legal-counsel-for-elderly/getting-help/?intcmp=AE-LCE-WWD-R1C1LL5',NULL,NULL,'Verified','637158405241810,1077790582995406,917725171609009','Call for information',NULL,NULL,NULL,NULL,'1154003895918016','885227948751306',NULL,'868012483124236,1183802898164393,897000577913584,1131844892985746','763163886168100',NULL,NULL,NULL),(199,801873048546872,'Community Meal',NULL,1013543362848937,'We provide a free nutritious meal every Tuesday from 5:30 pm - 6:30 pm. Everyone is invited so please join us.','628637355176202','http://www.hughesmemorial.org/ministries.aspx',NULL,NULL,'Verified','832990803111047','Walk in.',NULL,NULL,NULL,NULL,'905425032669080','862251806175777',NULL,NULL,'1190125799561725',NULL,NULL,NULL),(200,806428640646955,'Consumer Law',NULL,820488001755900,'Currently, we are only able to provide advice and brief services for most consumer issues.\n\nWe will consider handling the following consumer problems for clients who meet our income guidelines:\n\nCollections\n-Improper collections practices\n-Garnishments of exempt funds\n-Illegal harassment by debt collectors\n-Illegal fees or excessive interest rates\nWrongful repossession of vehicles\nPredatory or Deceptive Practices\n-Predatory or deceptive lending or installment purchase practices\n-Unlicensed contractors\nWrongful termination of public utilities\nContracts and warranties\n\nWe may offer advice and brief services for other consumer issues. If we cannot assist you, we will help find an organization that can.\n\nNLSP also helps staff the Small Claims Resource Center in DC.\nThe Small Claims Resource Center provides legal and procedural information to Plaintiffs and Defendants involved in Small Claims Court proceedings in the District of Columbia, as well as to individuals considering filing actions in Small Claims Court.','931728525653879,1053529725692782,647497712481280','http://www.nlsp.org/services/consumer-law',NULL,NULL,'Verified','917725171609009','Call or walk in during intake hours for an intake. Income eligibility guidelines (http://www.nlsp.org/eligibility) may be flexible on a case by case basis.',NULL,NULL,NULL,NULL,'1129255270268768','1084017663290159,1199926477647156',NULL,'868012483124236,740778097678832,1304855358240586','669385991599023,762902046422581,1290871308678350',NULL,NULL,NULL),(201,807525744099302,'UPO Inspire',NULL,761153930697275,'We seek to improve the career trajectory for the smart, the motivated, and unfortunately, the often overlooked talent in Washington DC\n\nThrough technology training, UPO Inspire aims to improve the career prospects of locals residents who are committed to pursuing a path towards sustainability.  Because when people work their way out of poverty, good things happen.  Positive contributions to society.  Local businesses have access to top rated technical skills.  It\'s a win-win. \n\nThe UPO Inspire Technology Training Initiative is designed to increase middle-skill job opportunities for those on the edge of poverty.  This program attempts to close this opportunity gap by funding job training and support for underemployed individuals. Our students undergo comprehensive well-rounded IT training covering help desk support, technical professional development, and career and social coaching.  32 weeks in duration (at a minimum) combining in-class sessions and internships, students receive their CompTIA A+ certification upon successful completion.','594960886051316,999755198000719','https://www.upoinspire.org/',NULL,NULL,'Verified','789038541797078,970915508638448','Call to find out more information about enrollment.',NULL,NULL,NULL,NULL,'665905423802380','587544010010943,940897095189363,682372519823224',NULL,NULL,'1304904589817191,1166860713798541',NULL,NULL,NULL),(202,810517634677025,'Business & Information Technology',NULL,1230770757213322,'Our Administrative Support certification is a great first step towards any entry-level office support position. Learn to navigate computer software, as well as e-mail, the internet, and social media platforms.\n\nCourse Tracks Under Administrative Support:\nBasics for Computer: Learn to demonstrate basic computer skills for home and work. You will learn to navigate programs including Microsoft Office Word, Excel, and PowerPoint. Also gain skills to confidently navigate the Internet, E-mail, and social media platforms. This track provides the tools you need to take online exams and assessments with ease.\n\nMicrosoft Office Specialist: Get the most out of Microsoft Office to advance in any office environment. A Microsoft Office Specialist (MOS) certification in programs such as Word, Excel, or PowerPoint is a good fit for unemployed or under employed entry-level professionals.','771897230838212','https://www.ywcanca.org/what-we-do/career-education-training-center/business-it-fundamentals/',NULL,NULL,'Verified','970915508638448,789038541797078','The application is available online on the program website. You can also call for more information.',NULL,NULL,NULL,NULL,'1173484064031440',NULL,NULL,'836091364973509','1330181492619505',NULL,NULL,NULL),(203,809544210408082,'DC Fiscal Policy Institute',NULL,633605990771272,'The DC Fiscal Policy Institute conducts research and public education on budget and tax issues in the District of Columbia, with a particular emphasis on issues that affect low- and moderate-income residents.',NULL,'http://www.dcfpi.org/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(204,750095723394999,'DC Public Library',NULL,1210512793158453,'The library provides environments that invite reading, learning and community discussion and equips people to learn all their lives, to embrace diversity and to build a thriving city. We are proud to be a recognized force in the community for engaging the mind, expanding opportunities and elevating the quality of life.',NULL,'http://dclibrary.org',NULL,NULL,NULL,'789038541797078',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(205,750465787434275,'Health',NULL,1287130751059247,'Calvary provides therapy and mental health services with a licensed professional, addiction recovery support, and nursing care — all on-site.\n\nWomen at Calvary with a history of domestic abuse have the space and support to begin healing.\n\nCalvary offers daily addiction recovery meetings for women who are working to maintain their sobriety. Meetings are facilitated by an addiction recovery counselor.\n\nWomen receive physical care at Calvary’s facility from a staff nurse. Case managers offer support by coordinating medical appointments and follow-up treatment.','1315826372203677','https://www.calvaryservices.org/program/health/',NULL,NULL,'Verified','941516382466411','To access our services, you must first receive a referral from a core service agency. If they match you with our organization, you will be sent over for an intake. If you have additional questions, please call.',NULL,NULL,NULL,NULL,'1285405208459287','890039510897571',NULL,'836091364973509,877243931325915,1212718840001878','926608893625888',NULL,NULL,NULL),(206,753964791303094,'Lukey Kaempfer Transformation Project',NULL,1306699628219808,'The Lukey Kaempfer Transformation Project will prepare formerly homeless Sasha Bruce clients to enter college by offering a dedicated education coordinator to provide them with an intensive high school navigational experience relevant to college admissions and to coordinate college access planning with each participant to include:\n\n• G.E.D. Preparation (if necessary);\n• After school tutoring;\n• Mentoring (particularly during summer months)\n• Study skills development;\n• SAT/ACT preparation;\n• Career exploration and training opportunities; \n• College tour arrangements and visits;\n• Practical supports on college campuses where participants have enrolled; and\n• College scholarship and financial assistance support. \n\nThe initial cohort will be comprised of 5 prospective undergraduate students during the project’s first year of operation with a plan to add an additional 5 SBY clients annually (until the program reaches a maximum of 25 students).','1083708956779513','https://www.sashabruce.org/workforce-development/',NULL,NULL,'Verified','789038541797078','Candidates interested in joining the cohort group will be required to complete a career interest inventory in addition to submission of school records and a reference for college/career readiness from a SBY program manager.  Client credentials will be reviewed by project supporters to include a representative from the Kaempfer Family; a member of the SBY Board of Directors; a representative of the SBY’s Community Impact Council; SBY’s Chief of Programs; and a member of the SBY Senior Team.',NULL,NULL,NULL,NULL,'1173443518827100',NULL,NULL,'883345659611536','626337120120757',NULL,NULL,NULL),(207,772454821683547,'Health and Wellness',NULL,783236314114871,'Our two psychiatrists and general practitioner seek out clients who do not have access to basic medical care and psychiatric treatment and help them address the underlying issues that may cause their homelessness. Weekly, the psychiatrists engage and treat our guests in the Drop-in Center, residents in our winter shelter, and those with whom contact is made by going to them on the street.\n\nOur psychiatrists make referrals to AA, detox, and addiction treatment programs and perform comprehensive medical assessments needed to qualify for S.S.I. benefits. They are available for emergencies and, if necessary, for preparing emergency psychiatric evaluation petitions in the case of dangerous behaviors. Most of the time, the psychiatrists provide crisis intervention and offer the opportunity for treatment and S.S.I assessments because it is the insidious nature of mental illness that individuals are in denial of their illness.\n\nOur general practitioner sees patients in our Drop-In Center and accompanies staff on street outreach one morning a week. She checks blood pressure, listens to people’s heart and lungs, tests blood sugar, manages chronic diabetes or hypertension, dispenses medication or writes prescriptions, makes referrals, and calls an ambulance when needed. She also engages in health counseling aimed at reducing or stopping drinking, smoking, and the use of drugs, as well as addressing nutrition and other self-care priorities.','865999041296626','https://georgetownministrycenter.org/programs/health/',NULL,'info@gmcgt.org','Verified','941516382466411','Call or walk in to apply for services.\n',NULL,NULL,NULL,NULL,'658265377894745','1251235179498072',NULL,'877243931325915','807078925662836',NULL,NULL,NULL),(208,782799413098806,'LGBTQ Programs',NULL,1180598613249590,'Through transportation, housing, volunteer services, and more, Seabury Resources for Aging supports older adults and people with disabilities of all sexual and gender identities and expressions. \n\nOut and About connects DC LGBTQ older adults through wellness programs, cultural events and conversations designed to address the concerns within the community. It is our mission to better understand the growing needs of LGBTQ older adults through listening, creating, and delivering programming with sensitivity, knowledge, and pride.','1183011241112934','https://www.seaburyresources.org/lgbtq-programs',NULL,'kfuller@seaburyresources.org','Verified','637158405241810','Call or email for more information.',NULL,NULL,NULL,NULL,'762056949976027','1176087327224268',NULL,'854808174954754','743160673924882',NULL,NULL,NULL),(209,784134299150571,'Computer Training',NULL,1004391421304549,'ACSGW offers various classes with the goal of helping you to become self-sufficeint. Classes are very reasonably priced to help us pay for the instructors and to ensure that clients are invested in their education. \n\nBeginning Computer Training, familiarizes students with computer and their applications emphasizing their use in the work place, college and for future careers. Students learn about the Internet, email, web browsing for jobs and school application and social media.\n\nIntermediate Computer Training, students learn Microsoft applications for the work place, Microsoft word, Excel for data entry and PowerPoint for creating presentations and the use of scanners and printers','950009053464384','https://www.acsgw.org/education.html',NULL,NULL,'Verified','789038541797078','For more information or to learn how to register for a class please call us.\n',NULL,NULL,NULL,NULL,'937322777502476','1115292082523782',NULL,NULL,'877682236637760',NULL,NULL,NULL),(210,784403343985076,'School-based Behavioral Health Services',NULL,883186000200856,'Mental health services offered through a 3 tiered approach at area schools in the District.','920364967013405,1054369210651155','http://hillcrest-dc.org/services/children-services/',NULL,'info@hillcrest-dc.org','Verified','941516382466411','Call or walk-in for services.',NULL,NULL,NULL,NULL,'1097440010596926',NULL,NULL,'1274396898894043,883345659611536','646846673243288,1261416234116596',NULL,NULL,NULL),(211,784662874544792,'Transitional Age Youth Division (TAY)','TAY',1326157862705937,'TIP (now known as our TAY Program) has been one of MBI Health Services’ shining programs found within its walls. Kids ranging from 14 years to 29 years of age are able to experience a different, and much more positive way of life with the help, and guidance, of the TAY Team found at our headquarters location in Washington D.C. \n\nThe Transition to Independence Process Program is an evidence-based practice for youth that range between 14 to 29 years of age.  By using the Seven TIP Core Practice Modules (SCORA, What’s UP, Rationales, SODAS, In-Vivo, Strength Discovery/Needs Assessment, Future’s Planning), youth are able to move towards independence in life.  ','959978038980815','http://www.mbihs.com/what-we-offer/transitional-age-youth-division-%28tay%29',NULL,NULL,'Verified','637158405241810,1232587316936391','Call to join the program.',NULL,NULL,NULL,NULL,'929037191615824',NULL,NULL,'627208723437175','817410769508748',NULL,NULL,NULL),(212,789715981823462,'Psychiatry Clinic',NULL,802521051916688,'The Community Connections Psychiatric Clinic provides access to Board Certified psychiatrists and nurses. The clinic provides integrated psychiatric care to all interested Community Connections clients (adults, children, and youth) and works closely with their treatment teams. Services provided in the clinic include assessment, medication management, lab work, and nursing services. Psychiatrists and nurses working with the Assertive Community Treatment teams often meet clients in the community. ','1044869288351593','http://www.communityconnectionsdc.org/our-services/integrated-care',NULL,NULL,NULL,'941516382466411','Call or walk in for more information.',NULL,NULL,NULL,NULL,'1125537818767812','1060463085599565',NULL,'868012483124236,1200033126219686,866965462945330,804517213435343,937643355135162,1227486019167060','872487510282336',NULL,NULL,NULL),(213,785647685413221,'Coming of Age',NULL,970560028876577,'Coming of Age in Maryland (CoA) is an interagency collaboration between JSSA and Premier Homecare, Bender JCC of Greater Washington, and Jewish Council for the Aging that offers social and educational events for seniors. Participation in CoA is an easy way for older adults to stay engaged, active, and independent. Registration for activities is open to individuals age 60+ of all faiths and ethnicities living in Montgomery County. There is no membership fee to join.','1104646684650585,1321118518935089','https://www.jssa.org/get-help/seniors/social-programs/coming-of-age/',NULL,NULL,'Verified','637158405241810','Brochures and registration forms are available on the website.',NULL,NULL,NULL,NULL,'815545569707089,1047807433568619','799390782148011,823008542949204,790762956605328,1094678156609302,1113885469544387',NULL,'1053289039718908,1183802898164393,1227383950401000','1328302797893590,1218692669680880',NULL,NULL,NULL),(214,802536341225895,'SAMARITAN INNS: INTENSIVE RECOVERY PROGRAM',NULL,745762970824360,'Offers 3 phases of treatment for homelessness and addiction.','984550353973330','http://samaritaninns.org/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'780151548177804',NULL,NULL,NULL),(215,814817282883148,'Pre-K (3-5 years)',NULL,580772169029651,'The pre-K classrooms are designed to provide a safe, open environment in which children can explore, discover and participate in daily activities. Students must learn how to use large and fine motor to communicate, solve problems, and socialize with their peers. They’re encouraged to show mutual respect among peers and adults. The preschool classrooms are composed of many challenges in different developmental areas to meet children’s needs and developmental skills. Examples of such include block areas, dramatic areas, house areas, reading corner, manipulative area, art, and music corner. The stage of trust and autonomy is reinforced.','813926334906214,1191165945054651,816301601038577','https://barbarachambers.org/programs/',NULL,NULL,'Verified','637158405241810','Enroll your child online.',NULL,NULL,NULL,NULL,'986167438798239,1090445511708047,574820988537178','640276804195373',NULL,'805633029474383','1219279263504235,1258337392299415,1309359311970768',NULL,NULL,NULL),(216,812376267113321,'Young Families',NULL,1323195974089796,'LAYC offers a housing program, Hope’s House that caters to single parents with one child. Hope’s House is a nine-month transitional living program for youth who are homeless or unstably housed and should be able to demonstrate that they have begun to the build skills needed to live independently before beginning the program.\n\nYouth live in studio apartments with their child, meet weekly with a case manager, and are offered wrap-around services and parenting classes while in the program. Bilingual services in English/Spanish offered.\n\nHope’s House is located in an apartment building in northwest Washington, DC. The location is unlisted.',NULL,'http://www.layc-dc.org/what-we-do/safe-housing/young-families/',NULL,NULL,'Verified','929094559121639','Call for more information. Location is unlisted.',NULL,NULL,NULL,NULL,'1165471269627538','1353902664253088','942787076035093','1292849277583603,1295679372454826',NULL,NULL,NULL,NULL),(217,814382562390416,'Case Management',NULL,964008795352849,'Comprehensive outpatient services are offered to those consumers who are HIV+:\n\nSupport groups, counseling, and auxiliary services\n\nHIV One-on-One Education\n\nEntitlements (social, medical and mental health)\n\nADAP applications and follow up\n\nHealth Insurance (Medicare, Medicaid, DC Health Alliance)\n\nHousing referrals, SSI Benefits\n\nFood, water and childcare vouchers','803526594539754','http://www.rapinc.org/case.html',NULL,NULL,'Verified','941516382466411,637158405241810,832990803111047','Call to make an appointment.',NULL,NULL,NULL,NULL,'747827439705313','1206135641605542,1203598271271102',NULL,'664148755918958,780785826421817,915486946336080','601647045974328',NULL,NULL,NULL),(218,816660270769024,'Explorer Camp',NULL,1085490883099798,'A summer christian camp with various activities six weeks long during the day.','1146981306227913','http://www.nbmchurchdc.org/ministries.html',NULL,NULL,'Verified','637158405241810','Call to apply.',NULL,NULL,NULL,NULL,'731593628942678',NULL,NULL,'1274396898894043,1292849277583603','1217909742971397',NULL,NULL,NULL),(219,818563649469922,'Ward 8 Drug Free Coalition',NULL,727757843857751,'The mission of the Ward 8 Drug Free Coalition is to develop and implement comprehensive community-based activities designed to provide youth with positive alternative life choices.\n\nThe coalition engages Ward 8 youth, ages 11-17, in year-round programming designed to reduce alcohol, marijuana, tobacco, and synthetic drug use among youth through community engagement and peer intervention.','1286648129611472','http://www.fsfsc.org/copy-of-family-services',NULL,NULL,'Verified','941516382466411','Call for more information.',NULL,NULL,NULL,NULL,'932602737976044,1191551618847760','864359470475118,1202312403680116',NULL,'1274396898894043','1231516890380928',NULL,NULL,NULL),(220,760997112833771,'Online LGBTQ Resources',NULL,636426656659289,'An online resource page of various LGBTQ services in the DC area and nationwide.',NULL,'http://www.wandaalstonfoundation.org/resources/',NULL,'info@wandaalstonfoundation.org','Verified','637158405241810','Visit our website and click on the resources link.',NULL,NULL,NULL,NULL,'625109799377934',NULL,NULL,'1186681173947755',NULL,NULL,NULL,NULL),(221,762171918332918,'Care Management for Seniors',NULL,970560028876577,'Geriatric care managers meet with clients either at a JSSA office location or in their home to help address a wide range of concerns and to conduct a comprehensive needs assessment. Family members are encouraged to be a part of this process. After the initial needs assessment, the care manager will work with the older adult and their family to develop a detailed plan of care, including recommendations and referrals.\n\nServices could include:\n\n- Assistance with medical appointments, including transportation\n- Communication and family issues\n- Home-delivered meals\n- Home repair and maintenance coordination\n- Medical and legal needs coordination\n- Monitoring home care services (housekeeping, personal care)\n- Paperwork organization and bill paying\n- Relocation and moving assistance\n- Safety concerns\n- Socialization issues\n- Shopping and errands (through JSSA’s volunteer programs)\n\nClients are provided access to:\n\n- Mental health counseling to address a variety of difficult life challenges and situations (such as anxiety, caregiving, depression, dementia, family concerns, grief, health concerns, making difficult decision, moving and retirement issues)\n- JSSA and community workshops and groups\n- JSSA and community resources\n\nJSSA’s care managers act as advocates, consultants, and educators prioritizing the unique needs of each of their clients.','1104646684650585,1321118518935089','https://www.jssa.org/get-help/seniors/care-coordination-for-seniors/',NULL,NULL,'Verified','637158405241810','Call for services.',NULL,NULL,NULL,NULL,'815545569707089,1047807433568619','799390782148011,823008542949204,790762956605328,1094678156609302,1113885469544387',NULL,'1053289039718908,854808174954754','1328302797893590,1218692669680880',NULL,NULL,NULL),(222,759682631849783,'Ready2Work',NULL,726173106231202,'Ready2Work is a street-cleaning and beautification service provided by formerly homeless and unemployed men and women for six Business Improvement Districts in the city.  The 12 to 18 month program provides participants employment and the opportunity to develop and enhance on the job skills.  Participants also receive social service support, adult education and employment counseling to prepare them for successful long term employment.','1154195373907801','https://www.missiondc.org/what-we-do/mens-ministry/workforce/',NULL,NULL,'Verified','970915508638448','Call for more information. This program is offered to men at the shelter.',NULL,NULL,NULL,NULL,'842965887033119','642319256352941',NULL,'1319255723578292,800545996069324,625195015492370,877243931325915','585594366267961',NULL,NULL,NULL),(223,765385785732538,'Change Your Lease','Keep Safe Housing',983721114373124,'The 2005 Violence Against Women Act gives survivors of domestic violence the right to bifurcate their lease, removing their abuser. By calling us or visiting our walk in clinic, we can help you make this happen.','828792720206018','https://www.dashdc.org/housing-resource-center/maintain-housing/',NULL,NULL,'Verified','917725171609009','Call us or visit our walk in clinic access a letter to send to your landlord requesting bifurcation. You may be asked to provide documentation such as a letter from an advocate or court or policy documents. If you are in an emergency, contact National Domestic Violence Hotline: 1-800-799-7233 (SAFE) or 1-800-787-3224 (TTY).',NULL,NULL,NULL,NULL,'871700855571478','900562936646293',NULL,'777455803391753,1256136937607288,1212718840001878','1043474797867812',NULL,NULL,NULL),(224,775111969675006,'Basic Needs Services',NULL,810479025131545,'Shower Facilities with toiletries\nOn Site Laundry (Last Wash at 2:30PM)\nGender Neutral Bathrooms\nCommunity Lunch (Everyday at 2PM)\nClothing Closet\nHousing services with behavioral health support\nLegal Clinic (2nd and 4th Monday from 1-3PM)​','994012462825446','https://www.hips.org/our-services.html',NULL,NULL,'Verified','911225335803318,929094559121639,637158405241810','Call or walk in. Mobile outreach services may be available in your area.',NULL,NULL,NULL,NULL,'1174880928735577,878348692886905','1116823258971812,755877120889008,1239359074339438',NULL,NULL,'1115958014521430',NULL,NULL,NULL),(225,775927218674309,'Social Services',NULL,618997848324116,'Bread for the City cares about the well-being of our community. In addition to offering several community programs, our social workers assist with problem-solving and link friends and neighbors with appropriate resources. \n\nPrograms:\n\nPre-emplyoment Program (PEP)\n- Job readiness\n- Case management\n- Life skills coaching\n- Job placement\n\nRepresentative Payee Program\nA Representative Payee is an individual or an organization designated to receive disability benefits on a client’s behalf. The Representative Payee then helps the client to budget the money and disburses the funds to pay for current needs, including housing and utilities, food, medical expenses, personal care and clothing. The Representative Payee must keep records of how the client’s money is spent. This information is reported regularly to the Social Security Administration or to the Office of Personnel Management.\n\nWomen Empowered\nWomen Empowered is a wellness program for BFC clients that seeks to help them to achieve overall wellness of the mind, body, and spirit.  Participants are assigned a wellness coordinator and included in a supportive environment offering a wealth of workshops and activities. For additional information, please contact Donnie Hampton, SE Social Services Supervisor, at 202-587-0530.','858837023472383,1058560288612968','https://breadforthecity.org/social-services/',NULL,NULL,'Verified','637158405241810','Call for services.',NULL,NULL,NULL,NULL,'592888047524221,606695908675970','1093418067022998,1317865313753055,620597234198028',NULL,NULL,'941976438893110,786471426290380',NULL,NULL,NULL),(226,785698484366760,'Nutrition & Food',NULL,1168436736852155,'At Vida Senior Centers we take care of the nutrition and diet of our participants. To do this, VIDA has a licensed nutritionist / dietitian who supervises the food services of our participants. Our nutritionist also offers nutritional and diet counseling individually and in groups. The nutritionist works in coordination with the Health Promotion Counselor to put emphasis on people with high risk of diabetes and high blood pressure. Individual and group counseling are done with the objective of helping participants establish a healthy diet, by promoting informed decisions regarding their food. It is always emphasized that a healthy diet helps prevent and manage chronic diseases such as diabetes, hypertension and obesity. In addition to the classes, the nutritionist also offers demonstrates of healthy cooking. Depending on the season and seasonal vegetables or fruits, healthy meals are prepared. The nutritionist regularly uses food from the Food Bank box so that we teach participants how to use those ingredients in the healthiest way possible. Participants are also educated on important issues related to nutrition such as: learning to keep food in good condition; modify recipes to make them healthier; improve decisions when buying food; use healthy portions of meals; and pay attention to their weight. They are often reminded of the importance of having breakfast and not skipping meals to avoid spikes and drops in sugar levels. In addition to that, VIDA gives breakfast to 50 participants in our two centers. We do not have a subsidy to provide breakfast, but for the past year VIDA has obtained private donations of bread and cereals that allow us to deliver breakfast in the morning to 50 people. In addition, we offer free lunch to about 120 people daily. Thanks to the support of the Washington DC Department of Aging, we deliver around 120 hot lunches daily between our two centers, Monday through Friday. Additionally, Vida Senior Center is an official distributor of the city\'s Food Bank, with which we distribute to each participant one meal box per month. In summary, nutrition and food activities are as follows:\n\n• Free light breakfast: coffee / tea and bread or oatmeal\n• Free lunches\n• Individual nutrition assessments\n• Individual diet tracking\n• Group classes on nutrition\n• Healthy food demonstrations\n• Monthly distribution of a Food Bank box\n• Individual counseling to handle stress situations\n• Group counseling on frustration management techniques\n• Tai-Chi exercises to learn to breathe and relax the body\n• Classes on Positive Thinking\n• Classes on Mental and Emotional Health\n• Referral to doctors if the need is identified','646558365152210,632725434790464','http://box2142.temp.domains/~vidasen1/nutrition-food/',NULL,NULL,'Verified','941516382466411,832990803111047','Call to join the center.',NULL,NULL,NULL,NULL,'1147869714969920','592146566922528',NULL,'1295679372454826,854808174954754','990219526768898,620565499902964',NULL,NULL,NULL),(227,784304581015971,'Enroll in Insurance',NULL,1195870505334629,'Community of Hope can help you explore affordable health insurance options for you and your family through DC Health Link.\n\nDon’t have insurance? Need to change plans? Not sure what kind of coverage you need?  Problems enrolling with Medicaid? Get free one-on-one expert help from a Community of Hope Enrollment Assister at any of our locations!\n\nOur Enrollment Assisters are \nDC Health Link Certified trained experts who help you:\n\nNavigate the DC Health Link website\nReview your available health insurance options and help you enroll in quality coverage that meets your unique needs\nSubmit Medicaid applications (including DC Healthcare Alliance)\nAnswer your questions about healthcare coverage, including deductibles, co-pays, network coverage, and any other questions\nFind the right medical, dental or vision insurance plan for you and your family. See if you qualify for a tax credit or Medicaid.','1090162375763715,1146632771763115','https://www.communityofhopedc.org/healthcare/enroll-insurance',NULL,NULL,NULL,'637158405241810','No appointment necessary to meet with an Enrollment Assister.',NULL,NULL,NULL,NULL,'665495770462606,763524779006557,1279880844015186','1257079363804425,1223815259564202,1305096827911095,1201313382171851,961771055926549',NULL,'858010753970278','1016957397804274,771726091253980',NULL,NULL,NULL),(228,789912082269332,'Handicap-accessible Bus Rentals',NULL,855094084464049,'Handicap-accessible Bus Rentals\nCatch a JCA bus — or rent one for your group! Groups throughout the metropolitan D.C. area can rent our handicap-accessible buses, most seating 18-20 passengers. In addition, many buses run regular routes, taking seniors to the JCA Misler Adult Day Center, Montgomery County Senior Centers, the grocery store and other essential destinations.\n\nAll JCA drivers have commercial licenses and are specially trained to meet seniors’ needs.','924628911683577','https://accessjca.org/handicap-accessible-bus-rentals/',NULL,'mgalil@AccessJCA.org','Verified','632609508449013','Contact the JCA Rose & Harold Kramer Center on Transportation\nPhone: 301.468.6280 or 703.652.1510',NULL,NULL,NULL,NULL,'957166179094598,1046945308097127','1276016050822057',NULL,'854808174954754','1050035692418764',NULL,NULL,NULL),(229,810344496794884,'Assistance to Crime Victims',NULL,1116810105858975,'Through this program, CARECEN informs Latinos who have been victims of crime or suffered as a result of a crime (such as domestic violence, violent crimes or sexual assault) about their rights and provides direct services to crime victims including applying for compensation and screening for immigration services.','547920365968268','http://carecendc.org/direct-services/immigration-legal-services/',NULL,'info@carecendc.org','Verified','917725171609009','Walk in or call for services. Some services are by appointment only. ',NULL,NULL,NULL,NULL,'1158694379718344','578888268971743',NULL,'1340162113833071,1295679372454826','842193303927915',NULL,NULL,NULL),(230,811709644888130,'HOWARD UNIVERSITY HOSPITAL: COMPREHENSIVE AREA RESOURCES: ENTITLEMENTS AND SERVICES',NULL,636208133431880,'The HUH CARES program provides comprehensive health services, including mental health counseling, to men, women, children and adolescents who are HIV positive. They serve clients who are uninsured or underinsured; clients must be DC residents.','1163808823186351','http://howard.edu/huhcares/default.htm',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1200743429012601',NULL,NULL,NULL),(231,820685180498221,'Urgent Care Clinic',NULL,976379482380679,'Our Urgent Care Clinic (UCC) at the DC Superior Court serves individuals in the criminal justice system who are in need of immediate mental health and/or substance abuse services. Individuals served by UCC can be referred by a judge, pretrial officer, probation officer or an attorney. This partnership between Pathways to Housing DC, the DC Department of Behavioral Health, DC Addiction Prevention and Recovery Administration and DC Superior Court  allows for immediate access to support services and establishes linkages to long-term providers to ensure effective treatment alternatives, prevent repeat offenders, and ultimately, help our clients recover. UCC is one of the first of its kind in the country to provide immediate substance abuse and short-term mental health treatment services to arrestees (many of whom are homeless).','743353111808252','https://pathwaystohousingdc.org/what-we-do/urgent-care-clinic/',NULL,NULL,'Verified','941516382466411','Individuals served by UCC can be referred by a judge, pretrial officer, probation officer or an attorney. This partnership between Pathways to Housing DC, the DC Department of Behavioral Health, DC Addiction Prevention and Recovery Administration and DC Superior Court  allows for immediate access to support services and establishes linkages to long-term providers to ensure effective treatment alternatives, prevent repeat offenders, and ultimately, help our clients recover. ',NULL,NULL,NULL,NULL,'972386234094039','1281502720636268',NULL,'877243931325915','1137409735223363',NULL,NULL,NULL),(232,768832404265850,'Financial Assistance ','Labor of Love Human Service Center',877366768823409,'Based upon a client intake process, persons may be eligible to receive assistance with rent/mortgage, utilities, and  other emergency care needs.','848686188808388','https://www.communityoutreachcdc.org/labor-of-love',NULL,NULL,'Verified','1077790582995406','Call or walk in.',NULL,NULL,NULL,NULL,'1011118711605616','542843689156312',NULL,'1194535092428324','764105236981511',NULL,NULL,NULL),(233,793847249153498,'Homelessness and Housing',NULL,802521051916688,'For more than 25 years, Community Connections has supported individuals and families with establishing and maintaining safe and affordable homes as a part of their whole health recovery. We were an early leader in the District’s effort to develop and implement effective Coordinated Assessment and Housing Placement processes.  We are active with government partners and local coalitions of community providers to expand the availability of housing resources, especially for the city’s most vulnerable individuals and families. In all of these activities, we demonstrate a comprehensive understanding and commitment to the District\'s strategic plan to end homelessness.\n\nCommunity Connections offers a comprehensive range of outreach and residential supportive services to promote housing stability and prevent homelessness – especially with people experiencing mental illness, addiction, and trauma.\n\nOur Homeless Services Program provides outreach to women and men living outside and “in reach” to those staying in emergency and transitional shelters. We offer extensive navigation assistance (e.g., obtaining identification, completing applications, mitigating housing barriers, etc.). We also utilize SAMHSA’s SOAR model to increase access to Social Security disability benefits for people with medical and/or behavioral health issues currently experiencing or at risk of homelessness. Our teams build relationships with people experiencing homelessness to reduce barriers to housing and promote connection with other services.','1044869288351593','http://www.communityconnectionsdc.org/our-services/homelessness-housing',NULL,NULL,NULL,'929094559121639','Call or walk in for more information.',NULL,NULL,NULL,NULL,'1125537818767812',NULL,NULL,NULL,'872487510282336',NULL,NULL,NULL),(234,796710603642968,'HIV Services',NULL,851305007018661,'After more than four decades of serving indigent, underinsured, and uninsured D.C. residents, Andromeda continues to live by its mission of providing culturally accessible and quality health services to District residents living with or affected by HIV. As a multidisciplinary health service provider, Andromeda is fully aware of the economic and psychosocial barriers and obstacles encountered by our participants and in an attempt to address these barriers we aim to expand and improve the range of services available by providing a multilingual and multicultural staff, accessible service hours, and leveraging all payer systems.\n\nOur integrated system of care consists of core medical services: Outpatient Ambulatory Medical Care, Medical Case Management, Treatment Adherence Counseling, Mental Health as well as Substance Abuse Services. Andromeda’s system of care includes the provision of Early Intervention Services, Psychosocial Support Services, and Medical Transportation. Andromeda continues to make its services well known and accessible, promoting HIV prevention and early diagnosis through HIV testing, health education, and providing informative resources. Our aim is to educate our community, reduce the stigma of HIV, increase early detection of HIV and encourage immediate enrollment into care. Our network of supportive services also provides necessities such as food, housing, oral health and legal services, address the individual needs of our participants and provide them with care that is effective to the improvement of their health. Andromeda hopes to continue its provision of all services needed, while adhering to the established protocols and the professional guidance of HAHSTA.','841307455613093','http://andromedahealth.org/our-services/hiv-services/',NULL,NULL,'Verified','941516382466411','Call for an appointment',NULL,NULL,NULL,NULL,'860598871725625','930574528621838',NULL,NULL,'1224638786118966',NULL,NULL,NULL),(235,792954474348824,'Family & Community',NULL,NULL,NULL,'836904778271068,621638073150979,1120989994777643,1261460579474983','https://www.mazique.org/services/',NULL,NULL,'Verification in Progress','637158405241810',NULL,NULL,NULL,NULL,NULL,'1200602057472122',NULL,NULL,NULL,'626820886744559,882267988490168,920259856619905,913507292300030',NULL,NULL,NULL),(236,794796274007587,'Foreclosure Prevention',NULL,761153930697275,'Are you late in paying your mortgage or concerned about your ability to pay in the future? We provide free assistance to borrowers in distress.\n\nHomeowners who are facing default or have already defaulted too high level on a mortgage may speak with one of our foreclosure prevention counselors or set up a session to discuss their options moving forward.','594960886051316,999755198000719','https://www.upo.org/housing-counseling/',NULL,NULL,'Verified','1077790582995406,929094559121639','Please call to join the next class.',NULL,NULL,NULL,NULL,'853687095165430','587544010010943,940897095189363,682372519823224',NULL,'905876656375498','1304904589817191,1166860713798541',NULL,NULL,NULL),(237,804988563046565,'Assistance',NULL,1004391421304549,'ACSGW offers various types of assistance to qualifying local community members. The specific qualifications vary for different types of assistance. That\'s why the first step is for interested people to call and make an appointment with a case manager, who will conduct an interview to determine your needs, the programs we have available to assist you and to determine your qualifications.','950009053464384','https://www.acsgw.org/assistance.html',NULL,NULL,'Verified','637158405241810','For more information or to schedule an appointment, please call. You can also request an appointment online.',NULL,NULL,NULL,NULL,'937322777502476','1115292082523782',NULL,NULL,'877682236637760',NULL,NULL,NULL),(238,807848846460860,'Healthy Families',NULL,930909694635560,'A program offering assistance to families including:\n- Food assistance\n- Clothing and hygiene\n- Nutrition classes','906651913636867','https://lortonaction.org/self-sufficiency-resources/',NULL,NULL,'Verified','941516382466411,911225335803318,832990803111047','Call to register. Walk in during registration hours.',NULL,NULL,NULL,NULL,'906987068756792','1229690477859335,892622133517119,876311376686616,600743088526043,1256920432035968',NULL,'1292849277583603','1276944443091304',NULL,NULL,NULL),(239,822297863188980,'Clothing Program',NULL,1004391421304549,'Generous and caring community members bring clothing donations to the Adventist Community Services of Greater Washington (ACSGW) center at 501 Sligo Avenue throughout the year. Volunteers then sort the clothing and display the items in the center\'s small store, just like you would see in a retail clothing store, except there are no price tags. The clothing is free for qualifying people.\n\nPeople in need of clothing can schedule a time to discuss their needs with a case manager. The case manager will ensure the person qualifies for our assistance. Upon leaving the case manager\'s office, qualifying clients proceed to the \"store\" to shop. Since our shop is so small and demand is so high, we set limits on the number of items a client can take during any visit. We also ask clients to only shop one day a month and limit their selection to what is needed for members of the client\'s immediate household.','950009053464384','https://www.acsgw.org/clothing.html',NULL,NULL,'Verified','911225335803318','An appointment is required, please call to make an appointment.',NULL,NULL,NULL,NULL,'937322777502476','1115292082523782',NULL,NULL,'877682236637760',NULL,NULL,NULL),(240,825451959778479,'Shelter Hotline',NULL,761153930697275,'No one should be forced to live out on the street, especially during extreme weather conditions.\nAs DC’s one and only provider of transportation services for the homeless, UPO’s Shelter Hotline helps bring people without a place to live to local shelters—no matter the time of year. We also provide those in need with clothing, blankets, sleeping bags, and other items that can help them feel a bit more comfortable.\nThe Shelter Hotline is staffed by a dedicated team of more than 40 employees, with services offered around the clock from November 1 through March 31 and 8 a.m. to midnight from April 1 through October 31. Concerned community members are encouraged to look out for homeless individuals and families in their neighborhood and call to have them transported to the comfort and care of a nearby facility.','1186823261288379','https://www.upo.org/communitywellness/',NULL,NULL,'Verified','929094559121639,878986697513222','Call our hotline.',NULL,NULL,NULL,NULL,'775081687772349,1066322983572364','623621986722153',NULL,'684980356183378','1010090868515533',NULL,NULL,NULL),(241,836738857450646,'Harm Reduction',NULL,810479025131545,'Syringe Access and Disposal\nOverdose education and prevention materials such as Naloxone and Fentanyl test kits\nSafer Sex Materials\nHarm Reduction Counseling','994012462825446','https://www.hips.org/harm-reduction.html',NULL,NULL,'Verified','637158405241810,941516382466411','Call or walk in. Mobile outreach services may be available in your area.',NULL,NULL,NULL,NULL,'1174880928735577,878348692886905','1116823258971812,755877120889008,1239359074339438',NULL,NULL,'1115958014521430',NULL,NULL,NULL),(242,783798317190015,'Preventative Health',NULL,577764298046742,'The objective of this program is to help LGBTQ individuals that are at risk of acquiring or who are diagnosed with a sexually transmitted infection, especially HIV and AIDS, and to ensure clients receive the most scientifically sound information on prevention and treatment to promote a healthy lifestyle. These services focus on educating local communities as a preventive measure.','572381295862246','https://casaruby.org/our-services/#hiv',NULL,NULL,'Verified','941516382466411','Call or walk in to set up an appointment.',NULL,NULL,NULL,NULL,'937785373035309','605106466070807,872554493521158',NULL,'836091364973509','603292299584681',NULL,NULL,NULL),(243,801481287749333,'Christmas for Our Children',NULL,584105465886479,'We give out toys and clothing to children in our community.','1175342324463616','https://smionline.org/emergency-food-and-clothing-pantry/',NULL,NULL,'Verified','911225335803318','Call to find out what the distribution process is this year.',NULL,NULL,NULL,NULL,'1253724292834687','1178533554069502',NULL,'1287462571928756','1268284710606478',NULL,NULL,NULL),(244,799762672906525,'COMMUNITY FAMILY LIFE SERVICES',NULL,786390431879533,'Trinity Arms program offers housing up to two-years, with 13 individual units, offering a stable and supportive housing program. These spacious one, two and three-bedroom, private apartments are available to help families escape homelessness and enable each family group to work towards independence and self-sufficiency.','1266854743896634','http://www.cflsdc.org/housing-programs',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'967673170995278',NULL,NULL,NULL),(245,813051911788426,'Before and After School',NULL,580772169029651,'Our Before and After School Program offers a rigorous academic, cultural, and developmental program. Credentialed bilingual teachers oversee homework completion and provide tutoring in reading, writing, math, science, and computer based learning. Our long term goal lies in demonstrating that Latino students can be academically successful regardless of language proficiency, income level, origin, background, or immigration status. Further, the primary objective of our Before and After program is to improve academic and social-emotional skills, and multi-cultural awareness of the students between 5 and 12 years old.\n\nThe Before and After School Program at BCCC is staffed by individuals from a host of different cultures, with whom children can identify. Participants are encouraged to communicate in whichever language they feel most comfortable speaking, and staff is able to accommodate all levels of language learners. Latino enrollment in DCPS has more than doubled in the last decade. More importantly, it is the need for auxiliary services to reflect this population to ensure their success.','813926334906214,1191165945054651,816301601038577','https://barbarachambers.org/programs/',NULL,NULL,'Verified','637158405241810','Enroll your child online.',NULL,NULL,NULL,NULL,'986167438798239,1090445511708047,574820988537178','640276804195373',NULL,'648529534305998','1219279263504235,1258337392299415,1309359311970768',NULL,NULL,NULL),(246,822106893088278,'Pediatrics',NULL,605134586578120,'\n	•	Wellness Visits\n	•	Sick Visits\n	•	Immunizations\n	•	Flu Shots\n	•	Physicals','770635363010046,1002753920993717','http://eechealth.com/our-services/',NULL,NULL,'Verified','941516382466411','Call for patient intake. If you are already a patient, call to set up an appointment.',NULL,NULL,NULL,NULL,'1198488947117166,877271835912480','761526422726808,895454221155573,951328657288514,776932249812148,1321570127371250,777400646901906,619611122248463,1106120630749215',NULL,'1274396898894043','651804021834110,1128987918758522',NULL,NULL,NULL),(247,830099986846686,'Resilient Scholars Project (RSP)','RSP',769893937425938,'The RSP clinicians provide therapy and case management services to DC children/adolescents and their families affected by trauma and/or loss.  RSP collaborates with youth, their families, and community partner staff to improve their understanding of trauma/loss and allow them to develop coping skills that are healthy and practical.  Weekly sessions provide youth and their families the space to process their experiences and discover their innate resilience.\n\nResilient Scholars Project – School Based (RSP-SB) Services\n\nRSP-SB Services are grounded in evidence-based treatment models such as trauma-focused cognitive behavioral therapy (TF-CBT), play therapy, and mindfulness. The program empowers children and adolescents by highlighting their existing strength.  Throughout the school year, RSP clinicians facilitate group and individual therapy services using games, art, experiential activities, writing, and other modalities that explain concepts to participants in developmentally appropriate ways.  As part of RSP-SB Services, RSP clinicians also provide trainings to partner staff on incorporating trauma and bereavement informed practices into their environments. \n\nResilient Scholars Project – Home Based (RSP-HB) Services\n\nRSP-HB Services are designed to supplement RSP-SB Services by engaging entire families in the treatment process.  Using the trauma adapted family connections (TA-FC) model, RSP clinicians also aim to help families improve access to needed resources, increase safety skills, reduce youth absenteeism from school, and/or improve youth grades over a period of six months.  RSP clinicians build on the treatment models used in RSP-SB Services by incorporating principles from narrative therapy, motivational interviewing, and family systems therapy to work toward goals established with each family.  By participating in activities, games, and conversations that help families learn about trauma/loss, families also work toward improving communication and family cohesion.','1108850981657232,1166799153375505','https://www.wendtcenter.org/c-h-i-l-d-resilient-scholars/',NULL,NULL,'Verified',NULL,'To become a client, please call: 202.204.5021',NULL,NULL,NULL,NULL,'714080995184693','789043683491652',NULL,NULL,'1231165117410316,622488765022102',NULL,NULL,NULL),(248,832915449530060,'LUTHERAN SOCIAL SERVICES: ADOPTION/FOSTER CARE',NULL,1182637329109100,'Provides adoption services for couples and individuals in their 20\'s - 50\'s who are able to provide a stable, secure and loving home environment for a child. Post-adoption services are also available.','1203649171352486','http://lssnca.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'840736952825536',NULL,NULL,NULL);
